('BTY00', ' LIPSTICK SUPER MATTE N°2 ', '                                                                                                                                                Non mentionné                                                                                                                                                                                                                                                                                                   ', '  <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Pour obtenir une couleur rouge beaucoup plus prononcée, appliquez MISTINE SUPER MATTE N°.02 sur les deux lèvres<br>\r\n<b>Etape 2:</b> Puis serrez les lèvres 2 à 3 fois pour unifier la couleur<br>\r\n<b>Etape 4:</b> Si la couleur vous semble trop prononcée, prenez immédiatement après application du rouge à lèvre un mouchoir jetable<br>\r\n<b>Etape 5:</b> Serrez-le fort entre les lèvres<br>\r\n<b>Etape 6:</b> Répétez ce mouvement jusqu’à obtenir une couleur qui vous convienne<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 ', '0', '    <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao madama, Caroline mpanentana ara-barotra avy ao amin’ny One to One Marketing. <br>\r\nTonga eto Madagasikara ny marika MISTINE ilay marika vokatra Cosmétique voalohany any Thaïland, ka ny lokomena MISTINE SUPER MATTE Rouge no ho entiko ho anao androany.<br>\r\nNy mampiavaka ny lokomena MISTINE SUPER MATTE dia noho izy mateza sy maivana ary tsy mifindra izany hoe raha mampiasa azy ianao dia tsy miala mihitsy ny MISTINE SUPER MATTE\r\nna misakafo aza ianao ary tsy re-nao akory hoe manao lokomena ianao satria dia maivana dia maivana ity lokomena ity. <br>\r\nTsy vitan’izany ihany fa mi-hydrater ny molotra  ihany koa ny MISTINE SUPER MATTE ka manala ny vakivaky eny amin’ny molotrao.<br>\r\nKa manao ahoana ny fahitanao azy?<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                            ', '37 ml', ' <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nMISTINE SUPER MATTE n°02 est un rouge à lèvres de couleur rouge matte au parfum vanille<br>\r\nIl illumine les lèvres et fournit un charme somptueux et durable. Les lèvres sont douces, lisses et attirantes<br>\r\nMISTINE SUPER MATTE hydrate les lèvres perverties par les agressions externes et leur donne une finition parfaite en laissant apparaître les fissures naturelles des lèvres<br>\r\nLa tenue du rouge à lèvres MISTINE SUPER MATTE octroie douceur et confort<br>\r\nSon application au pinceau de fine soie en velours doux au toucher respecte la sensibilité de vos lèvres<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                           ', 1, 26, 'ROUGE A LEVRES', 'MISTINE', 'MISTINE', '', 'LIPSTICK SUPER MATTE', '2013-01-01', '2021-12-31', ''),
