('BTY01', ' LIPSTICK PERFECT LIP COLOR N°4 - ROSE .', '                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   Non mentionné                                                                                                                                                                                                                                                                                                                                                                            ', '                                                                                                                                       <b>MODE D’UTILISATION</b><br>\r\n<br> \r\n<b>Etape 1:</b> Appliquer en premier lieu, la base pour bien hydrater les lèvres (la couleur claire)<br>\r\n<b>Etape 2:</b> Serrer les lèvres et les faire frotter délicatement<br>\r\n<b>Etape 3:</b> Appliquer en 2 ème couche le rouge à lèvres de couleur plus imposant<br>\r\n<b>Etape 4:</b> Resserrer les lèvres et les faire frotter délicatement<br>                                                                                                                                                                                                                                                           \r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                  ', '0', ' <b>PRÉSENTATION</b><br>\r\n<br> \r\nSalama tompoko! Izahay avy ato amin’ny orinasa one to one dia faly mampandre fa manana tolotra vaovao mety aminao!<br> \r\nFantatrao ve ny MISTINE PERFECT LIP COLORS? Lokomena manana lafika roa! Ny lafika ambony manamandina sady manalefaka ny molotrao, ny ambany kosa natao mba haneho loko tsara sady mamiratra  eo amin’ny molotrao, marihina fa tsy hita be ilay izy kanefa mahita fiovana ianao eo amin’ny endrikao.<br>  \r\nTsy misy atahorana eo amin’ny molotrao ny fampiasana io lokomena io satria atokisana tsara ny fanamboarana azy, ary  tolotra anisan’ny ankasitrahan’ny ISO 9001, 9002 et GMP (Good Manufacturing Practice) de la FDA (Food and Drug Administration). Tsy misy hanenenao fa azo antoka 100% ny kalitao hananany.<br> \r\nMba hampandaitra azy tsara ary dia tsara indrindra raha ilay lafika manamandina ny molotrao aloha no ampiharinao voalohany izay vao ataonao manaraka azy ilay mamoaka ny  loko tsara eo amin’ny molotrao.<br>\r\n..........Ar monja ny vidiny!! Azo lazaina fa lafo izany kanefa raha lokomena MISTINE PERFECT LIP COLORS manokana  dia mahazo matoky ianao fa tsy vetivety dia lany sady tsara kalitao. <br>\r\nKa manao ahoana ny fahitanao azy?<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                           ', '2.9 g', ' <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nMISTINE PERFECT LIP COLORS N°4  est un soin hydratant pour lèvres qui apparaît sous la forme de rouge à lèvres<br>\r\nCe rouge à lèvres à deux têtes perfectionne la tenue de vos lèvres:<br>\r\n- Le rouge à lèvres du haut sert de base, il hydrate la surface de vos lèvres pour les rendre bien pulpeuses<br>\r\n- Celui du bas apporte de la couleur<br>\r\nMISTINE PERFECT LIP COLORS N°04 est d’un rose profond (deep pink) éclatant, discret mais sexy<br>\r\nMISTINE PERFECT LIP COLORS sont conçus par des fabricants certifiés ISO 9001, 9002 et GMP (Good Manufacturing Practice) de la FDA (Food and Drug Administration)<br>\r\nCe produit est garanti à 100% en matière de qualité<br>                                                                                                                                                                                                                                                                                                                                      ', 1, 26, 'ROUGE A LEVRES', 'MISTINE', 'MISTINE', '', 'PERFECT LIP COLOR N°', '2013-01-01', '2021-12-31', ''),
('BTY010', ' MAQUILLAGE 24 COVER ALL FOUNDATION .', '', '', '', '', ' ', '', 1, 2, '', '', '', '', '24 COVER ALL FOUNDAT', '2020-07-30', '0000-00-00', ''),
('BTY011', 'MARKET BEAUTY DOOM DOOM ACTIVE ', '                                                                                                  <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Vitamine A , K , C , E:</b> nourrit la peau pour garder son élasticité, octroie l’hydratation dont la peau a besoin<br>                                                                                                                                                                                   ', '                                                                                                    <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Nettoyez la poitrine lors de la douche, puis essuyez<br>\r\n<b>Etape 2:</b> Appliquez DOOM DOOM de l\'aisselle à la poitrine<br> \r\n<b>Etape 3:</b> Massez la surface de la base de la poitrine à la poitrine pour faire pénétrer la crème dans les pores<br> \r\n<b>Etape 4:</b> Ne lavez pas, portez le toute la journée<br>\r\n<b>Etape 5:</b> Appliquez DOOM DOOM tous les matins et tous les soirs pendant 14 jours<br>\r\n<b>Etape 6:</b> Laissez reposer votre poitrine pendant 1 semaine et reprenez le traitement de 14 jours si vous voulez avoir plus de poitrine<br>                                                                                                                                                                                ', '', '                                                                                                    <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Ida commercial avy ao amin’ny One To One Marketing manolotra anao ny DOOM DOOM BREAST CREAM. <br>\r\nNy DOOM DOOM BREAST CREAM dia vokatra natokana ho an’ny vehivavy ary entina hampitombo sy hampiakatra ny tratra na ny nono. <br>\r\nNy fisian’ny Vitamine A, K, C sy E ary protéine ao amin’ny DOOM DOOM no hahafahany  hampitombon’ny tratra. tsy atahoranao hisy tsatsakoatra eo amin’ny faritra hampitomboana satria dia manatsara ny hoditra ihany koa ny DOOM DOOM. Vita avy amin’ny voam-boatavo ny DOOM DOOM BREAST CREAM ary azo lazaina fa mampitombo ny nono amin’ny fomba natoraly. Tsy ny chirurgie esthetique irery intsony no hahafahana mampitombo ny nono izay hiaraha-mahalala fa lafo tsy zakan’ny fahefa-midiny fa ny DOOM DOOM dia efa mahavita azy. Azonao jifaina amin’ny vidiny ……. AR monja.<br>                                                                                                                                                                                ', '49 ml', '     <b>CARACTERISTIQUE</b><br>\r\n<br>\r\nDOOM DOOM BREAST CREAM est une crème qui augmente le volume de la poitrine<br>\r\nSa formule naturelle aux graines de citrouilles de France lui permet de resserrer et de soulever la poitrine, de lui donner plus de volume et en même temps<br>\r\nGrâce à ses diverses variétés de nutriments telles que les vitamines A, K, C et E, les protéines, elle nourrit la peau et lui donne une texture douce et lisse tout en évitant l’apparition des vergetures lors de la prise de volume de la poitrine<br>                                                                                                                                                                                                                                                                  ', 1, 3, 'CREME POUR LA POITRINE', 'MISTINE', 'MISTINE', '', 'BEAUTY ACTIVE', '2013-01-01', '2021-12-31', ''),
('BTY012', ' LIPSTICK PERFECT LIP COLOR N°4 - ROSE .', '                                                            Non mentionné                                                                                                                            ', '                                                       <b>MODE D’UTILISATION</b><br>\r\n<br> \r\n<b>Etape 1:</b> Appliquer en premier lieu, la base pour bien hydrater les lèvres (la couleur claire)<br>\r\n<b>Etape 2:</b> Serrer les lèvres et les faire frotter délicatement<br>\r\n<b>Etape 3:</b> Appliquer en 2 ème couche le rouge à lèvres de couleur plus imposant<br>\r\n<b>Etape 4:</b> Resserrer les lèvres et les faire frotter délicatement<br>                                                                                                                                 ', '', '                                                <b>PRÉSENTATION</b><br>\r\n<br> \r\nSalama tompoko! Izahay avy ato amin’ny orinasa one to one dia faly mampandre fa manana tolotra vaovao mety aminao!<br> \r\nFantatrao ve ny MISTINE PERFECT LIP COLORS? Lokomena manana lafika roa! Ny lafika ambony manamandina sady manalefaka ny molotrao, ny ambany kosa natao mba haneho loko tsara sady mamiratra  eo amin’ny molotrao, marihina fa tsy hita be ilay izy kanefa mahita fiovana ianao eo amin’ny endrikao.<br>  \r\nTsy misy atahorana eo amin’ny molotrao ny fampiasana io lokomena io satria atokisana tsara ny fanamboarana azy, ary  tolotra anisan’ny ankasitrahan’ny ISO 9001, 9002 et GMP (Good Manufacturing Practice) de la FDA (Food and Drug Administration). Tsy misy hanenenao fa azo antoka 100% ny kalitao hananany.<br> \r\nMba hampandaitra azy tsara ary dia tsara indrindra raha ilay lafika manamandina ny molotrao aloha no ampiharinao voalohany izay vao ataonao manaraka azy ilay mamoaka ny  loko tsara eo amin’ny molotrao.<br>\r\n..........Ar monja ny vidiny!! Azo lazaina fa lafo izany kanefa raha lokomena MISTINE PERFECT LIP COLORS manokana  dia mahazo matoky ianao fa tsy vetivety dia lany sady tsara kalitao. <br>\r\nKa manao ahoana ny fahitanao azy?<br>                                                                                                                                        ', '2.9 g', '                                                              <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nMISTINE PERFECT LIP COLORS N°4  est un soin hydratant pour lèvres qui apparaît sous la forme de rouge à lèvres<br>\r\nCe rouge à lèvres à deux têtes perfectionne la tenue de vos lèvres:<br>\r\n- Le rouge à lèvres du haut sert de base, il hydrate la surface de vos lèvres pour les rendre bien pulpeuses<br>\r\n- Celui du bas apporte de la couleur<br>\r\nMISTINE PERFECT LIP COLORS N°04 est d’un rose profond (deep pink) éclatant, discret mais sexy<br>\r\nMISTINE PERFECT LIP COLORS sont conçus par des fabricants certifiés ISO 9001, 9002 et GMP (Good Manufacturing Practice) de la FDA (Food and Drug Administration)<br>\r\nCe produit est garanti à 100% en matière de qualité<br>                                                                                                                          ', 1, 26, 'ROUGE A LEVRES', 'MISTINE', 'MISTINE', '', 'PERFECT LIP COLOR N°', '2013-01-01', '2021-12-31', ''),
('BTY013', 'VEGETABLE BEAUTY CHARMER CREAM ', '', '', '', '', '5 ml', '', 1, 3, '', '', '', '', '', '0000-00-00', '0000-00-00', ''),
('BUC00', 'SYSTEMA MOUTHWASH BLUE CARIBBEAN ', '   <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extrait de Mansaku: feuille naturelle de Mansaku (vient du Japon):</b> aide à maintenir des gencives saines<br>\r\n<b>Xylitol:</b> octroie un goût légèrement sucré et freine la prolifération des bactéries responsable de la formation des caries<br>\r\n<b>Fluor:</b> aide à prévenir la carie dentaire<br>\r\n<b>Extraits exclusifs IPMP et GK2 de citron:</b> réduit l\'accumulation de bactéries, la principale cause de la mauvaise haleine<br>\r\n<b>Eau de mer:</b> calme l\'inflammation et les douleurs grâce à son pouvoir désinfectant et astringent<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nWater, Alcohol Denatured, Sorbitol, Xylitol, PEG-60 Hydrogenated Castor Oil, Sodium Benzoate, Sodium Lauryl Sulfate, Flavor, Sodium Citrate, Camelia Sinensis Leaf Extract, Methylparaben, Sodium Fluoride, Menthol, Citric Acid, O-Cymen-5-OI, Dipotassium Gycyrrhizate, Sodium Saccharin, Urajirogashi (Quercus Salicina) Extract, CI17200? CI19140<br>                                           \r\n                                                                     ', '  <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Versez un bouchon du bain de bouche dans un verre remplit d’eau au quart<br>\r\n<b>Etape 2:</b> Rincez-y la bouche pendant 15 secondes<br>\r\n<b>Etape 3:</b> Puis, crachez dans le lavabo<br>\r\nNB: Le bain de bouche peut aussi être utilisé sans être mélangé avec de l’eau<br>                                                                ', '0', '<b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Tahiana commercial avy ao amin’ny One to One marketing.<br>\r\nAmin’izao fotoana izao ny agence One to One dia mitondra ho anao ny BAIN DE BOUCHE SYSTEMA.<br>\r\nNy bain de bouche SYSTEMA dia vokatra iray mikolokolo ny aty vava amin’ny fanalana ny BACTERIE sy FANASITRANANA ny APHTE ary ny FANALANA ny FOFONA mety anelingelina ny olona mifanerasera aminao.<br>\r\nMisy karazany telo (3) ny bain de bouche SYSTEMA:<br>\r\n- Ny FRESH FOREST 0% d’alcool izay miavaka amin’ny maha ANTI-BACTERIEN ary mitondra hatsiatsiaka bebe kokoa noho ny hafa.<br>\r\n- Ny BLUE CARIBBEAN izay manadio hifotony ny ativava noho ankora alcooliques ao anatiny ary misoroka ny fofona izay mety hanelingelina anao. Idealy ho an’ny lehilahy.<br>\r\n- Ny CHERRY BLOSSOM izay mizara ny hanitry ny fleur de cerisier ka mitondra hatsiatsiaka malefaka sy mampiato ny fitombon’ny bakteria. Mety kokoa amin’ny vehivavy.<br>\r\n- Ny PLAQUE FIHGTER izay mizara ny tsiro sy parfum naturel de Thé du Japon ka mitondra hatsiatsiaka malefaka sy mampiato ny fitombon’ny bakteria ary miady amin’ny fiangonan’ny plaque eny amin’ny nify sy ny elakelany rehetra eny.<br>\r\nKa iza no mety mahaliana anao?<br>                                                                                                                                                                                       ', '80 ml', '         <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nSYSTEMA BLUE CARIBBEEN est un bain de bouche à la menthe fraîche des Caraïbes, un soin intensif bucco-dentaire qui: <br>\r\n- Assure la protection des dents contre les bactéries<br>\r\n- Maintien les gencives saines et en bonne santé<br>\r\n- Supprime la mauvaise haleine et la rafraîchit d’un doux parfum à la menthe<br>\r\n- Protège de l’apparition des aphtes<br>                                                                                                                                                           ', 1, 31, 'BAIN DE BOUCHE', 'SYSTEMA', 'LION', '', 'BLUE CARIBBEAN', '2013-01-01', '2021-12-31', ''),
('BUC001', ' WHITENING DENTAL CREAM WHITE TEETH .', '<b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Sorbitol:</b>  empêche la formation des bactéries qui forment la plaque dentaire<br>\r\n<b>Silice Hydratée:</b> apporte un confort buccal et tonus (tanjaka) des gencives, particulièrement recommandé dans les cas des problèmes de déchaussement dentaires (affinement de la gencive)<br>\r\n<b>Glycérine:</b> évite les tâches sur les dents<br>\r\n<b>Ascorbyl Phosphate De Sodium:</b> éclaircit et blanchit les dents<br> \r\n<b>Gomme De Cellulose:</b> empêche la formation des microcristaux de tartre en agissant comme des protecteurs<br> \r\n<b>Lactate De Calcium:</b> fortifie les os et les dents (agent fortifiant)<br> \r\n<b>Menthol:</b> anti-inflammatoires et antivirales (anti-virus) et procure de la fraîcheur<br>                                                                                 ', '    <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Brossez les dents avant d’utiliser MISTINE WHITE TEETH<br>\r\n<b>Etape 2:</b> Enlevez la capuche du stylo WHITE TEETH et tournez  légèrement le bout pour libérer le gel blanchissant<br>\r\n<b>Etape 3:</b> Appliquez doucement la pointe poilue du stylo MISTINE  WHITE TEETH sur toute la surface des dents et de la gencive<br>\r\n<b>Etape 4:</b> Laissez reposer 2 à 3 minutes<br>\r\n<b>Etape 5:</b> Puis rincez la bouche<br>                                                                                        ', '', '    <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao ny One To One Marketing. Ida no anarako, ary ny WHITE TEETH MISTINE indray no vokatra vaovao ho entiko eto aminao androany. Ny WHITE TEETH MISTINE dia vokatra iray natokana anafotsiana nify. <br>\r\nJereo anie ity fonosana ity e ! Ao anatin’ny herinandro monja dia efa misy vokatra ho itanao. Sady hafa kely ity vokatra ity satria miendrika stylo misy volony ilay vokatra ka izay no andokoana ny nify ho fotsifotsy. <br>    \r\nTsotra ny fomba fampiasana azy:<br>\r\nRehefa avy miborosy nify iny ianao na ny maraina avy misakafo na ny hariva alohan’ny hatory dia hosory WHITE TEETH MISTINE ny nify tianao ho fotsiana.<br> \r\nNy WHITE TEETH MISTINE dia miendrika stylo noho izany rehefa te hamoaka ny gel handokoana ilay nify ianao dia   ahodina ny saron’ilay stylo. Io gel  miloko fotsy io no manome loko ny nifintsika tahaka ireny manao vernis amin’ny tanana ireny.<br> \r\nVokatra mbola tsy fahita eto Madagasikara ny WHITE TEETH MISTINE ary atolotra ho anao amin’ny vidiny ………Ar monja. <br> \r\nKa anaovana firy madama ?<br>', '1', '    <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nMISTINE WHITE TEETH est un stylo innovant qui blanchit les dents<br>\r\nElle ne contient aucun agent de nettoyage donc elle doit être utilisée après le brossage des dents<br>\r\nLa brosse à dents MISTINE WHITE TEETH est composée sur sa pointe d’une perle blanchissante douce et riche en VITAMINE C, qui libère une substance<br>\r\nAssurant la décomposition des tâches sur les dents et l’élimination des bactéries déposées sur la gencive<br>\r\nSon utilisation ne nécessite pas une consultation médicale<br>\r\nVous constaterez la différence après seulement 6 jours d’utilisation successives<br>                                                                                        ', 1, 52, 'GEL DENTAIRE BLANCHISSANT ', 'MISTINE', 'MISTINE', '', 'WHITE TEETH', '2013-01-01', '2021-12-31', ''),
('BUC002', 'FRESH & WHITE TOOTHPASTE EXTRA COOL MINT ', '', '', '<p><em><strong>Somar', '<p>PRESENTATION Faly miarahaba anao ny dentifrice LION (Layonne).</p>\n\n<p>Caroline no anarako ary mpanentana ara-barotra avy ao amin&rsquo;ny One To One marketing aho. Jereo anie ity fonosana ity e, DENTIFRICE MOUSSE : LION FRESH AND WHITE 5 en 1. CALCIUM sy VITAMINE E &ndash; DOUBLE FLUORIDE &ndash; WHITEMAX &ndash; XYILITOL &ndash; MICRO FOAM. Ny CALCIUM sy VITAMINE E dia mampatanjaka sy mahasalama ny nify. Ny DOUBLE FLUORIDE dia miaro ny nifintsika amin&rsquo;ny Caries. Ny WHITEMAX kosa indray an dia manafotsy haingana dia haingana ny nifintsika. Ankohatra izay dia misy ihany koa XYILITOL sy ny SUPER COOL MINT : izay manome hanitra mangatsiaka sy maharitra ny ati-vava. Ny farany dia ny MICRO-FOAM izay miasa any anelakelaky ny nify ka manadio ifotony ny ati-vava.</p>\n', '75 g', '', 1, 53, ' DENTIFRICE', '', 'Non mentionné', '', '', '2013-01-01', '2021-12-31', ''),
('BUC003', 'FRESH & WHITE TOOTHPASTE FRESH COOL MINT ', '', '', '<p>Ny MISTINE WHITE ', '<p>Faly miarahaba anao ny One To One Marketing.</p>\n\n<p>Ida no anarako, ary ny WHITE TEETH MISTINE indray no vokatra vaovao hoentiko eto aminao androany. Ny WHITE TEETH MISTINE dia vokatra iray natokana anafotsiana nify.<br />\nJereo anie ity fonosana ity e !Aoanatin&rsquo;ny herinandro monja dia efa misy vokatra ho itanao. Sady hafakely ity vokatra ity satria miendrika stylo misy volony ilay vokatra ka izay no andokoana ny nify ho fotsifotsy.<br />\nTsotra ny fomba fampiasana azy:<br />\nRehefa avy miborosy nify iny ianao na ny maraina avy misakafo na ny hariva alohan&rsquo;ny hatory dia hosory WHITE TEETH MISTINE ny nify tianao ho fotsiana. Avela hilona 10 minitra eo ho eo ary avy eo ahontsana ny vava.</p>\n\n<p>Ny <strong>WHITE TEETH MISTINE</strong> dia miendrika stylo noho izany rehefa te hamoaka ny gel handokoana ilay nify ianao dia ahodina ny saron&rsquo;ilay stylo. Io gel miloko fotsy&nbsp;&nbsp; io no manome loko ny nifintsika tahaka ireny manao vernis amin&rsquo;ny Tanana ireny.<br />\nVokatra mbola tsy fahita eto Madagasikara ny WHITE TEETH MISTINE ary atolotra ho anao&nbsp; amin&rsquo;ny&nbsp; vidiny20.000 Armonja.<br />\nKa anaovana firy madama ?</p>\n\n<p>&nbsp;</p>\n', '75 g', '', 1, 53, 'DENTIFRICE', '', 'Non mentionné', '', '', '2013-01-01', '2021-12-31', ''),
('BUC004', 'SYSTEMA TOOTHPASTE CHARCOAL 90.G', '      <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br> \r\n<b>- Charbon actif:</b> élimine les bactéries, empêche la formation des caries, préviennent la gingivite et la parodontite (pyorrhée)<br>\r\n<b>- Extrait d’huile de feuille de Cannelle:</b> empêche la mauvaise haleine<br>\r\n<b>- Extrait de girofle et de réglisse:</b> aide à calmer et apaiser les douleurs dentaires, effet anti-inflammatoire<br>\r\n<b>- Cement Fluoride:</b> protège les dents et la gencive des agressions<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nWater, Sorbitol, Hydrated,Silica, PEG-400, Sodium lauryl sulfate, Cellulose gum, Flavor, Sodium silicate, CI 77891, Sodium fluoride, Zinc lactate, Sodium saccharin, Carbon, Methylparaben, Dipotassium glycyrrhizate, o-cymen-5-ol, Cinnamomum zeylanicum leaf oil, Engenia caryphyllus(clove)floweroil, Butylparaben<br>                                                                                                                                                      ', '     <b>MODE D’UTILISATION</b><br>\r\n<br> \r\n<b>Etape 1:</b> Appliquer une petite noisette du dentifrice SYSTEMA ADVANCED CHARCOAL sur la brosse à dents<br>\r\n<b>Etape 1:</b> Mouiller la brosse à dents à l’eau froide ou tiède<br>\r\n<b>Etape 1:</b> Brosser les dents pendant environ 3 minutes, déplacer votre brosse à dents de haut en bas en allant du rose des gencives vers le blanc des dents<br>\r\n<b>Etape 1:</b> Rincer abondamment<br>\r\n                                                                                                                                                           ', '<p><strong>Tena mand', '                                            <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao madama a, Caroline mpanentana ara-barotra avy ao amin’ny OnetoOne Marketing.<br>\r\nTonga eto Madagasikara ilay efa niandrasantsika hatry ny ela, ilay dentifrice vita amin’ny charbon, ilay dentifrice mamono ny bacterie rehetra ao amin’ny aty vava ary manala ihany koa ny fofona rehetra mety hanelingelina anao. Etsy anie jereo izatsy izy e !<br>\r\nDentifrice (Advaincd) ADVANCED (Tcharcolle) CHARCOAL no anarany, ny mampiavaka ny dentifrice CHARCOAL dia noho izy sady misy :<br>\r\n- Charbon Actif: izay mampihena ny plaques bactériennes na antsoina ihany koa hoe caries.<br>\r\n- Cement Fluoride: izay manamafy sy mampatanjaka ny nify ary manentsina ny lavaka madinika mety hankarary ny nifinao.<br>\r\n- Huille essentielle miaraka amin’ny Girofle sy Cannelle ka sady mampihena ny areti-nify no manome hanitra ny aty vava.<br>\r\nRaha toa ka mampiasa ity dentifrice ADVANCED CHARCOAL ity ianao dia tsy mila mandany vola manao detartrage intsony afaka 2 volana dia ho afaka avokoa ny bacteries rehetra ao amin’ny aty vavanao.<br>\r\n…….. Ariary monja ny vidiny amin’ny fatrany 90g ary …….. Ariary raha amin’ny ilay 160g  ka anaovana firy madama ?<br>\r\n \r\n                                         ', '90 g', '  <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nSYSTEMA ADVENCED CHARCOAL est une marque de dentifrice très réputée de Thaïlande. Sa formule à base de charbon lui permet de:<br>\r\n- Éliminer les mauvaises haleines<br>\r\n- Freiner la croissance des bactéries<br>\r\n- Réduire considérablement les plaques<br>\r\n- Prévenir les caries et protéger les dents saines<br>                                                                                                                                                                            ', 1, 53, 'BROSSE A DENTS', 'SYSTEMA', 'LION', '', 'ADVENCED CHARCOAL', '2013-01-01', '2021-12-31', ''),
('BUC005', 'HI-HERB TOOTHPASTE DAY & NIGHT CARE 90 .ML', '', '', '', '', '90  ML', '', 1, 2, '', 'HI-HERB', '', '', 'DAY & NIGHT CARE', '2020-07-30', '0000-00-00', ''),
('BUC006', 'SYSTEMA MOUTHWASH GREEN FOREST ', '                                                   <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extrait de Mansaku, feuille naturelle de Mansaku (vient du Japon):</b> aide à maintenir des gencives saines<br>\r\n\r\n<b>Xylitol:</b> octroie un goût légèrement sucré, freine la prolifération des bactéries responsable de la formation des caries<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nWater, Sorbitol, PEG-400, xylitol, PEG-60 Hydrogenated Castor Oil, Sodium benzoate, Sodium Lauryl Sulfate,Sodium Citrate, Flavor, Methylparaben, Sodium fluoride, Citric acid, O-Cymen-5-Ol, Dipotasium Glycyrrhizate, Sodium Saccharin, Hamamelis Viriniana (Witch Hazel) Extract, CI42009, CI19140<br>                                                                                                                                                                                                                                                                                                               ', '                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Verser un bouchon du bain de bouche dans un verre remplit  d’eau au quart<br>\r\n<b>Etape 2:</b> Rincez-y la bouche pendant 15 secondes<br>\r\n<b>Etape 3:</b> Puis, crachez dans le lavabo<br>\r\nNB: Le bain de bouche peut aussi être utilisé sans être mélangé avec de l’eau<br>\r\n\r\n                                                                                                                                                                                                                                                                                                                                                       ', '<p><strong>ARGUMENTA', '                                                      <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Tahiana commercial avy ao amin’ny One to One marketing,<br>\r\nAmin’izao fotoana izao ny agence One to One dia mitondra ho anao ny BAIN DE BOUCHE SYSTEMA.<br>\r\nNy bain de bouche SYSTEMA dia vokatra iray mikolokolo ny aty vava amin’ny fanalana ny BACTERIE sy FANASITRANANA ny APHTE ary ny FANALANA ny FOFONA mety anelingelina ny olona mifanerasera aminao.<br>\r\nMisy karazany telo (3) ny bain de bouche SYSTEMA:<br>\r\n- Ny FRESH FOREST 0% d’alcool izay miavaka amin’ny maha ANTI-BACTERIEN ary mitondra hatsiatsiaka bebe kokoa noho ny hafa.<br>\r\n- Ny BLUE CARIBBEAN izay manadio hifotony ny ativava noho ankora alcooliques ao anatiny ary misoroka ny fofona izay mety hanelingelina anao. Idealy ho an’ny lehilahy.<br>\r\n- Ny CHERRY BLOSSOM izay mizara ny hanitry ny fleur de cerisier ka mitondra hatsiatsiaka malefaka sy mampiato ny fitombon’ny bakteria. Mety kokoa amin’ny vehivavy.<br>\r\n- Ny PLAQUE FIHGTER izay mizara ny tsiro sy parfum naturel de Thé du Japon ka mitondra hatsiatsiaka malefaka sy mampiato ny fitombon’ny bakteria ary miady amin’ny fiangonan’ny plaque eny amin’ny nify sy ny elakelany rehetra eny.<br>\r\nKa iza no mety mahaliana anao?<br>\r\n \r\n                                                                                                                                                                                                                                                                                                                  ', '80 ml', '                                                     <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nSYSTEMA  GREEN FOREST est un bain de bouche à 0% d’alcool<br>\r\nLe bain de bouche GREEN FOREST 80 ml est le soin intensif 0% d’alcool qui: <br> \r\n- Assure la protection des dents contre les bactéries<br>\r\n- Maintien les gencives saines et en bonne santé<br>\r\n- Supprime la mauvaise haleine et la rafraîchit d’un doux parfum à la menthe<br>\r\n- Protège de l’apparition des aphtes<br>                                                                                                        