('BUC007', 'SYSTEMA MOUTHWASH BLUE CARIBBEAN ', '     <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extrait de Mansaku: feuille naturelle de Mansaku (vient du Japon):</b> aide à maintenir des gencives saines<br>\r\n<b>Xylitol:</b> octroie un goût légèrement sucré et freine la prolifération des bactéries responsable de la formation des caries<br>\r\n<b>Fluor:</b> aide à prévenir la carie dentaire<br>\r\n<b>Extraits exclusifs IPMP et GK2 de citron:</b> réduit l\'accumulation de bactéries, la principale cause de la mauvaise haleine<br>\r\n<b>Eau de mer:</b> calme l\'inflammation et les douleurs grâce à son pouvoir désinfectant et astringent<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nWater, Alcohol Denatured, Sorbitol, PEG-60, Hydrogenated Castor Oil, Xylitol, Sodium Luryl Sulfate, Sodium Citrate, Flavor, Methyparaben, Sodium Fluoride, Citric Acid, O-Cymen-5-OI, Dipotassium, Sodium Saccharin, Hammelis Virginiana (Witch Hazel) Extract, CI42090S<br>                                                                                                                                                                                                                                                                                                                                               ', '                                                                                                                                                                                                    <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Versez un bouchon du bain de bouche dans un verre remplit d’eau au quart<br>\r\n<b>Etape 2:</b> Rincez-y la bouche pendant 15 secondes<br>\r\n<b>Etape 3:</b> Puis, crachez dans le lavabo<br>\r\nNB: Le bain de bouche peut aussi être utilisé sans être mélangé avec de l’eau<br>\r\n\r\n                                                                                                                                                                                                                                                                                                                                                                         ', '<p><strong>ARGUMENTA', '                                                                                                                                                                                                   <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Tahiana commercial avy ao amin’ny One to One marketing.<br>\r\nAmin’izao fotoana izao ny agence One to One dia mitondra ho anao ny BAIN DE BOUCHE SYSTEMA.<br>\r\nNy bain de bouche SYSTEMA dia vokatra iray mikolokolo ny aty vava amin’ny fanalana ny BACTERIE sy FANASITRANANA ny APHTE ary ny FANALANA ny FOFONA mety anelingelina ny olona mifanerasera aminao.<br>\r\nMisy karazany telo (3) ny bain de bouche SYSTEMA:<br>\r\n- Ny FRESH FOREST 0% d’alcool izay miavaka amin’ny maha ANTI-BACTERIEN ary mitondra hatsiatsiaka bebe kokoa noho ny hafa.<br>\r\n- Ny BLUE CARIBBEAN izay manadio hifotony ny ativava noho ankora alcooliques ao anatiny ary misoroka ny fofona izay mety hanelingelina anao. Idealy ho an’ny lehilahy.<br>\r\n- Ny CHERRY BLOSSOM izay mizara ny hanitry ny fleur de cerisier ka mitondra hatsiatsiaka malefaka sy mampiato ny fitombon’ny bakteria. Mety kokoa amin’ny vehivavy.<br>\r\n- Ny PLAQUE FIHGTER izay mizara ny tsiro sy parfum naturel de Thé du Japon ka mitondra hatsiatsiaka malefaka sy mampiato ny fitombon’ny bakteria ary miady amin’ny fiangonan’ny plaque eny amin’ny nify sy ny elakelany rehetra eny.<br>\r\nKa iza no mety mahaliana anao?<br>                                                                                                                                                                                       \r\n                                                                                                                                                                                                                                                                                                                                  ', '80 ml', '                                                                                                                                                                                                    <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nSYSTEMA BLUE CARIBBEAN est un bain de bouche à la menthe fraîche des Caraïbes, un soin intensif bucco-dentaire qui: <br>\r\n- Assure la protection des dents contre les bactéries<br>\r\n- Maintien les gencives saines et en bonne santé<br>\r\n- Supprime la mauvaise haleine et la rafraîchit d’un doux parfum à la menthe<br>\r\n- Protège de l’apparition des aphtes<br>                                                                                                                                                                                                                                                                                                                                                                                                                         ', 1, 31, 'BAIN DE BOUCHE', 'SYSTEMA', 'LION', '', 'BLUE CARIBBEAN', '2013-01-01', '2021-12-31', ''),
('BUC008', 'SYSTEMA MOUTHWASH CHERRY BLOSSOM 80 .ML', 'Ã  completer', 'Ã  completer', 'Ã  completer', 'Ã  completer', '70 ml', 'Ã  completer', 1, 11, '', '', '', '', '', '0000-00-00', '0000-00-00', ''),
('BUC009', 'SYSTEMA TOOTHBRUSH SUPER SLIM .', '                                                                                                                                           \r\n      <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>PET Polybutylène téréphtalate:</b> assure un brossage efficace et un soin délicat des gencives, assure résistance et souplesse des poils<br> \r\n                                                                                                                                                                                                                                      ', '                                                                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Appliquer une petite noisette du dentifrice sur la brosse à dents SYSTEMA SUPER SLIM<br>\r\n<b>Etape 2:</b> Mouiller la brosse à dents SYSTEMA SUPER SLIM à l’eau froide ou tiède<br>\r\n<b>Etape 3:</b> Brosser les dents pendant environ 3mn, déplacer la brosse à dents de haut en bas en allant du rose des gencives vers le blanc des dents<br>\r\n<b>Etape 4:</b> Rincer abondamment<br>\r\n                                                                                                                                                                                                                                                                 ', '', '                 <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao. Toky no anarako ary borosy nify « SYSTEMA SUPER SLIM » no vokatra vaovao ho entiko eto aminao androany, ilay borosy nify vita avy amin’ny CHARBON.<br>\r\nJereo anie ity fonosana ity e, tsy mampino hoe borosy nify an. Ity ilay hika farany amin’ny borosy nify maneran-tany. Tahaka ity amin’ny sary ity izao ny fiasany: sady misitrika any anelakelaky ny nify izy no manala ny plaque bactérienne amin’ny maha spiral azy.<br>\r\nIty borosy nify SYSTEMA SUPER SLIM ity dia malefaka, ka toy ireny manao massage ireny ny sensation tsapanao  rehefa mampiasa azy ianao, andramo anie e, andramo dia ho hitanao fa ho fahafinaretana ho anao ny miborosy nify manomboka izao. <br>\r\n \r\n                                                                                                                                                                            ', '1', '           <b>CARACTERISTIQUES</b><br>\r\n<br>\r\nSYSTEMA SUPER SLIM est une marque de dentifrice très réputée de Thaïlande. Sa formule à base de charbon lui permet de:<br>\r\n- Dégraisser les dents<br>\r\n- Faciliter le nettoyage des dents dans les parties difficile à atteindre<br>\r\n- Empêcher l’accumulation des plaques dentaires<br>\r\n- Assurer un brossage doux, protégeant l’émail et la gencive<br>\r\n                                                                                                                                                                                                                                                                     ', 1, 55, 'BROSSE A DENTS', 'SYSTEMA', 'LION', '', 'SUPER SLIM', '2013-01-01', '2021-12-31', ''),
('BUC01', 'SYSTEMA TOOTHBRUSH SUPER SPIRALE .', '                                                                                                                                                                                               INGREDIENTS PRINCIPAUX:<br>\r\n- Charbon actif: élimine les bactéries, empêche la formation des plaques dentaires<br>\r\n\r\nAUTRES INGREDIENTS:<br>\r\nPolypropylene, Elastomer, Poybutylene, Terephthalate<br>\r\n                                                                                                                                                                                                                                                                                          ', '                                                                                                                                                                                                                                                                                                                                                                                                                                                                                         - Appliquer une petite noisette du dentifrice sur la brosse à dents SYSTEMA SPIRAL CHARCOAL<br>\r\n- Mouiller la brosse à dents SYSTEMA SPIRAL CHARCOAL à l’eau froide ou tiède<br>\r\n- Brosser les dents pendant environ 3 minutes : déplacer votre brosse à dents de haut en bas en allant du rose des gencives vers le blanc des dents<br>\r\n- Rincer abondamment<br>                                                                                                                                       ', '0', '                                                                                                                                                                                                                    Faly miarahaba anao. Toky no anarako ary borosy nify « SYSTEMA SPIRAL CHARCOAL» indray no vokatra vaovao ho entiko eto aminao androany. Miavaka tokoa ity brosse à dent « SYSTEMA SPIRAL CHARCOAL» ity.<br>\r\nSOUPLE sy MALEFAKA ery ny volony ka tsy hatahoranao hanindrona na handratra ny hihinifinao. MANIFY ka manamora ny fisitrihany any anelakelaky ny nify ary manamora ny fanalana ny caries. MATANJAKA sy MATEZA satria dia mitsangana eo amin’ny fototra matanjaka ny volony ka tsy mora miparitaka rehefa mampiasa azy ianao.<br>                                                                                                                                                            ', '160 g', '                                                                                                                                                                                                                         SYSTEMA SPIRAL CHARCOAL est une marque de dentifrice très réputée de Thaïlande. Sa formule à base de charbon lui permet de : <br>\r\n- Dégraisse les dents <br>\r\n- Facilite le nettoyage des dents dans les parties difficiles à atteindre<br>\r\n- Empêche l’accumulation des plaques dentaires<br>\r\n- Assure un brossage doux, protégeant l’émail et la gencive                                                                                                                                                       ', 1, 55, 'BROSSE A DENTS', 'SYSTEMA', 'LION', '', 'SPIRAL CHARCOAL', '2013-01-01', '2021-12-31', ''),
