('BUC022', 'FRESH & WHITE TOOTHPASTE EXTRA COOL MINT 160 g', '                                                                                                                                                       <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Calcium et Vitamine E:</b> renforcent les dents<br>\r\n<b>Fluor:</b> protège l’émail et les gencives<br>\r\n<b>Xylitol:</b> source de sucre naturel évitant l’accumulation des bactéries<br>\r\n<b>White max:</b> assure un nettoyage parfait à votre environnement buccal tout en blanchissant les dents<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nCalcium Carbonate, Water, Sorbitol, Hydrated Silica, Propylene Glycol, Sodium Lauryl Sulfate, Cellulose Gum, Flavor, Xylitol, Sodium Monofluorophosphate, Sodium Saccharin, Sodium Silicate, Tricaprylin, Methylparaben, Ethylparaben,Butylparaben, Sodium Fluoride, Tocopheryl Acetate<br>                                                                                                                                                                                                                                                          ', '                                                                                                                                                  <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Appliquez une petite noisette du dentifrice FRESH AND WHITE EXTRA COOL MINT sur la brosse à dents<br>\r\n<b>Etape 2:</b> Mouillez la brosse à dents à l’eau froide ou tiède<br>\r\n<b>Etape 3:</b> Brossez les dents pendant environ 3 minutes: déplacez votre brosse à dents de haut en bas en allant du rose des gencives vers le blanc des dents<br>\r\n<b>Etape 4:</b> Rincez abondamment<br>                                                                                                                                                                             ', '<p><strong>ARGUMENTA', '                                                                                                                                                   <b>PRÉSENTATION</b><br>\r\n<br>	\r\nFaly miarahaba anao ny dentifrice LION (Layonne) !!!!!!!\r\nToky no anarako ary ny dentifrisy « LION FRESH AND WHITE » no vokatra vaovao ho entiko ho anao androany, ilay dentifrisy 5 en 1. <br>\r\nEfa mba nampiasa ve madama? <br>\r\nJereo anie ity fonosana ity e, misy CALCIUM, VITAMINE E, DOUBLE FLUORIDE, WHITE MAX ary XYLITOL.\r\nRaha fehezina  izany  dia sady manafotsy sy mampatanjaka ny nify ny dentifrice LION FRESH AND WHITE, no miady amin’ny carie sy mitazona ny nifintsika ho salama hatrany noho ny double fluoride misy ao aminy.<br>\r\nTsy vitan’izany ihany fa misy Xylitol ny dentifice LION FRESH AND WHITE ka sady mamy no manome hanitra mangatsiaka sy malefaka ny aty vava. <br>\r\nFa ny tena mampiavaka ny dentifrisy LION FRESH and WHITE amin’ny dentifrisy tsotra dia noho izy misy MICRO FOAM izay afaka miasa hatrany amin’ny elakelaky ny nify ka manadio ifotony ny aty vava rehetra. <br>\r\nMisy karazany roa azo hisafidiananao tsara ny FRESH & WHITE:<br>\r\n- Ny iray Extra Cool Mint, izany hoe betsaka kokoa ny menthe ao aminy ka somary masitsiaka ka manome fraicheur kokoa. \r\n- Ary ny iray  FRESH COOL MINT izay somary malefadefaka ka tena tsara, indrindra raha misy ankizy kely ao an-trano. \r\nIza no atao ho an’I Madama / Ramose? Sa atao an’izy roa dia ilay Extra ho anareo mivady ary ny Fresh ho an’ny ankizy ? <br>\r\n........ Ar  ny vidiny ka anaovana firy madama? <br>                                                                           \r\n                                                                                                                                                                              ', '160 g', '                                                                                                                                                 <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nFRESH AND WHITE EXTRA COOL MINT est un dentifrice spécialement conçu pour une protection maximale des dents\r\nIl agit 5 fois mieux grâce à sa formule 5 en 1 octroyé par ses principaux agents<br>\r\nFRESH AND WHITE EXTRA COOL MINT donne une meilleure hygiène buccale en:<br>\r\n- Protège des dents des caries<br>\r\n- Renforce les dents et la gencive<br>\r\n- Protège l’émail<br>\r\n- Rafraîchit 2 fois plus l’haleine et lutte contre les mauvaises odeurs<br>\r\n- Blanchit les dents de manière naturelle par sa formule White Max<br>                                                                                                                                                                                                                                                                                                         ', 1, 53, ' DENTIFRICE', 'FRESH AND WHITE', 'LION', '', 'EXTRA COOL MINT', '2013-01-01', '2021-12-31', ''),
('BUC023', 'FRESH & WHITE TOOTHPASTE FRESH COOL MINT 160. G', '                                                <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Calcium et Vitamine E:</b> renforcent les dents<br>\r\n<b>Fluor:</b> protège l’émail et les gencives<br>\r\n<b>Xylitol:</b> source de sucre naturel évitant l’accumulation des bactéries<br>\r\n<b>White max:</b> assure un nettoyage parfait à votre environnement buccal tout en blanchissant les dents<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nCalcium Carbonate, Water, Sorbitol, Hydrated Silica, Propylene Glycol, Sodium Lauryl Sulfate, Cellulose Gum, Flavor, Xylitol, Sodium Monofluorophosphate, Sodium Saccharin, Sodium Silicate, Tricaprylin, Methylparaben, Ethylparaben,Butylparaben, Sodium Fluoride, Tocopheryl Acetate<br>                                                                                                                              ', '                                                 <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Appliquez une petite noisette du dentifrice FRESH AND WHITE EXTRA COOL MINT sur la brosse à dents<br>\r\n<b>Etape 2:</b> Mouillez la brosse à dents à l’eau froide ou tiède<br>\r\n<b>Etape 3:</b> Brossez les dents pendant environ 3 minutes, déplacez votre brosse à dents de haut en bas en allant du rose des gencives vers le blanc des dents<br>\r\n<b>Etape 4:</b> Rincez abondamment<br>                                                                                                                                       ', '<p><em><strong>Somar', '                                                <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao ny dentifrice LION (Layonne) !!!!!!!\r\nToky no anarako ary ny dentifrisy « LION FRESH AND WHITE » no vokatra vaovao ho entiko ho anao androany, ilay dentifrisy 5 en 1.<br>\r\nEfa mba nampiasa ve madama?<br>\r\nJereo anie ity fonosana ity e, misy CALCIUM, VITAMINE E, DOUBLE FLUORIDE, WHITE MAX ary XYLITOL.<br>\r\nRa