('CAP017', 'PANTENE MASK TOTAL DAMAGE CARE 10 INTENSIVE ', '', '				Tsotra dia tsotra ny fampiasana ireto shampooing sy apres-shampoing PANTENE ireto :\n1.Sasana aminâ€™ny rano matimaty ny loha ary osorana ny shampooing PANTENE ny volo, rehefa vita izay ny â€œmasse-naâ€ tsara ny hodi-doha mba hiasa tsara ny vokatra PANTENE ary kobanina tsara.\n2.Osorana aprÃ¨s-shampoing ny volo ary avela hilona eo 3 minitra rehefa avy eo dia kobanina tsara ary avela ho maina.\n            				        ', '<p><em><strong>Efa f', '<p>Faly miarahaba anao Caroline mpanentana ara-barotra ao amin&rsquo;ny One To One Marketing.</p>\n\n<p>Amin&rsquo;izao fotoana izao ny agence OnetoOne dia tonga mamangy antsika aty an-tokantrano, tonga mitondra ny Shampoing sy ny apr&egrave;s Shampoing PANTENE MIRACLE. Araka izany anarany izany dia vokatra manao MIRACLE amin&rsquo;ny volo, ity vokatra ho entiko manoloana anao ity. Maro ny mpanjifa efa nampiasa ny vokatra PANTENE MIRACLE ary afa-po amin&rsquo;ny fomba fiasany avokoa ny rehetra. Ny vokatra PANTENE 3 MINUTE MIRACLE mantsy dia sady mampalama sy manalefaka ny volo no mampangirana sy manamora ny fibangona azy. Izany hoe tahaka ireny avy natao lissage ireny izany ny volonao raha mampiasa ny PANTENE 3 MINUTE MIRACLE ianao.</p>\n\n<p>Misy karazany roa (2) ny PANTENE MIRACLE : PANTENE MIRACLE TOTAL DAMAGE CARE :</p>\n\n<p>Natokana ho an&rsquo;ny olona manana volo makina sy simba ary vakivaky</p>\n\n<p>. PANTENE MIRACLE HAIR FALL CONTROL : Natokana ho an&rsquo;ny olona manana volo tapatapaka. Iza no mahaliana anao, ilay TOTAL DAMAGE CARE sa ilay HAIR FALL CONTROL?</p>\n', '250 g', '', 1, 28, 'MASQUE CAPILLAIRE', '', 'PROCTER & GAMBLE', '', '', '2013-01-01', '2021-12-31', ''),
