('CAP026', 'REJOICE SHAMPOO ANTI-DANDRUFF 3-IN-1 140.ML', '<b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Zinc pyrithione:</b> aide à empêcher la multiplication des bactéries et microbe responsable de la formation des pellicules<br> \r\n<b>Menthe:</b> aide à  améliorer les conditions du cuir chevelu, octroie un lavage rajeunissant et donne une expérience parfumée à la menthe fraîche<br>\r\n<b>Citron:</b> retire les flocons des pellicules et redonne de l’éclat au cuir chevelu<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\n<b>Shampoing:</b> Water, Sodium Laureth Sulfate, Sodium Lauryl Sulfate, Sodium Chloride, Dimethicone, Glycol Distearate, Cocamidopropyl Betaine, Sodium Citrate, Cocamide MEA, Sodium Xylenesulfonate, Sodium Benzoate, Zinc Pyrithione, Fragrance, Menthol, Citric Acid, Benzyl Alcohol, Guar Hydroxypropyltrimonium Chloride, Methylchloroisothiazolinone, Methylisothiazolinone<br>\r\n<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                          ', '  <b>MODE D’UTILISATION</b><br> \r\n<br>\r\n<b>Etape 1:</b> Bien laver les cheveux avec le shampoing<br>\r\n<b>Etape 2:</b> Rincer abondamment le shampoing<br> \r\n<b>Etape 4:</b> Masser le cuir chevelu pendant 1 ou 2 minutes<br>\r\n<b>Etape 5:</b> Laisser reposer 5 à 10 minutes<br>\r\n<b>Etape 6:</b> Rincer abondamment<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 ', '', '      <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Caroline mpanentana ara-barotra avy ao amin’ny One To One Marketing.<br>\r\nAmin’izao fotoana izao ny agence One to One dia tonga mamangy antsika aty an-tokantrano, tonga mitondra ny Shampoing REJOICE.<br>\r\nNy Shampoing  REJOICE 3 EN 1 dia sady mampitsotra sy manalefaka ny volo no manala ihany koa ny anga-drano ary mitondra fraicheur ho an’ny volo sy ny loha ka ho maivamaivana ery ny tontolo andronao rehefa avy mampiasa azy ianao.<br> \r\nMisy abeny azo nao hisafidianana an !!!!  Ireto avy ny fatran’ny vokatra misy:<br>\r\n- Pack REJOICE 01 shampoing 70 ml amin’ny vidiny ……. Ar<br>\r\n- Pack REJOICE 01 shampoing 120 ml  amin’ny vidiny ……. Ar<br>\r\n- Pack REJOICE 01 shampoing 140 ml amin’ny vidiny ……. Ar<br>\r\nIza no anao ho anao ? <br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                          ', '140 ml', '<b>CARACTÉRISTIQUES</b><br>\r\n<br> \r\nLe pack REJOICE 3 IN 1 FRESH SMOOTH ANTI-DANDRUFF est composé d’un shampoing et d’un après shampoing  conçu pour nourrir et protéger les cheveux afin de les rendre plus frais, plus lisses et les protéger des pellicules<br> \r\nIl contient des ingrédients naturels qui aident à nourrir et à restaurer la kératine des cheveux abîmés, à protéger et à rendre les cheveux plus beaux et hydratés<br> \r\nLe pack REJOICE 3 IN 1 FRESH SMOOTH ANTI-DANDRUFF est adapté à tout type de cheveux<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    ', 1, 2, 'SHAMPOING', 'REJOICE', 'PROCTER & GAMBLE', '', 'ANTI-DANDRUFF 3-IN-1', '2013-01-01', '2021-12-31', ''),
('CAP027', 'REJOICE CONDITIONER ANTI-DANDRUFF 3-IN-1 AB SW TG 60.ML', '  <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Zinc pyrithione:</b> aide à empêcher la multiplication des bactéries et microbe responsable de la formation des pellicules<br> \r\n<b>Menthe:</b> aide à  améliorer les conditions du cuir chevelu, octroie un lavage rajeunissant et donne une expérience parfumée à la menthe fraîche<br>\r\n<b>Citron:</b> retire les flocons des pellicules et redonne de l’éclat au cuir chevelu<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\n<b>Après shampoing:</b> Water, Stearyl Alcohol, Cetyl Alcohol, Stearamidopropyl Dimethylamine, Glutamic Acid, Dimethicone, Zinc Pyrithione, Benzyl Alcohol, Fragance, Menthol, Phenoxyethanol, Citric Acid, Sodium Chloride, Methylchloroisothiazolinone, Methylisothiazolinone<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                   ', ' <b>MODE D’UTILISATION</b><br> \r\n<br>\r\n<b>Etape 1:</b> Bien laver les cheveux avec le shampoing<br>\r\n<b>Etape 2:</b> Rincer abondamment le shampoing<br> \r\n<b>Etape 3:</b> Puis, appliquer l’après shampoing après le lavage au shampoing<br>\r\n<b>Etape 4:</b> Masser le cuir chevelu pendant 1 ou 2 minutes<br>\r\n<b>Etape 5:</b> Laisser reposer 5 à 10 minutes<br>\r\n<b>Etape 6:</b> Rincer abondamment<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     ', '', '  <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Caroline mpanentana ara-barotra avy ao amin’ny One To One Marketing.<br>\r\nAmin’izao fotoana izao ny agence One to One dia tonga mamangy antsika aty an-tokantrano, tonga mitondra ny après Shampoing REJOICE.<br>\r\nNy Shampoing sy après-shampoing REJOICE 3 EN 1 dia sady mampitsotra sy manalefaka ny volo no manala ihany koa ny anga-drano ary mitondra fraicheur ho an’ny volo sy ny loha ka ho maivamaivana ery ny tontolo andronao rehefa avy mampiasa azy ianao.<br> \r\nMisy abeny azo nao hisafidianana an !!!!  Ireto avy ny fatran’ny vokatra misy:<br>\r\n- Pack REJOICE  Après shampoing 60 ml amin’ny vidiny ……. Ar<br>\r\nIza no anao ho anao ? <br>\r\nEn PROMOTION izy amin’izao fotoana izao satria ………Ar monja ny shampoing 70 ml sy après shampoing 60 ml ka mahaiza manararaotra.<br>                                                                                                                                                                                                                                                                                                                                                                                                                                      ', '60 ml', ' <b>CARACTÉRISTIQUES</b><br>\r\n<br> \r\nLe pack REJOICE 3 IN 1 FRESH SMOOTH ANTI-DANDRUFF est composé d’un shampoing et d’un après shampoing  conçu pour nourrir et protéger les cheveux afin de les rendre plus frais, plus lisses et les protéger des pellicules<br> \r\nIl contient des ingrédients naturels qui aident à nourrir et à restaurer la kératine des cheveux abîmés, à protéger et à rendre les cheveux plus beaux et hydratés<br> \r\nLe pack REJOICE 3 IN 1 FRESH SMOOTH ANTI-DANDRUFF est adapté à tout type de cheveux<br>                                                                                                                                                                                                                                                                                                                                                                                                                                 ', 1, 2, 'APRES SHAMPOING ', 'REJOICE', 'PROCTER & GAMBLE', '', 'ANTI-DANDRUFF 3-IN-1', '2013-01-01', '2021-12-31', ''),
('CAP028', 'PANTENE CONDITIONER HAIR FALL CONTROL 70 ML', '  <b>GRADIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Mélange de nutriments Pro-V:</b> renforce l\'intérieur des cheveux au niveau structurel et octroie une force durable pour réduire la chute des cheveux due à la casse<br> \r\n<b>Panthenol (dérivé de la Vitamine B5):</b> réduit les chutes de cheveux dues à la casse, favorise le démêlage des cheveux, donne un aspect épais aux cheveux fins, absorbe l’humidité détenue dans\r\nl’air afin de les protéger de la sécheresse<br>\r\n<b>Extrait de protéine de soie:</b> améliore et maintient l\'hydratation des cheveux et les rend doux, soyeux et brillants<br>  \r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\n<b>Après shampoing 3 mn miracle:</b> Water, Bis-Aminopropyl Dimethicone, Stearyl Alcohol, Fragrance, Isopropyl, Alcohol,Benzyl Alcohol, Disodium EDTA, Butylene Glycol,Histidine, Ciltric Acid, Panthenol, Panthenyl Ethyl Ether, Silik Extract, Methylchloroisothiazolinone, Methylisothiazolinone, CI 19140,CI 17200, CI42090<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               ', '<b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mouiller les cheveux à l’eau chaude<br>\r\n<b>Etape 2:</b> Appliquer et frotter le shampoing sur toute la surface des cheveux<br>\r\n<b>Etape 3:</b> Rincer et remettre du shampoing jusqu’à ce que les cheveux soient propres<br>\r\n<b>Etape 4:</b> Appliquer l’après shampoing après le lavage au shampoing<br>\r\n<b>Etape 5:</b> Masser le cuir chevelu  pendant 1 ou 2 minutes<br>\r\n<b>Etape 6:</b> Laisser reposer  pendant 3 minutes<br>\r\n<b>Etape 7:</b> Rincer abondamment à l’eau froide<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                  ', '', '  <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Toky avy ao amin’ny One To One Marketing .<br>\r\nAmin’izao fotoana izao ny agence One To One Marketing dia manolotra anao ny après-shampoing «Pantene pro-V 3minutes Miracle». Ao anatin’ny 3 minitra monja dia ho hitanao ny fiasany. Sady mampangirana ny volo izy no mampalama sy manalefaka azy noho izy «pro-vitaminé». Karazany 3 no atolotray ho anao:<br>\r\nNy TOTAL DAMAGE CARE (violet) dia miaro sy mitsabo ny volo vakivaky sy tapatapaka, <br>\r\nNy HAIR FALL CONTROL (rose) indray dia miaro ny volo amin’ny fihintsanana <br>\r\nAry ny COLOR & PERM dia natokana mba hiaro ny volo miloko sy natao Permanente. <br>\r\n........Ar monja ny vidiny après shampoing 70 ml.<br> Anaovana madama? Tsy mifidy karazam-bolo ny PANTENE fa na gras na sec, na tsotra na oliholy dia afaka ampiasàna azy avokoa.<br>\r\nKoa iza no atao anao? Andramo anie dia ho hitanao ny hatsarany ee! <br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               ', '70 ml', '      <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nPANTENE est une marque de cosmétiques de soin capillaire conçu pour adoucir et embellir tous types de cheveux. La gamme PANTENE HAIR FALL CONTROL :<br>\r\n- Fortifie la racine des cheveux  pour les protéger des chutes<br>\r\n- Lisse et adoucit les cheveux<br>\r\n- Protège de cuir chevelu contre les agressions extérieures<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              ', 1, 2, 'APRES SHAMPOING ', 'PANTENE', 'PROCTER & GAMBLE', '', 'HAIR FALL CONTROL', '2013-01-01', '2021-12-31', ''),
