('CAP034', ' SERUM LONG HAIR INTENSIVE ', '                                                                                                                                                 <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br> \r\n<b>Cerisier d’Olive:</b> qui protège vos cheveux contre la pollution, la surexposition au soleil et les produits coiffants<br>\r\n<b>Huile de Jojoba:</b> octroie une hydratation équilibrée, apaise et fortifie vos cheveux plus longtemps<br>\r\n<b>Huile carthame:</b> nourrit les cheveux à la racine et favorise leur pousse<br>\r\n\r\n                                                                                                                                                                                                                                                                                                                                                                                           ', '                                                                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br> \r\n<b>Etape 1:</b> Laver les cheveux au shampoing/après shampoing, dernier rinçage à l’eau froide pour refermer les ports<br>\r\n<b>Etape 2:</b> Puis appliquer 1 ou 2 pompes du sérum sur la paume<br>\r\n<b>Etape 3:</b> Frotter vos deux mains puis appliquer sur les cheveux mouillés ou secs<br>\r\n<b>Etape 4:</b> Insister sur les pointes des cheveux<br>\r\n<b>Etape 5:</b> Ne pas rincer, MISTINE SERUM n’est pas collante et ne contient pas de produits chimiques nocifs<br>\r\n                                                                                                                                        \r\n                                                                                                                                                                                                                                                                        ', '<p><em><strong>Tena ', '                                                                                                                                                <b>PRÉSENTATION</b><br>\r\n<br> \r\nFaly miarahaba anao ny One To One Marketing, Ida no anarako ary ny SERUM MISTINE indray ny vokatra  vaovao ho entiko aminao  androany, ny sérum dia vokatra iray entina manalefaka sy mampangirana  ary miaro ny volo amin’ny fivadibadihan’ny toetr’andro izay mahatonga ny loham-bolonao ho vakivaky.<br>\r\nAnkora natoraly no nanamboarana ny SERUM MISTINE LONG HAIR:<br> \r\nNy Olive Cerester izay miaro ny volonao amin’ny loto izay mitarika ny fahasimban’ny volo<br> \r\nNy Huile de Jojoba izay manamandimandina sy mampalefaka  ary manatanjaka ny loham-bolo mba tsy hitresaka<br> \r\nAry farany ny Huile de Carthame izay  miaro ny fotom-bolo ary mampaniry aingana ny volo. \r\nRaha te-hanana volo lava sy malefaka ary mangirana tsara izany ianao an! dia ny SERUM MISTINE LONG HAIR no mety aminao<br> \r\nTsotra dia tsotra ny fampiasana SERUM MISTINE LONG HAIR: <br> \r\nrehefa avy manasa loha ianao ka  maina tsara ny volo dia koseho eo amin’ny felan-tananao aloha ny SERUM (in-1 na in-2 manapotsitra) <br> \r\nAvy eo dia hosory amin’ny volo rehetra. Tsy kobanina fa avela hiasa tsara ary hoento mandritra ny tontolo andro<br>  \r\n……… Ariary ny vidiny ka anaovana ve ianao ?<br>                                                                                                                                                                                                                                                                                ', '20 ml', '                                                                                                                                                           <b>CARACTÉRISTIQUES</b><br>\r\n<br> \r\nMISTINE SERUM LONG HAIR 20ML est un sérum intensif qui revitalise les cheveux et leur permet  une repousse plus rapide. Il:<br> \r\n- Nourrit les cheveux sur toute la surface du cuir chevelu<br> \r\n- Protège les cheveux des bactéries, du changement brusque du climat, des UV du soleil<br> \r\n- Garde les cheveux en bonne santé et leur donne un effet radieux et une finition éclatante<br> \r\n- Aide à favoriser la pousse des cheveux<br> \r\n                                                                                                                                                                                                                                                                                                              ', 1, 41, 'SERUM CAPILLAIRE', 'MISTINE', 'MISTINE', '', 'LONG HAIR', '2013-01-01', '2021-12-31', ''),
