('CAP04', 'PANTENE MASK PROFESSIONNALLY HAIR FALL CONTROL ', '       <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>- Extrait de protéine de soie :</b> améliore et maintient l\'hydratation des cheveux et les rend doux, soyeux et brillants<br>\r\n<b>- Mélange de nutriments Pro-V :</b> renforce l\'intérieur des cheveux au niveau structurel et octroie une force durable pour réduire la chute des cheveux<br>\r\n<b>- Panthenol (dérivé de la Vitamine B5) : </b> réduit les chutes de cheveux dues à la casse, favorise le démêlage des cheveux, donne un aspect épais aux cheveux fins, absorbe l’humidité détenue dans l’air afin de les protéger de la sècheresse<br>\r\n<b>- Tocophéryle (Vitamine E):</b> répare, revitalise et hydrate les cheveux abîmés pour stimuler leur croissance<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nWater, Stearyl Alcohol, Bis-Aminopropyl Dimethicone, Fragrance, Behentrimonium Chloride, Cetyl Alcohol, Dimeticone, Fragrance, Benzyl Alcohol, Disodium EDTA, Divinyldimethicone/ DimethiconCopolymer, Panthenol, Panthenyl Ethyl Ether, Silk Extract, Sodium Hydroxide, Tocopreryl, Acetate,  C12-13 Pareth-23, C12-13 Pareth-3, Methylchloroisothiazolinone,Methylisothiazolinone, CI19140, CI17200,CI42090<br>                                                                                                                                                                                                           ', '        <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mouiller les cheveux à l’eau chaude<br>\r\n<b>Etape 2:</b> Appliquer et frotter le shampoing sur toute la surface des cheveux<br>\r\n<b>Etape 3:</b> Rincer et remettre du shampoing jusqu’à ce que les cheveux soient propre<br>\r\n<b>Etape 4:</b> Après application de l’après shampoing après le lavage au shampoing<br>\r\n<b>Etape 5:</b> Appliquer le masque sur la pomme de la main puis répartir sur toute la surface des cheveux en commençant par les pointes<br>\r\n<b>Etape 6:</b> Laisser reposer 5 à 10 mn puis rincer abondamment avec de l’eau mi-froide<br>                                                                                                                                                                                             \r\n                                                                                                                                                                                                                                                                                                                                ', '0', '            <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao Caroline mpanentana ara-barotra ao amin’ny One To One Marketing.<br>\r\nAmin’izao fotoana izao ny agence OnetoOne dia mitondra ny mask PANTENE HAIR FALL CONTROL. Manena ny fihintsanan’ny volo hatramin’ny 97 % ny produit PANTENE HAIR FALL CONTROL. Maro ny mpanjifa efa nampiasa ny vokatra PANTENE MIRACLE ary afa-po amin’ny fomba fiasany avokoa ny rehetra.<br>\r\nNy vokatra PANTENE  mantsy  dia sady mampalama sy manalefaka ny volo no mampangirana sy manamora ny fibangona azy. Izany hoe tahaka ireny avy natao lissage ireny izany ny volonao raha mampiasa ny PANTENE ianao.<br>                                                                                                                                                                                            ', '250 g', '  <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nPANTENE est une marque de cosmétique de soin capillaire conçu pour adoucir et embellir tous types de cheveux. Le masque professionnel HAIR FALL CONTROL :<br>\r\n- Fortifie la racine des cheveux  pour les protéger des chutes<br>\r\n- Lisse et adoucit les cheveux<br>\r\n- Protège de cuir chevelu contre les agressions extérieures<br>                                                                                                                                                                                                     