('CAP046', 'D-CASH COLORING 101 - BLACK .', '                                                    <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extraits naturels de Multi-Fruit Essence AHA:</b> nourrit et hydrate les cheveux qui permettent de former une barrière protectrice contre les agressions extérieures (produits chimiques, utilisation de fer ou brushing, ….)<br>                                                                                                                                                                                   ', '                                                        <b>MODE D’UTILISATION</b><br>\r\n<br>\r\nLa boîte DCASH est composée de 2 produits:<br> \r\n- Une hyper-cream<br>\r\n- Et la couleur MB 201<br>\r\n<b>Etape 1:</b> Mélangez l\'hypercream avec la coloration MB 101 dans un récipient non métallique<br>\r\n<b>Etape 2:</b> Appliquez la crème sur les cheveux et étalez uniformément le mélange de couleurs sur les cheveux<br>\r\n<b>Etape 3:</b> Laissez reposer 20-25 minutes (pour les tons de couleurs claires, le temps devrait être d\'environ 8 à 10 minutes) <br>\r\n<b>Etape 4:</b> Rincez à l\'eau et masser le cuir chevelu pendant le rinçage<br>\r\n<b>Etape 5:</b> Puis passer au lavage habituel Shampoing et Après shampoing spécial cheveux colorés<br>\r\n                                                                                  ', '', '                                                <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Malala commerciale avy ao amin’ny One To One Marketing. Ny crème colorante D-CASH indray no vokatra vaovao hoentiko ho anao androany. Araka izany voalazako izany dia sady fandokoam-bolo izy ity no Crème ihany koa.<br>\r\nRehefa mandoko volo aminy ianao  dia ho hitanao fa sady ho rakotra 100% ny volofotsinao no halefaka sy halama ary hangirana aoka izany ny volonao.\r\nAnkoatra izay dia manome endrika natoraly ho an’ny volonao ny CRÈME COLORANT D-CASH noho ireo hotrik’aina, azo avy amin’ny voankazo toa an’ny paoma sy poara sy voasary makirana ary voaloboka misy ao aminy, noho izany dia ho lavitra anao ny volo maina sy makina ka ho salama lalandava ny volonao. <br>\r\nMisy karazany roa ny CRÈME COLORANT D-CASH natokako ho anao :\r\nCas 1 :Ny DCASH MASTER MB 201 izany. <br> \r\nLokom-bolo «Dark Brown» na « marron foncé».<br> \r\nCas2 : Ny DCASH MASTER MB 101 izany.<br> \r\nLokom-bolo « Black » na amin’ny « loko mainty».<br> \r\n…… Ar monja ny vidny ka iza no metimety aminao ? <br>\r\n                                            ', '50 ml', '                                                      <b>CARACTÉRISTIQUE</b><br>\r\n<br>\r\nDcash Master Mass Color Cream est une crème colorante qui octroie une belle couleur noir café à vos cheveux pour une durée permanente<br>\r\nElle masque parfaitement les cheveux blancs<br>\r\nSa formule à base d’extraits naturels de Multi-Fruit Essence AHA permet aux cheveux d’adhérer plus facilement à la crème colorante sans les déshydrater<br>\r\nElle garde vos cheveux doux, lisses et brillants<br>                                                                                                         ', 1, 8, 'CREME COLORANTE CAPILLAIRE', 'DCASH', 'MASTER MASS', '', 'MB 101  BLACK', '2013-01-01', '2021-12-31', ''),
('CAP047', 'D-CASH COLORING 201 - DARK BROWN .', '                                                                                                <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extraits naturels de Multi-Fruit Essence AHA:</b> nourrit et hydrate les cheveux qui permettent de former une barrière protectrice contre les agressions extérieures(produits chimiques, utilisation de fer ou brushing, ….)<br>                                                                                                                                                                          ', '                                                                                                    <b>MODE D’UTILISATION</b><br>\r\n<br>\r\nLa boîte DCASH est composée de 2 produits:<br> \r\n- Une hyper-cream<br>\r\n- Et la couleur MB 201<br>\r\n<b>Etape 1:</b> Mélangez l\'hypercream avec la coloration MB 101 dans un récipient non métallique<br>\r\n<b>Etape 2:</b> Appliquez la crème sur les cheveux et étalez uniformément le mélange de couleurs sur les cheveux<br>\r\n<b>Etape 3:</b> Laissez reposer 20-25 minutes (pour les tons de couleurs claires, le temps devrait être d\'environ 8 à 10 minutes) <br>\r\n<b>Etape 4:</b> Rincez à l\'eau et masser le cuir chevelu pendant le rinçage<br> \r\n<b>Etape 5:</b> Puis passer au lavage habituel Shampoing et Après shampoing spécial cheveux colorés<br>                                                                                                                             ', '', '                                                                                                              <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Malala commerciale avy ao amin’ny One To One Marketing. Ny crème colorante D-CASH indray no vokatra vaovao hoentiko ho anao androany. Araka izany voalazako izany dia sady fandokoam-bolo izy ity no Crème ihany koa.<br>\r\nRehefa mandoko volo aminy ianao  dia ho hitanao fa sady ho rakotra 100% ny volofotsinao no halefaka sy halama ary hangirana aoka izany ny volonao.\r\nAnkoatra izay dia manome endrika natoraly ho an’ny volonao ny CRÈME COLORANT D-CASH noho ireo hotrik’aina, azo avy amin’ny voankazo toa an’ny paoma sy poara sy voasary makirana ary voaloboka misy ao aminy, noho izany dia ho lavitra anao ny volo maina sy makina ka ho salama lalandava ny volonao. <br>\r\nMisy karazany roa ny CRÈME COLORANT D-CASH natokako ho anao :\r\nCas 1 :Ny DCASH MASTER MB 201 izany. <br> \r\nLokom-bolo «Dark Brown» na « marron foncé».<br> \r\nCas2 : Ny DCASH MASTER MB 101 izany.<br> \r\nLokom-bolo « Black » na amin’ny « loko mainty».<br> \r\n…… Ar monja ny vidny ka iza no metimety aminao ? <br>\r\n                              \r\n                                                                                                                                                                                                          ', '50 ML', '                                                                                                  <b>CARACTÉRISTIQUE</b><br>\r\n<br>\r\nDcash Master Mass Color Cream MB 201 BROWN  est une crème colorante qui octroie une belle couleur brune très foncée à vos cheveux pour une durée permanente<br>\r\nElle masque parfaitement les cheveux blancs<br>\r\nSa formule à base d’extraits naturels de Multi-Fruit Essence AHA permet aux cheveux d’adhérer plus facilement à la crème colorante sans les déshydrater<br>\r\nElle garde vos cheveux doux, lisses et brillants<br>                                                                                                                                                                                                                     ', 1, 8, 'CREME COLORANTE CAPILLAIRE', 'DCASH', 'MASTER MASS', '', 'MB 201 BROWN', '2013-01-01', '2021-12-31', ''),
('CAP048', 'HEAD AND SHOULDERS SHAMPOO ANTI-HAIR FALL AND ANTI-DANDRUFF 135.ML', '', '', '', '', '135 ML', '', 1, 2, '', 'HEAD AND SHOULDERS', '', '', 'ANTI-HAIR FALL AND A', '2020-07-30', '0000-00-00', ''),
('CAP049', 'PANTENE MASK PROFESSIONNALLY HAIR FALL CONTROL ', '<b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>- Extrait de protéine de soie :</b> améliore et maintient l\'hydratation des cheveux et les rend doux, soyeux et brillants<br>\r\n<b>- Mélange de nutriments Pro-V :</b> renforce l\'intérieur des cheveux au niveau structurel et octroie une force durable pour réduire la chute des cheveux<br>\r\n<b>- Panthenol (dérivé de la Vitamine B5) : </b> réduit les chutes de cheveux dues à la casse, favorise le démêlage des cheveux, donne un aspect épais aux cheveux fins, absorbe l’humidité détenue dans l’air afin de les protéger de la sècheresse<br>\r\n<b>- Tocophéryle (Vitamine E):</b> répare, revitalise et hydrate les cheveux abîmés pour stimuler leur croissance<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS </b><br>\r\n<br>\r\nWater, Stearyl Alcohol, Bis-Aminopropyl Dimethicone, Fragrance,Behentrimonium Chloride, Cetyl Alcohol, Dimeticone, Fragrance, Benzyl Alcohol, Disodium EDTA, Divinyldimethicone/ DimethiconCopolymer, Panthenol, Panthenyl Ethyl Ether, Silk Extract, Sodium Hydroxide, Tocopreryl, Acetate,  C12-13 Pareth-23, C12-13 Pareth-3, Methylchloroisothiazolinone,Methylisothiazolinone, CI19140, CI17200,CI42090<br>                                  ', '<b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mouiller les cheveux à l’eau chaude<br>\r\n<b>Etape 2:</b> Appliquer et frotter le shampoing sur toute la surface des cheveux<br>\r\n<b>Etape 3:</b> Rincer et remettre du shampoing jusqu’à ce que les cheveux soient propre<br>\r\n<b>Etape 4:</b> Après application de l’après shampoing après le lavage au shampoing<br>\r\n<b>Etape 5:</b> Appliquer le masque sur la pomme de la main puis répartir sur toute la surface des cheveux en commençant par les pointes<br>\r\n<b>Etape 6:</b> Laisser reposer 5 à 10 mn puis rincer abondamment avec de l’eau mi-froide<br>                                                                                                                                                                              ', '<p><em><strong>Efa f', '<b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao Caroline mpanentana ara-barotra ao amin’ny One To One Marketing.<br>\r\nAmin’izao fotoana izao ny agence OnetoOne dia mitondra ny mask PANTENE HAIR FALL CONTROL. Manena ny fihintsanan’ny volo hatramin’ny 97 % ny produit PANTENE HAIR FALL CONTROL. Maro ny mpanjifa efa nampiasa ny vokatra PANTENE MIRACLE ary afa-po amin’ny fomba fiasany avokoa ny rehetra.<br>\r\nNy vokatra PANTENE  mantsy  dia sady mampalama sy manalefaka ny volo no mampangirana sy manamora ny fibangona azy. Izany hoe tahaka ireny avy natao lissage ireny izany ny volonao raha mampiasa ny PANTENE ianao.<br>                                                                                                                                                                      ', '250 g', '<b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nPANTENE est une marque de cosmétique de soin capillaire conçu pour adoucir et embellir tous types de cheveux. Le masque professionnel HAIR FALL CONTROL :<br>\r\n- Fortifie la racine des cheveux  pour les protéger des chutes<br>\r\n- Lisse et adoucit les cheveux<br>\r\n- Protège de cuir chevelu contre les agressions extérieures<br>                                             \r\n                                                                                                                                                           ', 1, 28, 'MASQUE CAPILLAIRE', 'PANTENE', 'PROCTER & GAMBLE', '', 'HAIR FALL CONTROL', '2013-01-01', '2021-12-31', ''),
('CAP05', 'PANTENE CONDITIONER HAIR FALL CONTROL 3MN MIRACLE ', '    <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Mélange de nutriments Pro-V:</b> renforce l\'intérieur des cheveux au niveau structurel et octroie une force durable pour réduire la chute des cheveux due à la casse<br> \r\n<b>Panthenol (dérivé de la Vitamine B5):</b> réduit les chutes de cheveux dues à la casse, favorise le démêlage des cheveux, donne un aspect épais aux cheveux fins, absorbe l’humidité détenue dans\r\nl’air afin de les protéger de la sécheresse<br>\r\n<b>Extrait de protéine de soie:</b> améliore et maintient l\'hydratation des cheveux et les rend doux, soyeux et brillants<br>  \r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\n<b>Shampoing:</b> Water,Sodium Lauryl Sulfate, Cimethcone, Cocamdopropyl betaine, Sodium citrate, Sodium xylenesulfonate, Glycol Distearate, Sodium Chloride, Fragrance, Strearyl Alcool, Cetyl alcohol,Guar Hydroxypropryltrimonium Chloride, Citric acid,  Sodium Benzoate,Tetrasodium EDTA, Polyquaternium-6, Panthenol, Panthenyl, Ethyl, Ether, Histidine, Methylchloroisothiazolinone, Methylisothiazolinone<br>\r\n                                                                                                                                                             ', '      <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mouiller les cheveux à l’eau chaude<br>\r\n<b>Etape 2:</b> Appliquer et frotter le shampoing sur toute la surface des cheveux<br>\r\n<b>Etape 3:</b> Rincer et remettre du shampoing jusqu’à ce que les cheveux soient propres<br>                                                                                                                                                                                               ', '0', ' <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Toky avy ao amin’ny One To One Marketing .<br>\r\nAmin’izao fotoana izao ny agence One To One Marketing dia manolotra anao ny «shampoing» PANTENE. Karazany 3 no atolotray ho anao:<br>\r\nNy TOTAL DAMAGE CARE (violet) dia miaro sy mitsabo ny volo vakivaky sy tapatapaka, <br>\r\nNy HAIR FALL CONTROL (rose) indray dia miaro ny volo amin’ny fihintsanana <br>\r\nAry ny COLOR & PERM dia natokana mba hiaro ny volo miloko sy natao Permanente. <br>\r\n...........Ar monja ny vidiny shampoing 120 ml.<br> Anaovana madama? Tsy mifidy karazam-bolo ny PANTENE fa na gras na sec, na tsotra na oliholy dia afaka ampiasàna azy avokoa.<br>\r\nKoa iza no atao anao? Andramo anie dia ho hitanao ny hatsarany ee! <br>                                                                                                                                                                                            ', '120 ml', '         <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nPANTENE est une marque de cosmétiques de soin capillaire conçu pour adoucir et embellir tous types de cheveux. La gamme PANTENE HAIR FALL CONTROL :<br>\r\n- Fortifie la racine des cheveux  pour les protéger des chutes<br>\r\n- Lisse et adoucit les cheveux<br>\r\n- Protège de cuir chevelu contre les agressions extérieures<br>                                                                                                                                                                                           ', 1, 28, 'SHAMPOING ', 'PANTENE', 'PROCTER & GAMBLE', '', 'HAIR FALL CONTROL', '2013-01-01', '2021-12-31', ''),
('CAP050', 'PANTENE MASK PROFESSIONNALLY TOTAL DAMAGE CARE ', '<b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>- Extrait de protéine de soie:</b> améliore et maintient l\'hydratation des cheveux et les rend doux, soyeux et brillants<br>\r\n<b>- Mélanges de nutriments Pro-V: </b> renforce l\'intérieur des cheveux au niveau structurel et octroie une force durable pour réduire la chute des cheveux <br>\r\n<b>- Panthenol (dérivé de la Vitamine B5):</b> réduit les chutes de cheveux dues à la casse ,favorise le démêlage des cheveux, donne un aspect épais aux cheveux fins, absorbe l’humidité détenue dans l’air afin de les protéger de la sècheresse<br>\r\n<b>- Tocophéryle (Vitamine E):</b> répare, revitalise et hydrate les cheveux abîmés pour stimuler leur croissance. <br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nWater, Stearyl Alcohol, Bis-Aminopropyl Dimethicone, Fragrance, Behentrimonium Chloride, Cetyl Alcohol, Dimeticone, Fragrance, Benzyl Alcohol, Disodium EDTA, Divinyldimethicone/ Dimethicone Copolymer, Panthenol, Panthenyl Ethyl Ether, Silk Extract, Sodium Hydroxide, Tocopreryl, Acetate,  C12-13 Pareth-23, C12-13 Pareth-3, Methylchloroisothiazolinone, Methylisothiazolinone, CI19140, CI17200, CI42090 <br>', '<b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mouiller les cheveux à l’eau chaude<br>\r\n<b>Etape 2:</b> Appliquer et frotter le shampoing sur toute la surface des cheveux<br>\r\n<b>Etape 3:</b> Rincer et remettre du shampoing jusqu’à ce que les cheveux soient propre<br>\r\n<b>Etape 4:</b> Après application de l’après shampoing après le lavage au shampoing<br>\r\n<b>Etape 5:</b> Appliquer le masque sur la pomme de la main puis répartir sur toute la surface des cheveux en commençant par les pointes<br>\r\n<b>Etape 6:</b> Laisser reposer 5 à 10 mn puis rincer abondamment avec de l’eau mi-froide<br>\r\n                                                                                                                                                                                                                        ', '<p><em><strong>Efa f', '    <b>PRESENTATION</b><br>\r\n<br>\r\n   Faly miarahaba anao Caroline mpanentana ara-barotra ao amin’ny One To One Marketing.<br>\r\nAmin’izao fotoana izao ny agence OnetoOne dia tonga mamangy antsika aty an-tokantrano, tonga mitondra ny mask PANTENE TOTAL DAMAGE CARE.<br>\r\nMaro ny mpanjifa efa nampiasa ny vokatra mask PANTENE TOTAL DAMAGE CARE ary afa-po amin’ny fomba fiasany avokoa ny rehetra. Ny vokatra PANTENE mantsy dia sady mampalama sy manalefaka ny volo no mampangirana sy manamora ny fibangona azy.<br>\r\nIzany hoe tahaka ireny avy natao lissage ireny izany ny volonao raha mampiasa ny PANTENE ianao.<br>\r\n                                                                                        ', '250 g', ' <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\n PANTENE est une marque de cosmétiques de soin capillaire conçu pour adoucir et embellir tous types de cheveux. Le masque professionnel TOTAL DAMAGE CARE:<br>\r\n- Améliore la rétention des liaisons protéinées naturelles des cheveux pour aider à réduire la progression des dommages<br>\r\n- Aide à prévenir les futures pointes fourchues même dans les 3 mois à venir<br>\r\n- Lisse et adoucit les cheveux<br>                                                                                                                                                                                                                                 ', 1, 28, 'MASQUE CAPILLAIRE', 'PANTENE', 'PROCTER & GAMBLE', '', 'TOTAL DAMAGE CARE', '2013-01-01', '2021-12-31', ''),
