('CAP056', 'PANTENE CONDITIONER HAIR FALL CONTROL 3MN MIRACLE ', '', '<p>Sasanao amin&rsquo;ny shampooing aloha ny volonao ( flacon fotsy 450 ml).</p>\n\n<p>Kobanina tsara ary hosorana ilay apr&egrave;s shampooing indray ny volo (flacon 300 ml mihoaka dor&eacute;), alona 3 ka hatramin&rsquo;ny 10 mn raha somary main any volonao. Ary kobanina avy eo.</p>\n\n<p>Farany, hosorana indray ny mask (bo&icirc;te 250g dor&eacute;) , alona 3 ka hatramin&rsquo;ny 10 minitra ihany koa ary kobanina amin&rsquo;ny rano matimaty manompy mangatsiaka.</p>\n', '<p><em><strong>ARGUM', '<p>Faly miarahaba anao Caroline mpanentana ara-barotra ao amin&rsquo;ny One To One Marketing.</p>\n\n<p>Amin&rsquo;izao fotoana izao ny agence OnetoOne dia tonga mamangy antsika aty an-tokantrano, tonga mitondra ny Shampoing sy ny apr&egrave;s Shampoing PANTENE MIRACLE. Araka izany anarany izany dia vokatra manao MIRACLE amin&rsquo;ny volo, ity vokatra ho entiko manoloana anao ity. Maro ny mpanjifa efa nampiasa ny vokatra PANTENE MIRACLE ary afa-po amin&rsquo;ny fomba fiasany avokoa ny rehetra.</p>\n\n<p>Ny vokatra <strong>PANTENE 3 MINUTE MIRACLE</strong> mantsy dia sady mampalama sy manalefaka ny volo no mampangirana sy manamora ny fibangona azy. Izany hoe tahaka ireny avy natao lissage ireny izany ny volonao raha mampiasa ny PANTENE 3 MINUTE MIRACLE ianao.</p>\n\n<p>Misy karazany roa (2) ny <strong>PANTENE MIRACLE : PANTENE MIRACLE TOTAL DAMAGE CARE</strong> : Natokana ho an&rsquo;ny olona manana volo makina sy simba ary vakivaky.</p>\n\n<p><strong>PANTENE MIRACLE HAIR FALL CONTROL</strong> : Natokana ho an&rsquo;ny olona manana volo tapatapaka.</p>\n\n<p>Iza no mahaliana anao, ilay <strong>TOTAL DAMAGE CARE </strong>sa ilay <strong>HAIR FALL CONTROL?</strong></p>\n', '300 ml', '', 1, 28, 'APRES SHAMPOING ', '', 'PROCTER & GAMBLE', '', '', '2013-01-01', '2021-12-31', ''),
('CAP057', 'PANTENE CONDITIONER HAIR FALL CONTROL 450.ML', 'A completer', 'A completer', '', '', '450 ML', 'A completer', 1, 2, 'APRES SHAMPOING ', '', 'PROCTER & GAMBLE', '', '', '2013-01-01', '2021-12-31', ''),
