INSERT INTO `produit` (`Code_produit`, `Designation`, `ingredient`, `modedutilisation`, `argumentaire`, `presentation`, `Quantites`, `Description`, `Detail_du_produit`, `Categorie`, `categorie_m`, `marque`, `fabricant`, `link`, `type`, `date_active`, `date_desactive`, `statut`) VALUES
('CAP06', 'MISTING LONG HAIR 400ML', '                                                  \r\n<b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Panthénol ou vitamine B5:</b> Adoucit et facilite le démêlage des cheveux<br> \r\n<b>Collagène hydrolysé:</b> Restructure les cheveux abîmes par des traitements chimiques ou ratage capillaire<br>\r\n<b>Kératine hydrolysée:</b> Renforce la racine pour lutter contre la perte des cheveux<br>\r\n<b>Extrait de ginseng:</b> Favorise la croissance des cheveux<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 ', '                                                 <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Laver les cheveux avec une bonne quantité de shampoing  à l’eau chaude<br> \r\n<b>Etape 2:</b> Rincer puis appliquer un 2 ème shampoing  et rincer abondamment<br>\r\n<b>Etape 3:</b> Appliquer le traitement MISTINE LONG HAIR  en insistant sur les pointes<br>\r\n<b>Etape 4:</b> Laisser reposer 5 à 10 minutes puis rincer à l’eau tiède<br>\r\n<b>Etape 5:</b> Laisser sécher les cheveux<br>\r\n<b>Etape 6:</b> Puis appliquer 1 ou 2 pompes du sérum sur la paume<br>\r\n<b>Etape 7:</b> Frotter vos deux mains puis appliquer sur les cheveux mouillés ou secs<br>\r\n<b>Etape 8:</b> Insister sur les pointes des cheveux<br>\r\n<b>Etape 9:</b> Ne pas rincer, MISTINE SERUM n’est pas collante et ne contient pas de produits chimiques nocifs<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        ', '0', '         <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao ny One To One Marketing, Ida no anarako ary ny gamme MISTINE LONG HAIR indray ny vokatra  vaovao hoentiko aminao  androany. Ahitanao: <br> \r\n- Shampoing 400 ml<br>\r\n- Treatment (na solon’ny masque) 100g<br>\r\n- Ary Sérum 20 ml<br>\r\nIo gamme io dia mahavita mitsabo ny volonao simban’ny produits chimiques nampiasaina teo aloha, manasitrana ny volo vakivaky sy tapatapaka ary ihany koa miaro amin’ny fihintsanan’ny volo.\r\nTsy manao magie akory ity gamme MISTINE LONG HAIR ity fa mitondra kosa ny akora rehetra izay ilain’ny volonao mba ho salama tsara sy manampy azy mba haniry tsara sy haingana kokoa. <br>  \r\nIreto avy no anjara asan’ny tsirairay avy eo amin’ny volonao.<br>\r\n- Ny shampoing no manadio ny volo sy manala ireny excés d’huille manentsina ny masokoditra. Efa mitsabo ny volo sahady izy noho ny vitamine hoentiny ho an’ny volo. <br>\r\n- Ny Treatment indray araka izany anarany izany dia mitsabo lalindalina kokoa ny volonao amin’ny sahasimbana izay mitranga eo aminy. Mamerina tsikelikely ny volonao amin’ny état d’origine izy.\r\n- Ary ny sérum kosa dia entina manalefaka sy mampangirana  ary miaro ny volo amin’ny fivadibadihan’ny toetr’andro sy miaro amin’ny loto izay mahatonga ny loham-bolonao ho vakivaky.<br>\r\nTsotra dia tsotra ny fampiasana io gamme MISTINE LONG HAIR io:<br>\r\n- Sasao madio tsara amin’ny shampooing aloha ny volo<br>\r\n- Kobano ary hosory amin’ny volo rehetra ny Treatment ny indrindra ny loham-bolo<br>\r\n- Aleo hilona 5 à 10 mn ary kobano avy eo<br>\r\nRehefa avy manasa loha ianao ka  maina tsara ny volo dia koseho eo amin’ny felan-tananao aloha ny SERUM (in-1 na in-2 manapotsitra).<br>\r\nAvy eo dia hosory amin’ny volo rehetra. <br>\r\nTsy kobanina fa avela hiasa tsara ary hoento mandritra ny tontolo andro. <br>  \r\n……… Ariary ny vidiny ka anaovana ve ianao ? <br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                ', '400 ml', '                                                <b>CARACTÉRISTIQUES</b><br>\r\n<br> \r\nSHAMPOO MISTINE LONG HAIR est un shampoing avec un ph adapté au cuir chevelu. Il nettoie la saleté et l\'excès d\'huile des cheveux et du cuir chevelu en douceur. Mais encore, sa  formule riche en acides aminés lui permet de: <br>  \r\n- Nourrir les cheveux pour qu’ils soient plus forts et résistants, difficiles à casser<br> \r\n- Apporter une bonne hydratation aux cheveux de la racine à la pointe<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        ', 1, 42, 'SHAMPOING CAPILLAIRE', 'MISTINE', 'MISITINE', '', 'LONG HAIR', '2013-01-01', '2021-12-31', ''),
('CAP060', 'PANTENE CONDITIONER HAIR FALL CONTROL 70.ML', '                                                                                                   <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Mélange de nutriments Pro-V:</b> renforce l\'intérieur des cheveux au niveau structurel et octroie une force durable pour réduire la chute des cheveux due à la casse<br> \r\n<b>Panthenol (dérivé de la Vitamine B5):</b> réduit les chutes de cheveux dues à la casse, favorise le démêlage des cheveux, donne un aspect épais aux cheveux fins, absorbe l’humidité détenue dans\r\nl’air afin de les protéger de la sécheresse<br>\r\n<b>Extrait de protéine de soie:</b> améliore et maintient l\'hydratation des cheveux et les rend doux, soyeux et brillants<br>  \r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\n<b>Après shampoing 3 mn miracle:</b> Water, Bis-Aminopropyl Dimethicone, Stearyl Alcohol, Fragrance, Isopropyl, Alcohol,Benzyl Alcohol, Disodium EDTA, Butylene Glycol,Histidine, Ciltric Acid, Panthenol, Panthenyl Ethyl Ether, Silik Extract, Methylchloroisothiazolinone, Methylisothiazolinone, CI 19140,CI 17200, CI42090<br>                                                                                                                                                                                                                                                                                                                                    ', '                                                                                                      <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mouiller les cheveux à l’eau chaude<br>\r\n<b>Etape 2:</b> Appliquer et frotter le shampoing sur toute la surface des cheveux<br>\r\n<b>Etape 3:</b> Rincer et remettre du shampoing jusqu’à ce que les cheveux soient propres<br>\r\n<b>Etape 4:</b> Appliquer l’après shampoing après le lavage au shampoing<br>\r\n<b>Etape 5:</b> Masser le cuir chevelu  pendant 1 ou 2 minutes<br>\r\n<b>Etape 6:</b> Laisser reposer  pendant 3 minutes<br>\r\n<b>Etape 7:</b> Rincer abondamment à l’eau froide<br>                                                                                                                                                                                                                                                                                      ', '', '                                                                                                <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Toky avy ao amin’ny One To One Marketing .<br>\r\nAmin’izao fotoana izao ny agence One To One Marketing dia manolotra après-shampoing «Pantene pro-V 3minutes Miracle». Ao anatin’ny 3 minitra monja dia ho hitanao ny fiasany. Sady mampangirana ny volo izy no mampalama sy manalefaka azy noho izy «pro-vitaminé». Karazana pack 3 no atolotray:<br>\r\nNy TOTAL DAMAGE CARE (violet) dia miaro sy mitsabo ny volo vakivaky sy tapatapaka, <br>\r\nNy HAIR FALL CONTROL (rose) indray dia miaro ny volo amin’ny fihintsanana <br>\r\nAry ny COLOR & PERM dia natokana mba hiaro ny volo miloko sy natao Permanente. <br>\r\n.........Ar après shampoing 70 ml miaraka.<br> Anaovana madama? Tsy mifidy karazam-bolo ny PANTENE fa na gras na sec, na tsotra na oliholy dia afaka ampiasàna azy avokoa.<br>\r\nKoa iza no atao anao? Andramo anie dia ho hitanao ny hatsarany ee! <br>                                                                                                                                                                                                                                                          ', '70 ml', '                                                                                                       <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nPANTENE est une marque de cosmétiques de soin capillaire conçu pour adoucir et embellir tous types de cheveux. La gamme PANTENE HAIR FALL CONTROL :<br>\r\n- Fortifie la racine des cheveux  pour les protéger des chutes<br>\r\n- Lisse et adoucit les cheveux<br>\r\n- Protège de cuir chevelu contre les agressions extérieures<br>                                                                                                                                                                                                                                                                                                             ', 1, 2, 'APRES SHAMPOING ', 'PANTENE', 'PROCTER & GAMBLE', '', 'HAIR FALL CONTROL', '2013-01-01', '2021-12-31', ''),
('CAP061', 'MISTINE TREATMENT LONG HAIR INTENSIVE 100.GR', '                                                                                                           <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br> \r\n<b>Panthénol ou vitamine B5:</b> adoucit et facilite le démêlage des cheveux<br>  \r\n<b>Collagène hydrolysé:</b> restructure les cheveux abîmes par des traitements chimiques ou ratage capillaire<br> \r\n<b>Kératine hydrolysée:</b> renforce la racine pour lutter contre la perte des cheveux<br>  \r\n<b>Extrait de ginseng:</b> favorise la croissance des cheveux<br>\r\n <br> \r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nWater, Cetearyl Alcohol, Glyceryl, Stearate, Propylene glycole, Mineral Oil, Glycerin, Steatrimonium, Chloride, Amodimethicone, Cetrimonium Chloride, Trideceth-12, Isopropyl Alcohol, Behentrimonium, Chloride, Cyclomethicone, Dimethicone, Urtica Dioica (Nettle) Extract, Chamomilla, Recutita (Matriarca) FlowerExtract, Rosmarinus Officinalis (Rosemary) Leaf Extract, Equisetum Hiemale Extract Symphytum Officinale Leaf Extract, Lawsonia Inermis (Henna) Extract, Humulus Lupulus (Hops) Extract, Honey Extract, Hydrolyzed Collagen, Hydroxypropyltrimonium Hydrolyzed Keratin, Panax Ginseng Root Extract, Panthenol, Oryza Sativa Bran Oil; Xanthan Gum, Potassium Sorbate, Guar Hydroxypropyltrimonium Chloride, Fragrance, DMDM Hydantoin, Pentaerythrityl Tetra-di-t-Butyl Hydroxyhydrocinnamate, Disodium EDTA, Phenoxyethanol, Methylchloroisothiazolinone, Methylisothiazolinone, Magnesium Nitrate, MagnesiumChloride<br>\r\n                                                                                                                             ', '                                                                                                 <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Laver les cheveux avec une bonne quantité de shampoing  à l’eau chaude<br> \r\n<b>Etape 2:</b> Rincer puis appliquer un 2 ème shampoing  et rincer abondamment<br>\r\n<b>Etape 3:</b> Appliquer le traitement MISTINE LONG HAIR  en insistant sur les pointes<br>\r\n<b>Etape 4:</b> Laisser reposer 5 à 10 minutes puis rincer à l’eau tiède<br>\r\n<b>Etape 5:</b> Laisser sécher les cheveux<br> \r\n<b>Etape 6:</b> Puis appliquer 1 ou 2 pompes du sérum sur la paume<br>\r\n<b>Etape 7:</b> Frotter vos deux mains puis appliquer sur les cheveux mouillés ou secs<br>\r\n<b>Etape 8:</b> Insister sur les pointes des cheveux<br>\r\n<b>Etape 9:</b> Ne pas rincer, MISTINE SERUM n’est pas collante et ne contient pas de produits chimiques nocifs<br>                                  \r\n                                                                                                                                                                                                                     ', '', '                                                                                                   <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao ny One To One Marketing, Ida no anarako ary ny gamme MISTINE LONG HAIR indray ny vokatra  vaovao hoentiko aminao  androany.Ahitanao: <br>\r\n- Shampooing 400 ml<br> \r\n- Treatment (na solon’ny masque) 100g<br>\r\n- Ary Sérum 20 ml<br>\r\nIo gamme io dia mahavita mitsabo ny volonao simban’ny produits chimiques nampiasaina teo aloha, manasitrana ny volo vakivaky sy tapatapaka ary ihany koa miaro amin’ny fihintsanan’ny volo. <br>\r\nTsy manao magie akory ity gamme MISTINE LONG HAIR ity fa mitondra kosa ny akora rehetra izay ilain’ny volonao mba ho salama tsara sy manampy azy mba haniry tsara sy haingana kokoa. <br> \r\nIreto avy ny anjara asan’ny tsirairay avy eo amin’ny volonao : <br>\r\n- Ny shampooing no manadio ny volo sy manala ireny excés d’huille manentsina ny masokoditra . Efa mitsabo ny volo sahady izy noho ny vitamine hoentiny hi an’ny volo. <br>\r\n- Ny Treatment indray araka izany anarany izany dia mitsabo lalindalina kokoa ny volonao amin’ny sahasimbana izay mitranga eo aminy. Mamerina tsikelikely ny volonao amin’ny état d’origine izy. <br>\r\nAry ny sérum kosa dia entina manalefaka sy mampangirana  ary miaro ny volo amin’ny fivadibadihan’ny toetr’andro sy miaro amin’ny loto izay mahatonga ny loham-bolonao ho vakivaky.\r\nTsotra dia tsotra ny fampiasana io gamme MISTINE LONG HAIR io: <br>\r\n- Sasao madio tsara amin’ny shampooing aloha ny volo<br>\r\n- Kobano ary hosory amin’ny volo rehetra ny Treatment n indrindra ny loham-bolo<br>\r\n- Aleo hilona 5 à 10 mn ary kobano avy eo<br>\r\n- Rehefa avy manasa loha ianao ka  maina tsara ny volo dia koseho eo amin’ny felan-tananao aloha ny SERUM (in-1 na in-2 manapotsitra) <br>\r\nAvy eo dia hosory amin’ny volo rehetra<br>\r\nTsy kobanina fa avela hiasa tsara ary hoento mandritra ny tontolo andro<br>\r\n…… Ariary ny vidiny ka anaovana ve ianao ? <br>                                                                                                                           ', '100 g', '  <b>CARACTÉRISTIQUES</b><br>\r\n<br> \r\nTREATMENT MISTINE LONG HAIR est un traitement capillaire avec un ph adapté au cuir chevelu. Il équilibre la sécrétion d’huile des cheuveux et du cuir chevelu en douceur. Mais encore, sa  formule riche en acides aminés lui permet de: <br> \r\n- Restaurer les cheveux longs et brillants<br>\r\n- Restructurer les cheveux abîmes par des traitements chimiques ou ratage capillaire<br>\r\n- Renforcer la racine pour lutter contre la perte des cheveux<br> \r\n- Favoriser la croissance des cheveux<br>\r\n- Apporter une bonne hydratation aux cheveux de la racine à la pointe<br>                                                                                                                                                                                                                                 ', 1, 42, 'TREATMENT CAPILLAIRE', 'MISTINE', 'MISTINE', '', 'LONG HAIR', '2013-01-01', '2021-12-31', ''),
('CAP062', 'MISTING LONG HAIR 400ML', '                                                <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Panthénol ou vitamine B5:</b> adoucit et facilite le démêlage des cheveux<br> \r\n<b>Collagène hydrolysé:</b> restructure les cheveux abîmes par des traitements chimiques ou ratage capillaire<br>\r\n<b>Kératine hydrolysée:</b> renforce la racine pour lutter contre la perte des cheveux<br>\r\n<b>Extrait de ginseng:</b> favorise la croissance des cheveux<br>\r\n                                                                                                                                            ', '                                                    <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Laver les cheveux avec une bonne quantité de shampoing  à l’eau chaude<br> \r\n<b>Etape 2:</b> Rincer puis appliquer un 2e shampoing  et rincer abondamment<br>\r\n<b>Etape 3:</b> Appliquer le traitement MISTINE LONG HAIR  en insistant sur les pointes<br>\r\n<b>Etape 4:</b> Laisser reposer 5 à 10 minutes puis rincer à l’eau tiède<br>\r\n<b>Etape 5:</b> Laisser sécher les cheveux<br>\r\n<b>Etape 6:</b> Puis appliquer 1 ou 2 pompes du sérum sur la paume<br>\r\n<b>Etape 7:</b> Frotter vos deux mains puis appliquer sur les cheveux mouillés ou secs<br>\r\n<b>Etape 8:</b> Insister sur les pointes des cheveux<br>\r\n<b>Etape 9:</b> Ne pas rincer, MISTINE SERUM n’est pas collante et ne contient pas de produits chimiques nocifs<br>                                                                                                                                                                            ', 'Ã  completer', '                                                    <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao ny One To One Marketing, Ida no anarako ary ny gamme MISTINE LONG HAIR indray ny vokatra  vaovao hoentiko aminao  androany. Ahitanao: <br> \r\n- Shampooing 400 ml<br>\r\n- Treatment (na solon’ny masque) 100g<br>\r\n- Ary Sérum 20 ml<br>\r\nIo gamme io dia mahavita mitsabo ny volonao simban’ny produits chimiques nampiasaina teo aloha, manasitrana ny volo vakivaky sy tapatapaka ary ihany koa miaro amin’ny fihintsanan’ny volo.\r\nTsy manao magie akory ity gamme MISTINE LONG HAIR ity fa mitondra kosa ny akora rehetra izay ilain’ny volonao mba ho salama tsara sy manampy azy mba haniry tsara sy haingana kokoa. <br>  \r\nIreto avy no anjara asan’ny tsirairay avy eo amin’ny volonao.<br>\r\n- Ny shampooing no manadio ny volo sy manala ireny excés d’huille manentsina ny masokoditra. Efa mitsabo ny volo sahady izy noho ny vitamine hoentiny ho an’ny volo. <br>\r\n- Ny Treatment indray araka izany anarany izany dia mitsabo lalindalina kokoa ny volonao amin’ny sahasimbana izay mitranga eo aminy. Mamerina tsikelikely ny volonao amin’ny état d’origine izy.\r\n- Ary ny sérum kosa dia entina manalefaka sy mampangirana  ary miaro ny volo amin’ny fivadibadihan’ny toetr’andro sy miaro amin’ny loto izay mahatonga ny loham-bolonao ho vakivaky.<br>\r\nTsotra dia tsotra ny fampiasana io gamme MISTINE LONG HAIR io:<br>\r\n- Sasao madio tsara amin’ny shampooing aloha ny volo<br>\r\n- Kobano ary hosory amin’ny volo rehetra ny Treatment ny indrindra ny loham-bolo<br>\r\n- Aleo hilona 5 à 10 mn ary kobano avy eo<br>\r\nRehefa avy manasa loha ianao ka  maina tsara ny volo dia koseho eo amin’ny felan-tananao aloha ny SERUM (in-1 na in-2 manapotsitra).<br>\r\nAvy eo dia hosory amin’ny volo rehetra. <br>\r\nTsy kobanina fa avela hiasa tsara ary hoento mandritra ny tontolo andro. <br>  \r\n……… Ariary ny vidiny ka anaovana ve ianao ? <br>                                                                                                                                                                                 ', '400 ml', '                                                       <b>CARACTERISTIQUES</b><br>\r\n<br> \r\nSHAMPOO MISTINE LONG HAIR est un shampoing avec un ph adapté au cuir chevelu. Il nettoie la saleté et l\'excès d\'huile des cheveux et du cuir chevelu en douceur. Mais encore, sa  formule riche en acides aminés lui permet de: <br>  \r\n- Nourrir les cheveux pour qu’ils soient plus forts et résistants, difficiles à casser<br> \r\n- Apporter une bonne hydratation aux cheveux de la racine à la pointe<br>                                                                                                                                                                                 ', 1, 42, 'SHAMPOING CAPILLAIRE', 'MISTINE', 'MISTINE', '', 'LONG HAIR', '2013-01-01', '2021-12-31', ''),
('CAP063', 'MISTINE TREATMENT THE MODERN BY PROFESSIONAL 150.GR', '                                                                                                                                                                                                                                                <b>INGREDIENTS PRINCIPAUX</b><br> \r\n<br>\r\n<b>Huile de noix de macadamia (Macadamia Nut):</b> hydrate, régénère et donne de la brillance aux cheveux<br>\r\n<b>Protéine de kératine:</b> renforce la structure du cheveu et stimuler sa pousse<br>\r\n<b>Algues rouges et des neiges:</b> protègent les cheveux des agressions causées par la pollution<br>\r\n<b>Algues des neiges:</b> améliorent la structure du cheveu et lutte contre la décoloration grise des cheveux<br>\r\n\r\n                                                                                                                                                                                                                                                \r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        ', '                                                                                                                                                                                                                                                <b>MODE D’UTILISATION</b><br> \r\n<br>\r\n<b>Etape 1:</b> Laver les cheveux avec une pompe du shampoing. Relaver si vous n’êtes pas satisfait<br> \r\n<b>Etape 2:</b> Appliquer le Treatment sur vos pointes et laisser reposer 3 à 5 mn<br>\r\n<b>Etape 3:</b> Mettre une noisette du Treatment à la racine et rincer sans pause avec de l’eau froide<br>\r\n<b>Etape 4:</b> Appliquer 1-2 pompes de sérum sur la paume de la main<br>\r\n<b>Etape 5:</b> Frotter et appliquer sur les cheveux secs ou légèrement humides sans rincer<br>\r\nNB : Toujours  utiliser le sérum avant un brushing ou l’utilisation d’un fer à lisser pour protéger les cheveux de la chaleur<br>\r\n\r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   ', 'A completer', '                                                                                                                                                                                                                                                      <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao tompoko, Manitra avy ao amin’ny agence one to one marketing.<br>\r\nMitady produit manasitra sy manatsara volo ve ianao? <br>\r\nNy MISTINE Mordern by professionnel no atolotro ho anao.<br>\r\nSoin complet no atolotro ho anao izay mety amin’ny karazam-bolo rehetra.<br>\r\n- Manalama sy manalefaka ary mampangirana ny volo tsotra.<br>\r\n- Manasitrana sy manatsara ny volo vakivaky sy makiana<br>\r\n- Miaro amin’ny volo fotsy na manemotra ny fipohiran’ny volo fotsy. <br>\r\n- Miaro ihany koa amin’ny fihintsanan’ny volo.<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        ', '150 g', '                                                                                                                                                                                                                                                <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nLe Treatment MISTINE Modern by Professional est un sérum de traitement intensif riche en minéraux et en valeur nutritive de l\'huile de noix de macadamia infusé de kératine. Il :<br>\r\n- Répare les cheveux abîmés par la pollution et/ou les produits chimiques<br>\r\n- Renforce la structure des cheveux de la racine à la pointe<br>\r\n- Protège les cheveux des futures agressions<br>\r\n- Aide les cheveux à la repousse<br>\r\n- Hydrate le cuir chevelu<br>                                                                                                                                                                                                                                       \r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                           ', 1, 51, ' MASQUE CAPILLAIRE', 'MISTINE', 'MISTINE', '', 'MODERN BY PROFESSION', '2013-01-01', '2021-12-31', ''),
