('CAP065', ' SERUM THE MODERN BY PROFESSIONAL 20.ML', '                                                                                                <b>INGRÉDIENTS</b><br> \r\n<br>\r\n<b>Huile de noix de macadamia (Macadamia Nut):</b> hydrate, régénère et donne de la brillance aux cheveux<br>\r\n<b>Protéine de kératine:</b> renforce la structure du cheveu et stimuler sa pousse<br>\r\n<b>Algues rouges et des neiges:</b> protègent les cheveux des agressions causées par la pollution<br>\r\n<b>Algues des neiges:</b> améliorent la structure du cheveu et lutte contre la décoloration grise des cheveux<br>\r\n                                                                                                                                                                               ', '                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br> \r\n<b>Etape 1:</b> Effectuer le lavage des cheveux habituel (shampoing/après shampoing/masque ou traitement), dernier rinçage à l’eau froide pour refermer les pores<br>\r\n<b>Etape 2:</b> Puis appliquer 1 ou 2 pompes du sérum sur la paume<br>\r\n<b>Etape 3:</b> Frotter vos deux mains puis appliquer sur les cheveux mouillés ou secs<br>\r\n<b>Etape 4:</b> Insister l’application du sérum sur la pointe des cheveux<br>\r\n<b>Etape 5:</b> Ne pas rincer, MISTINE SERUM MODERN n’est pas collante et ne contient pas de produits chimiques nocifs<br>\r\nNB : Toujours  utiliser le sérum avant un brushing ou l’utilisation d’un fer à lisser pour protéger les cheveux de la chaleur<br>                                                                                                                                              ', '<ul>\r\n<li>Huile de n', '                                                                                                <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao tompoko, Manitra avy ao amin’ny agence one to one marketing.<br>\r\nMitady produit manasitra sy manatsara volo ve ianao? <br>\r\nNy MISTINE Mordern by professionnel no atolotro ho anao.<br>\r\nSoin complet no atolotro ho anao izay mety amin’ny karazam-bolo rehetra.<br>\r\n- Manalama sy manalefaka ary mampangirana ny volo tsotra.<br>\r\n- Manasitrana sy manatsara ny volo vakivaky sy makiana<br>\r\n- Miaro amin’ny volo fotsy na manemotra ny fipohiran’ny volo fotsy. <br>\r\n- Miaro ihany koa amin’ny fihintsanan’ny volo.<br>                                                                                       \r\n                                                                                                                                                                                ', '20 ml', '                                                                                                 <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nLe Sérum MISTINE Modern  by Professional est un sérum capillaire riche en minéraux et en valeur nutritive de l\'huile de noix de macadamia, de la protéine de kératine et des algues rouges et glacées. Il : <br>\r\n- Protège les cheveux des agressions causées par la pollution<br> \r\n- Donne de l’éclat et une douceur de longue durée<br> \r\n- Renforce  les cheveux de la racine à la pointe<br>                                                                                                                                                                                    ', 1, 42, 'SERUM CAPILLAIRE', 'MISTINE', 'MISTINE', '', 'MODERN BY PROFESSION', '2013-01-01', '2021-12-31', ''),
('COR00', 'BE NICE SHOWER CREAM GREEN', ' <b>INGRÉDIENTS  PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extrait de fruit:</b> (pomme, kiwi, fraise, raisin): hydrate et nourrit la peau pour un aspect plus doux, lisse et limite le vieillissement  de la peau, contribue au renouvelant les cellules endommagées, lutte contre les manifestations inflammatoires et contre le stress oxydatif des cellules<br>\r\n<b>Extrait  de grain de café:</b> gomme des imperfections de la peau<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua , Sodium lauryl ether sulfate, Potassium laurate, Potassium myristate, Glycerine, Sorbitol, Sodium lauryl sulfate, Potassium stearate, Propylene glycol, Fragrance, Glycol distearate, Hydroxyethylcellulose, Tetrasodium EDTA, Triticum vulgare (Wheat) gluten, Colliodal silver, Pentaerythrityl tetra-di-t-butyl hydroxyhydrocinnamate, Pentylene glycol/ Sodium lactate / Lactic acid / Serine/ Urea/ Sodium chloride / Allantoin, Butylene glycol/ Carbomer/ Polysorbate 20 / Palmitoyl pentapeptide-3, Triclocarban, Troclosan, Methylparaben, Propylparaben<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                          ', ' <b>MODE D’UTILISATION</b><br>\r\n <br>\r\n<b>Etape 1:</b> Mettre une noisette sur la main ou sur un gant de toilette<br>\r\n<b>Etape 2:</b> Frotter doucement sur le corps<br>\r\n<b>Etape 3:</b> Masser 3 à 5 minutes les parties sur lesquelles les cellulites apparaissent<br>\r\n<b>Etape 4:</b> Rincer abondamment<br>\r\nNB: Convient aux peaux sensibles / Usage externe uniquement<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     ', '0', '    <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Rija animateur commercial avy ao amin’ny One to One Marketing.<br>\r\nAmin’izao fotoana izao ny agence One to One  dia manao « Lancement » gel douche « Be Nice »no anarany.<br>\r\nNy mampiavaka ny gel douche « Be Nice »dia noho izy sady misy « MICRO COLLAGEN » no misy « PROTEIN DE BLE » ,izay mampihena ny fisehoan’ny «ride» sady mampifintina ary koa manadio ifotony ny hoditra ka manazava azy. <br>\r\nTsy dokambarotra fotsiny izany madama a ! Etsy anie jereo e !Ity ilay soratra hoe « MICRO COLLAGEN » ity soratra« White and Firm »ity dia adika amin’ny teny frantsay hoe « blanchir et raffermir » adika amin’ny teny malagasy hoe« manazava sy mampifintina».<br>\r\n…….Ar GM / …….. Ar PM monja ny vidiny.<br>\r\nTena mora ny gel douche Be Nice satria mandroatra tsara izy ka kely dia kely no ampiasaina dia efa mahenika ny vatana iray manontolo. Sady tsy voatery ho anao irery anie ity vokatra iray ity fa azo ifampizaran’ny fianakaviana iray manontolo e !<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 ', '90 ml', '<b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nBENICE SHOWER CREAM  FIRM & WHITE est un nettoyant corporel formulé à base d’ extrait naturel et en micro-collagène. Il permet de: <br>\r\n- Nettoyer et hydrater la peau à chaque toilette<br>\r\n- Lutter contre l’apparition des cellulites<br> \r\n- Protéger la peau des étirements brusques<br>\r\n- Raffermir et adoucir la peau<br>\r\n- Améliorer et unifier le teint de la peau<br>\r\n- Protéger la peau  contre tout risque d’allergies et d’inflammations<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        ', 1, 43, 'SHOWER CREAM', 'BENICE', 'NEO CORPORATION', '', 'ANTI-CELLULITE', '2013-01-01', '2021-12-31', ''),
