('COR002', 'IMPERIAL LEATHER SOAP P-SOFLTLY SOFTLY', '                                                         <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Glycérine: </b> est doté de propriétés tensions actives qui lissent la peau, en maintenant un niveau constant d\'hydratation, hydrate et améliore l’apparence de la peau en lui conférant une grande douceur<br>\r\n<b>Niacinamide (connu sur le nom de VITAMINE B3): </b> fait disparaître les signes du vieillissement, tels que les ridules et les rides, apaise la peau sensible et réduite les rougeurs et les tâches<br>\r\n<b>Extrait de rose: </b> adoucit et embellit la peau tout en apportant un doux parfum floral<br>\r\n<br>                                                                                                                               ', '                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Utiliser pendant le bain ou la douche<br>\r\n<b>Etape 2:</b> Appliquer sur la peau humide<br>\r\n<b>Etape 3:</b> Bien étaler sur toute la surface de la peau<br>\r\n<b>Etape 4:</b> Rincer immédiatement et abondamment<br>\r\n                                                                                                                                     ', '', '                                                             <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Caroline commercial avy ao amin’ny One to One Marketing.<br>\r\nAmin’izao fotoana izao ny agence One to One dia manao fanentanana momba ny savon de toilette Imperial Leather Softy Softy.<br>\r\nSavony miavaka ny Imperial Leather softy softy noho izy manazava ny hoditra eo noho eo izany hoe manazava ny lokon’ny hoditry ny tarehinao.<br>\r\nTsy vitan’izany ihany fa miaro amin’ny mony sy manalefaka ny hoditra ny savon de toilette imperial Leather white princesse noho izy misy talc izay mitroka ny hatsemboana, misy glicerine ihany koa izy ka manamandina ny hoditra.<br>\r\nEfa nandalo test dermatologique ny savon de toilette imperial leather. Izany hoe efa vita andrana tamin’ny karazan-koditra maro ka afaka mampiasa azy avokoa ny rehetra.<br>\r\n............Ar monja no vidiny ka anaovana madama? Andramo anie dia ho hitanao ny fihasany e! hadio be aoka izany ny tarehinao vao vantany vao mampiasa azy ianao. Efa maro ny mpanjifantsika no efa afapo tamin’ireo tombotsoa maro izay entiny. Koa atao firy ny anao? <br>\r\n                                                                                                                           ', '75 g', '                                                     <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nLe savon IMPERIAL LEATHER SOFTY SOFTY est un savon ultra-doux à utiliser sur le corps mais aussi sur le visage<br>\r\nIl adoucit la peau et la rend plus lisse tout en éliminant efficacement les impuretés déposées sur la peau<br>\r\nIl hydrate la peau trois fois plus qu’un savon ordinaire<br>\r\nIl contient de l\'extrait de thé de cynorrhodon, connu pour son antioxydant et son lait hydrolysé pour une peau lisse et douce qui marche aussi à l’usage d’un démaquillant<br>\r\nLe savon IMPERIAL LEATHER SOFTY SOFTY  BATH SOAP a passé des tests dermatologiques, son ph est effectivement adapté à tous les types de peau et à tout âge<br>                                                                                                                                  ', 1, 45, 'SAVON ', 'IMPERIAL', 'Non mentionné', '', 'P-SOFLTLY SOFTLY', '2013-01-01', '2021-12-31', ''),
