('COR005', 'BE NICE SHOWER CREAM GREEN', '                                                                                                  <b>INGRÉDIENTS  PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extrait de fruit :</b> (pomme, kiwi, fraise, raisin): hydrate et nourrit la peau pour un aspect plus doux, lisse et limite le vieillissement  de la peau, contribue au renouvelant les cellules endommagées, lutte contre les manifestations inflammatoires et contre le stress oxydatif des cellules<br>\r\n<b>Extrait  de grain de café:</b> gomme des imperfections de la peau<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua , Sodium lauryl ether sulfate, Potassium laurate, Potassium myristate, Glycerine, Sorbitol, Sodium lauryl sulfate, Potassium stearate, Propylene glycol, Fragrance, Glycol distearate, Hydroxyethylcellulose, Tetrasodium EDTA, Triticum vulgare (Wheat) gluten, Colliodal silver, Pentaerythrityl tetra-di-t-butyl hydroxyhydrocinnamate, Pentylene glycol/ Sodium lactate / Lactic acid / Serine/ Urea/ Sodium chloride / Allantoin, Butylene glycol/ Carbomer/ Polysorbate 20 / Palmitoyl pentapeptide-3, Triclocarban, Troclosan, Methylparaben, Propylparaben<br>                                                                                                                                                                                                                                                                                                                                    ', '                                                                                                                                                <b>MODE D’UTILISATION</b><br>\r\n <br>\r\n<b>Etape 1:</b> Mettre une noisette sur la main ou sur un gant de toilette<br>\r\n<b>Etape 2:</b> Frotter doucement sur le corps<br>\r\n<b>Etape 3:</b> Masser 3 à 5 minutes les parties sur lesquelles les cellulites apparaissent<br>\r\n<b>Etape 4:</b> Rincer abondamment<br>\r\nNB: Convient aux peaux sensibles / Usage externe uniquement<br>                                                                                                                                                                                                                                                                                                    ', '', '                                                                                                                                                       <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Rija animateur commercial avy ao amin’ny One to One Marketing.<br>\r\nAmin’izao fotoana izao ny agence One to One  dia manao « Lancement » gel douche « Be Nice »no anarany.<br>\r\nNy mampiavaka ny gel douche « Be Nice »dia noho izy sady misy « MICRO COLLAGEN » no misy « PROTEIN DE BLE » ,izay mampihena ny fisehoan’ny «ride» sady mampifintina ary koa manadio ifotony ny hoditra ka manazava azy. <br>\r\nTsy dokambarotra fotsiny izany madama a ! Etsy anie jereo e !Ity ilay soratra hoe « MICRO COLLAGEN » ity soratra« White and Firm »ity dia adika amin’ny teny frantsay hoe « blanchir et raffermir » adika amin’ny teny malagasy hoe« manazava sy mampifintina».<br>\r\n…….Ar GM / …….. Ar PM monja ny vidiny.<br>\r\nTena mora ny gel douche Be Nice satria mandroatra tsara izy ka kely dia kely no ampiasaina dia efa mahenika ny vatana iray manontolo. Sady tsy voatery ho anao irery anie ity vokatra iray ity fa azo ifampizaran’ny fianakaviana iray manontolo e !<br>\r\n                                                                                                                                                                                                   ', '90 ml', '                                                                                                                                                  <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nBENICE SHOWER CREAM  FIRM & WHITE est un nettoyant corporel formulé à base d’ extrait naturel et en micro-collagène. Il permet de: <br>\r\n- Nettoyer et hydrater la peau à chaque toilette<br>\r\n- Lutter contre l’apparition des cellulites<br> \r\n- Protéger la peau des étirements brusques<br>\r\n- Raffermir et adoucir la peau<br>\r\n- Améliorer et unifier le teint de la peau<br>\r\n- Protéger la peau  contre tout risque d’allergies et d’inflammations<br>                                                                                                                                                                                                                                                                            ', 1, 43, ' SHOWER CREAM', 'BENICE', 'NEO CORPORATION', '', 'ANTI-CELLULITE', '2013-01-01', '2021-12-31', ''),
