('COR007', 'BE NICE SHOWER CREAM ANTI-BACTERIA GREEN', '                                                                                                  <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Micro-collagène:</b> procure une bonne fermeté à la peau et l’empêche de se relâcher des muscles, octroie un aspect lisse et doux à la peau<br>\r\n<b>Protéine de blé:</b> raffermit et revitalise la peau pour un aspect plus jeune, améliore de système immunitaire pour mieux former une barrière contre les bactéries<br>\r\n<b>Triple Active Plus Complex:</b> protège le corps contre les bactéries, argent Colloïdal: lutte contre l’exéma et les allergies<br>\r\n<b>Allantoïne (source en Vitamine E):</b> inflammatoires, apaisantes, anti-irritantes, régénérantes, hydratantes et adoucissantes pour la peau<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua , Sodium lauryl ether sulfate, Potassium laurate, Potassium myristate, Glycerine, Sorbitol, Sodium lauryl sulfate, Potassium stearate, Propylene glycol, Fragrance, Glycol distearate, Hydroxyethylcellulose,  Tetrasodium EDTA, Triticum vulgare (Wheat) gluten, Colliodal silver, Pentaerythrityl tetra-di-t-butyl hydroxyhydrocinnamate, Pentylene glycol/ Sodium lactate / Lactic acid / Serine/ Urea/ Sodium chloride / Allantoin, Butylene glycol/ Carbomer/ Polysorbate 20 / Palmitoyl pentapeptide-3, Triclocarban, Troclosan, Methylparaben, Propylparaben<br>                                                                                                                                                                                                                                                                                                                                         ', '                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mettre une noisette sur la main ou sur un gant de toilette<br>\r\n<b>Etape 2:</b> Frotter doucement sur le corps<br>\r\n<b>Etape 3:</b> Masser 3 à 5 minutes les parties sur lesquelles les cellulites apparaissent<br>\r\n<b>Etape 4:</b> Rincer abondamment<br>\r\nNB : Convient aux peaux sensibles / Usage externe uniquement<br>                                                                                                                                                                                                                                                                                                                                  ', '', '                                                                                                <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Rija commercial avy ao amin’ny One to One Marketing.<br>\r\nAmin’izao fotoana izao ny agence One to One  dia manao « Lancement » gel douche « Be Nice »no anarany ,100 %Bio izany hoe vita 100% amin’ny zava-maniry.<br>\r\nNy mampiavaka ny gel douche « Be Nice »dia noho izy sady misy « MICRO COLLAGEN » no misy « PROTEIN DE BLE » ,izay mampihena ny fisehoan’ny «ride» sady mampifintina ary koa manadio ifotony ny hoditra ka manazava azy. <br> \r\nTsy dokambarotra fotsiny izany madama a !Etsy anie jereo e !Ity ilay soratra hoe « MICRO COLLAGEN » ity soratra« White and Firm »ity dia adika amin’ny teny frantsay hoe « blanchir et raffermir » adika amin’nyteny malagasy hoe« manazava sy mampifintina».<br>\r\n……..Ar GM / …….Ar PM monja ny vidiny. Tena mora ny gel douche Be Nice satria mandroatra tsara izy ka kely dia kely no ampiasaina dia efa mahenika ny vatana iray manontolo. Sady tsy voatery ho anao irery anie ity vokatra iray ity fa azo ifampizaran’ny fianakaviana iray manontolo e ! <br>\r\nKa anaovana firy madama ? Inona no mbola mampisalasala anao ?<br>                                                                                                                                                                                                                                                                                                             ', '90 ml', '                                                                                                <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nBENICE SHOWER CREAM ANTI-BACTERIA ACTIV PLUS est un nettoyant corporel antibactérien qui protège la peau pendant 24 h. Sa formule Triple Active Plus Complex est riche en collagène naturel lui permet de: <br>\r\n- Nettoyer et hydrater la peau à chaque toilette<br>\r\n- Lutter 3 fois plus contre l’accumulation des bactéries ou l’apparition des champignons<br>\r\n- Protéger la peau des étirements brusques<br>\r\n- Raffermir et adoucir la peau<br> \r\n- Améliorer et unifier le teint de la peau<br>\r\n- Protéger la peau  contre tout risque d’allergies et d’inflammations<br>                                                                                                                                                                                                                                                                                                                ', 1, 43, 'SHOWER CREAM', 'BENICE', 'NEO CORPORATION', '', 'ANTI-BACTERIEN ACTIV', '2013-01-01', '2021-12-31', ''),
('COR008', 'BE NICE SHOWER CREAM ANTI-BACTERIA PINK ', '                <b>INGRÉDIENTS PRINCIPALES</b><br>\r\n<br>\r\n<b>Micro-collagène:</b> procure une bonne fermeté à la peau et l’empêche de se relâcher des muscles, octroie un aspect lisse et doux à la peau<br>\r\n<b>Protéine de blé:</b> raffermit et revitalise la peau pour un aspect plus jeune, améliore de système immunitaire pour mieux former une barrière contre les bactéries<br>\r\n<b>Extrait de pépins de raisin (Vitamine E) :</b> nourrit la peau sèche et hydrate la peau grasse, excellent gommage naturel pour la peau, aide à lutter contre le vieillissement de la peau<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua , Sodium lauryl ether sulfate, Potassium laurate, Potassium myristate, Glycerine, Sorbitol, Sodium lauryl sulfate, Potassium stearate, Propylene glycol, Fragrance, Glycol distearate, Hydroxyethylcellulose,  Tetrasodium EDTA, Triticum vulgare (Wheat) gluten, Colliodal silver, Pentaerythrityl tetra-di-t-butyl hydroxyhydrocinnamate, Pentylene glycol/ Sodium lactate / Lactic acid / Serine/ Urea/ Sodium chloride / Allantoin, Butylene glycol/ Carbomer/ Polysorbate 20 / Palmitoyl pentapeptide-3, Triclocarban, Troclosan, Methylparaben, Propylparaben<br>                                                                            ', '<b>MODE D’UTILISATION</b><br> \r\n<br>\r\n<b>Etape 1:</b> Mettre une noisette sur la main ou sur un gant de toilette<br>\r\n<b>Etape 2:</b> Frotter doucement sur le corps<br>\r\n<b>Etape 3:</b> Masser 3 à 5 minutes les parties sur lesquelles les cellulites apparaissent<br>\r\n<b>Etape 4:</b> Rincer abondamment<br>\r\nNB: Convient aux peaux sensibles / Usage externe uniquement<br>\r\n                                                                          ', '', '<b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Rija commercial avy ao amin’ny One to One Marketing.<br>\r\nAmin’izao fotoana izao ny agence One to One  dia tonga mamangy antsika aty an-tokantrano tong