('COR01', 'BE NICE FEMININE CLEANSING CLEAR ', '                                                <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Acide lactique:</b> réduit la perte d\'eau de la peau et maintient l\'équilibre hydrique de la peau<br>   \r\n<b>Extrait de Fleur de Mallow:</b> protège des irritations et protège les peaux hypoallergéniques<br>\r\n<br>    \r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua, Sodium laureth sulfate, Cocamidopropyl betaine, Acrylates crosspolymer-4, Fragrance, Cocamide DEA, Potassium hydroxide, Lactic acid, Mallox (Malva sylvestris) ext/ Glycerin/ Butylene glycol, O-Cymen-5-ol, Methylchloroisothiazolinone/ Methylisothiazolinone<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                  ', '                                                 <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mettre 2 ou 3 gouttes sur la main<br>\r\n<b>Etape 2:</b> Appliquer sur la partie externe de la partie intime et sur l’articulation de la cuisse<br>   \r\n<b>Etape 3:</b> Rincer soigneusement et abondamment  avec de l\'eau propre légèrement chaude<br>                                                                                                                                                                                                                                                                                                                                                                                                         ', '0', '                                                \r\n<b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao.Tsinjo commercial avy ao amin’ny one to one marketing. Amin’izao fotoana izao ny agence One To One dia manolotra anao indray ny « Nettoyant Intime BeNice »<br>  \r\nNy « Nettoyant Intime BeNice » dia vokatra iray natokana ho an’ny vehivavy, entina hanadiovana ny faritra intime.<br>\r\nNy mampiavaka azy ity dia noho izy vita avy amin’ny zava-maniry ary mety ho an’ny hoditra tena sensible noho izy manana PH neutre. Malefaka sy manitra ery ny fofony ary efa vita test Clinique izy ity.<br>  \r\nIndraindray negligen’ ny olona ny fanadiovana ny faritra intime izay tena sensible nefa tena ilaina satria soin quotidien tsy tokony hamaivanina ary tokony hampiasana vokatrana tokana manokana ho amin’izany mba hitazomana ny equilibre naturel. Tsy ny savony rehetra noho izany no afaka hanasana ny faritra intime.<br>\r\nMora dia mora ny vidiny, …….Ar monja ary 60ml be izao no fatrany.<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      ', '60 ml', '                                                <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nBENICE FEMININE CLEANSING EXTRA SENSITIVE SKIN est un nettoyant liquide spécialement conçu pour l’hygiène intime féminine et convient pour peau sensible. Combinant les bienfaits d’ingrédients naturels rigoureusement sélectionnés. Il:<br>      \r\n- Évite l\'accumulation des bactéries<br>      \r\n- Lutte contre les odeurs vaginales<br>      \r\n- Maintien l’équilibre du pH dans la partie intime<br>      \r\nCliniquement prouvé pour être non irritant<br>  \r\n    \r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                         ', 1, 20, 'GEL INTIME', 'BENICE', 'NEO CORPORATION', '', 'EXTRA SENSITIVE SKIN', '2013-01-01', '2021-12-31', ''),
('COR010', 'BE NICE SHOWER CREAM GREEN', '                                                      <b>INGRÉDIENTS  PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extrait de fruit:</b> (pomme, kiwi, fraise, raisin): hydrate et nourrit la peau pour un aspect plus doux, lisse et limite le vieillissement  de la peau, contribue au renouvelant les cellules endommagées, lutte contre les manifestations inflammatoires et contre le stress oxydatif des cellules<br>\r\n<b>Extrait  de grain de café:</b> gomme des imperfections de la peau<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua , Sodium lauryl ether sulfate, Potassium laurate, Potassium myristate, Glycerine, Sorbitol, Sodium lauryl sulfate, Potassium stearate, Propylene glycol, Fragrance, Glycol distearate, Hydroxyethylcellulose, Tetrasodium EDTA, Triticum vulgare (Wheat) gluten, Colliodal silver, Pentaerythrityl tetra-di-t-butyl hydroxyhydrocinnamate, Pentylene glycol/ Sodium lactate / Lactic acid / Serine/ Urea/ Sodium chloride / Allantoin, Butylene glycol/ Carbomer/ Polysorbate 20 / Palmitoyl pentapeptide-3, Triclocarban, Troclosan, Methylparaben, Propylparaben<br>                                                                                                                                      ', '                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mettre une noisette sur la main ou sur un gant de toilette<br>\r\n<b>Etape 2:</b> Frotter doucement sur le corps<br>\r\n<b>Etape 3:</b> Masser 3 à 5 minutes les parties sur lesquelles les cellulites apparaissent<br>\r\n<b>Etape 4:</b> Rincer abondamment<br>\r\nNB: Convient aux peaux sensibles / Usage externe uniquement<br>                                                                                                                                                                                             ', '', '                                                   <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Rija