('COR011', 'BE NICE FEMININE CLEANSING PINK ', '                                                                                                                                                                                                                                                 <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Acide lactique:</b> réduit la perte d\'eau de la peau et maintient l\'équilibre hydrique de la peau<br>   \r\n<b>Extrait de Fleur de Mallow:</b> protège des irritations et protège les peaux hypoallergéniques<br>\r\n<br>    \r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua, Sodium laureth sulfate, Cocamidopropyl betaine, Acrylates crosspolymer-4, Fragrance, Cocamide DEA, Potassium hydroxide, Lactic acid, Mallox (Malva sylvestris) ext/ Glycerin/ Butylene glycol, O-Cymen-5-ol, Methylchloroisothiazolinone/ Methylisothiazolinone<br>                                                                                                                                                                                                                                                                                                                         ', '                                                                                                                                                                                                                                                 <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Durant la douche, mouiller la partie externe intime avec de l\'eau tiède <br>   \r\n<b>Etape 2:</b> Mettre 2 ou 3 gouttes de nettoyant intime sur la paume de la main puis frotter légèrement <br>      \r\n<b>Etape 3:</b> Appliquer sur la partie externe de la partie intime et sur l’articulation de la cuisse<br>       \r\n<b>Etape 4:</b> Rincer immédiatement et soigneusement  avec de l\'eau propre légèrement chaude<br>                                                                                                