('COR016', 'D-NEE  BODY BATH 3 EN 1 RAINBOW  SPLASH YELLOW 200.ML', '                                                                                                                                              <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>- Panthénol ou vitamine B5:</b> adoucit et facilite le démêlage des cheveux<br> \r\n<b>- Extrait de miel:</b> calme et apaise en cas des rougeurs de la peau<br>\r\n<b>- Vitamine E:</b> stimule la circulation sanguine et préserve la jeunesse et la vitalité de la peau<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua, Sodium laureth sulfate, Sodium lauroamphoacelate, Cocamidopropyl betaine, PEG-80 sorbitan laurate, Glycerin, PEG-12 dimenthicone, Guar hydroxypropyltrimonium chloride, PEG-150 distearate, Tocopheryl acetate, Panthenol, Honey extract/Propylene glycol, Fragance, Disodium EDTA, Citric acid, Styrene/Acrylate copolymer, Methylchloroisothiazolinone<br>\r\n                                                                                        ', '                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mettre quelques gouttes du D-nee Kids sur la main ou sur un gant de toilette<br> \r\n<b>Etape 2:</b> Frotter doucement sur le cuir chevelu et le corps de l’enfant<br> \r\n<b>Etape 3:</b> Rincer abondamment<br>\r\n<b>Etape 4:</b> Convient aux enfants dès 3 ans<br>                                                                                                                                 ', '				<p>ARGUMENTAIRE ', '                                                                                                 <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly mandray anao, Rota commercial avy ao amin\'ny One To One Marketing no mandray anao.<br>\r\nAmin\'izao fotoana izao dia manolotra ho anao ny vokatra vaovao ho an\'ny zaza sy ny ankizy izahay.<br>\r\nMadama ve mananjanaka na akaiky amin\'olona manan-janaka kely?<br>\r\nTena mety aminao izany ity vokatra ity. D-nee kids 3en1 izay sady Shampoing, Après Shampoing ary Gel douche ihany koa dia mety amin\'ny ankizy  3 taonany no mihoatra. Ny marque D-Nee izay anisan\'ny orinasa matanjaka indrindra any Thailand raha resaka produit fikolokoloina ny zaza sy ny ankizy.<br>\r\nManadio ny volo sy ny vatan\'ny zanakao ny D-Nee Kids ary manala sy mamono ny bakteria rehetra izay azon\'ny ankizy teny am-pilalaovana nandritra ny tontolo andro. Manalefaka ny volo sy ny hoditra izy ity, ph neutre ka tsy hatahorana hanaikitra ny hoditra sy ny mason\'ny zanakao. Hypoallergénique ihany koa izy ka tsy hatahorana amin\'ny fipohiran\'ny allergie na dia tena sensible be aza ny hoditry ny zanakao. Sady mitondra hanitra malefaka ny D-Nee Kids ka ho hitanao fa ho miramirana ery ny zanakao rehefa ampandroana aminy. Izy indray ary no hiantso hoe: andao amin\'izay handro Neny a!!!<br>\r\n- Raha vavy kely ny zanakao dia ny Candy Fruity no conseiller-ko anao Madama,<br>\r\n- Raha lahy kely kosa dia ny Rainbow Splash. Tsy dia tena hoe samy hafa akory izy ireo fa ny hanitra hoentiny no mahasamihafa azy.<br>\r\n……….Ar monja ny vidiny.<br>                                                                                                                                                                                                                   ', '200 ml', '  <b>CARACTERISTIQUES</b><br>\r\n<br>\r\nD-Nee Kids 3 en 1 est un gel nettoyant, shampoing et après shampoing au ph neutre conçu spécialement pour les enfants à partir de 3 ans. Il convient à tous les types de peau, même les plus sensibles<br>\r\nD-Nee Kids 3 en 1 est hypoallergénique et il a été testé sous contrôle dermatologique. Il: <br>\r\n- Nettoie et nourrit le cuir chevelu et la peau de votre enfant<br>\r\n- Préserve l’humidité naturelle de la peau tout en hydratant les cheveux<br>\r\n- Protège et apaise la peau contre le changement climatique et les bactéries<br>\r\n- Adoucit les cheveux pour facilité son démêlage<br>                                                                                                                                           ', 1, 44, 'BODY BATH', 'D-NEE ', 'NEO CORPORATION', '', 'KIDS 3 EN 1 RAINBOW ', '2013-01-01', '2021-12-31', ''),
