('COR025', 'GOOD AGE BODY LOTION BODY LOTION GOOD AGE  ', '<b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Beurre de karité:</b> lisse, restaure les défenses naturelles, et adoucit la peau<br>\r\n<b>Olivier d’Europe:</b> apaise, hydrate la peau<br>\r\n<b>Huile de fruit:</b> reconstitue la couche lipidique de la peau<br>\r\n<b>Huile d’onagre bisannuel:</b> effet ralentissant du vieillissement de la peau, améliore les élasticités de la peau<br>\r\n<b>Glycérine et vaseline:</b> adoucit la peau et la rend plus lisse<br>                                                                                            ', '<b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Après le bain et après s’être bien essuyer avec une serviette<br>\r\n<b>Etape 2:</b> Appliquez une noisette de la lotion Good Age sur la paume de votre main<br>\r\n<b>Etape 3:</b> Puis appliquez délicatement  sur toute la surface du corps<br>\r\nNB: Ne pas rincer ni s’essuyer<br>                                                                                        ', '', '  <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao! Ida avy ao amin’ny One To One Marketing no mandray anao. <br>\r\nMety ahasoa anao ity vokatra ity.<br>\r\nEfa rehinao ve ny« GOOD AGE DEEP »? Ilay vokatra manampy anao amin’ny fanadiovana ny hoditrao, sady miaro anao amin’ny ainandro sy izay mety ho karazan-doto ateraky ny « pollution ». Natao ho an’ny olona manomboka misy « rides » na malemy oditra ny « GOOD AGE DEEP MOISTURE ».<br>\r\nTsotra dia tsotra ny fampiasana azy: <br>\r\n- Ataovy mandroatra tsara eo amin’ny vatanao aloha ny « GOOD AGE », hamafiso kokoa eo amin’ny faritra somary maimaina eo amin’ny vatanao  ohatra hoe ny tananao na ny tongotrao.<br>\r\n- Koseho moramora ny vatanao amin’ny « gant de toilette » <br>\r\n- Ary kobany tsara avy eo.<br>\r\n........ Ar ny vidiny, mangalà anie fa hahita vokatra mahafa-po ianao e! Sady mety amin’ny «peau sensible » anie io vokatra io eee! Mangalà iray aloha androany dia ho hitanao fa ho tamana ianao.<br>                                                                                          ', '100 ml', '    <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nGOOD AGE DEEP MOISTURE ANTI-AGEING est une lotion pour le corps à usage quotidien<br>\r\nIl protège la peau contre les agressions extérieures telles que les coups de soleil, les bactéries et les pollutions<br>\r\nIl régénère la peau et lui permet de ralentir le vieillissement de la peau en lui évitant l’apparition des rides<br>\r\nGood Age respecte la fragilité de la peau, elle la renforce en lui apportant un effet réparateur, régénérant et cicatrisant<br>\r\nCette lotion pour corps octroie une finition parfaite à votre peau<br>\r\nGrâce à sa formule au beurre de karité et aux multiples vitamines qui la composent<br>\r\nGood Age hydrate la peau et l’adoucie<br>                                                                                        ', 1, 4, 'LOTION CORPORELLE', 'GOOD AGE', 'Non mentionné', '', 'BODY LOTION GOOD AGE', '2013-01-01', '2021-12-31', '');
