('COR026', 'SHOKUBUTSU SHOWER GEL   EXTREAM PROTECTION  charcoal ', '                                                                                                                                                                                                                                                                                                  <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Glycérine: </b> verrouille l’hydratation de la peau<br>\r\n<b>Extrait de Charbon de bois:</b> purifie la peau, élimine les bactéries et absorbe les excédents en matières grasses sur la peau<br>\r\n<b>Saké (rice ferment filtrate):</b> retire efficacement les peaux mortes qui restent accrochées à l\'épiderme et bouche les pores, pénètre la barrière de la peau, délivre les antioxydants et agit pour éliminer les tâches pour unifier et éclaircir le teint<br>\r\n\r\n                                                                                                                                                                                                                                                                                                                                                                                                         ', '                                                                                                                                                                                                                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Prendre un bain en utilisant SHOKUBUTSU MEN EXTREME PROTECTION<br>\r\n<b>Etape 2:</b> Faire mousser sur le corps à l’aide d’un gant de toilette<br>\r\n<b>Etape 3:</b> Rincer abondamment<br>\r\n                                                                                                                                                                                                                                                                                                                                                                                                       ', '   <p>Natokana ho an', '                                                                                                                                                                                                                                                                                                 <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Faniry Commercial avy ato amin\'ny One To One Markerting no mandray anao.<br>\r\nNy Gel douche « SHOKUBUTSU MEN EXTREME PROTECTION » no vokatra atolotra ho anao. Natao ho an\'ny lehilahy izy ity:<br>\r\n- manadio ny vatana;<br>\r\n- manamandimandina sy manalefaka ny hoditrao eo am-pidiovana<br>\r\n- mitazona ny vatanao hangatsitsika mandritra ny tontolo andro<br>\r\nAnisan\'ny mampiavaka ny SHOKUBUTSU MEN ny fisian\'ireto singa manaraka ireto:<br>\r\n- Ny Charbon : izay manadio sy miaro amin\'ny bakteria ary mitroka ireo menaka sy tavy ratsy miangona ao ambany hoditra.<br>\r\n- Ny Glycérine : izay manamandina ny hoditra<br> \r\n- Saké (rice ferment filtrate) : izay manala ny hoditra maty sy ny tsikoko manetsina ny maso-koditra, ary manazava ny lokon\'ny hoditra<br>\r\nToy izao ny fomba fampiasana azy:<br>\r\n- Hosoranao SHOKUBUTSU MEN EXTREME PROTECTION ny vatanao efa mando<br>\r\n- Kosehina tsara mba handroatra ary kobaninao amin\'ny rano madio izy avy eo<br>\r\n-Ny vidiny dia: …….ar<br>                                                                                            \r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                        ', '200 ml', '                                                                                                                                                                                                                                                                                                            <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nSHOKUBUTSU MONOGATARI MEN EXTREME PROTECTION octroie à 99% une protection ultime et accroît votre confiance. Il: <br>\r\n- Nettoie la peau en profondeur<br>\r\n- Réduit la collecte de bactéries<br>\r\n- Combat les effets du vieillissement et revitalise la peau<br>\r\n- Hydrate et équilibre le taux d’hydratation nécessaire à la peau<br>\r\n- Unifie et éclaircit le teint<br>                                                                                                                                                                                                                                                                                                                                                                                                       ', 1, 44, 'GEL DOUCHE', 'SHOKUBUTSU', 'Non mentionné', '', 'EXTREME PROTECTION ', '2013-01-01', '2021-12-31', ''),
('COR027', 'SHOKUBUTSU SHOWER GEL   COOL SPORT ', '<b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Glycérine:</b> hydratant, solvant et lubrifiant<br>\r\n<b>Acide laurique (dérivée d’huile de coco):</b> antimicrobiens ou antibactériens<br>\r\n<b>Extra Malt:</b> élimine les mauvaises toxines déposées sur la peau<br>\r\n<b>Formule Cool Vital:</b> apporte de la fraîcheur et refroidit le corps par l’extrait de Menthol<br>                                     ', ' <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Après les exercices physiques (musculation, sport)<br>\r\n<b>Etape 2:</b> Prendre un bain en utilisant SHOKUBUTSU COOL SPORT<br> \r\n<b>Etape 3:</b> Faire mousser sur le corps à l’aide d’un gant de toilette ou sans<br>\r\n<b>Etape 4:</b> Bien frotter les parties dans lesquelles la saleté s’accummule le plus<br>\r\n<b>Etape 5:</b> Rincer abondamment<br>                                         	                                                    ', '<p>Natokana ho anâ€™', '    <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Toky commercial avy ao amin’ny One to One Marketing, ny gel douche SHOKUBUTSU COOL SPORT indray no vokatra vaovao ampahafantarin’ny One to One marketing ho anao androany.<br> \r\nEtsy anie jereo ity vokatra ity, gel fidiovana ny SHOKUBUTSU COOL SPORT ary vita 99% avy amin’ny zavamaniry izany hoe BIO avokoa izany ny singa rehetra nanamboarana ny Gel douche SHOKUBUTSU COOL SPORT ka tsy misy atahorana ny mampiasa azy.<br>                                           ', '200 ml', '  <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nSHOKUBUTSU COOL SPORT est une crème lavante pour homme<br>\r\nElle est constituée à 99% par des ingrédients nettoyants à base de plantes<br>\r\nElle réduit les bactéries sécrétées lors de l’activité sportive et refroidit rapidement le corps en lui apportant  de la fraîcheur et régule l’hydratation de la peau pour éviter d’avoir une peau sèche et terne après le bain<br>                                                                                          ', 1, 44, 'GEL DOUCHE', 'SHOKUBUTSU', 'Non mentionné', '', 'COOL SPORT', '2013-01-01', '2021-12-31', ''),
('COR028', 'LAURIER SANITARY TOWEL BLUE', '                                                 <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Coton:</b> doux et agréable, assure une bonne absorption de l’humidité<br> \r\n<b>Pate à papier:</b> isole les fibres cellulosiques et élimine la lignine<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nThermofusible, release paper, polymer, tab tape<br>\r\n                                                                                                                                       ', '                                                    <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Toujours utiliser la serviette hygiénique après s’être lavé<br>\r\n<b>Etape 2:</b> Retirer les bandes sur la partie collante de la serviette<br>\r\n <b>Etape 3:</b> Positionner la sur votre culotte en coton pour assurer une bonne fixation<br>\r\n<b>Etape 4:</b> Portez-le dans la journée<br>                                                                                                                                    ', '', '                                                   <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Elie commercial avy ao amin’ny One To One Marketing.<br>\r\nNy serviette hygienique LAURIER no atolotra ho anao androany.<br>\r\nNy LAURIER dia marque serviette hygienique novokarin’ny KAO corporation. Vehivavy 1 ao anatin’ny telo any Japon no mampiasa azy ity ary tao anatin’ny taona maro dia ny LAURIER no marque be mpividy sy mahafa-po indrindra.<br>\r\nAnisan’ny mampiavaka azy dia noho izy 2 Times Faster na 2 fois  plus rapide sy  5x times drier na 5 fois plus sec ka  mitroka aigna kokoa ny hamandoana ka mitazona anao ho maina tsara mandritra ny tomtolo andro.<br>\r\nMisy karazany roa izy ity:<br> \r\n- Ny LAURIER SOFT AND SAFE MAXI DAYTIME, misy pieces 5 ao anatiny, izay natokana ho ampisaina manditra ny andro roa voalohany  amin’ny fandim-bolana satria somary lava kokoa no mitroka kokoa.<br> \r\n- Ny LAURIER SOFT AND SAFE SLIM DAY, natokana hoan’ny andro roa farany amin’ny fadim-bolana  satria somary manify kokoa.<br>\r\nAndramo dia ho hitanao fa confortable kokoa ny tontolo andronao miaraka amin’ny serviette hygienique LAURIER.<br>                                                                                                                                     ', '1', '                                                    <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nLaurier est une marque de KAO Corporation pour les produits d\'hygiène féminine, et une femme sur trois au Japon utilise les produits d\'hygiène de cette marque<br>\r\nDepuis plusieurs années, Laurier occupe la première place de la notation pour le montant total des ventes<br> \r\nLAURIER SOFT & SAFE SLIM DAY est une serviette hygiénique  en coton délicat qui protège tout au long de la journée de l’humidité et des éclaboussures et des mauvaises odeurs grâce à sa formule: <br> \r\n- 2 Times Faster qui absorbent 2 x plus vite<br> \r\n- 5x time drier  ou  5 x plus secs<br>\r\nCette serviette hygiénique SOFT AND SAFE DAY TIME est composée de 4 pièces<br>\r\nA utiliser surtout pendant les deux premiers jours de la règle<br>                                                                                                                                    ', 1, 40, 'SERVIETTE HYGIENIQUE', 'LAURIER', 'KAO CORPORATION', '', 'SOFT & SAFE MAXI DAY', '2013-01-01', '2021-12-31', ''),
