\n                                                                                         ', '1', '       <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nLaurier est une marque de KAO Corporation pour les produits d\'hygiène féminine, et une femme sur trois au Japon utilise les produits d\'hygiène de cette marque<br>\r\nDepuis plusieurs années, Laurier occupe la première place de la notation pour le montant total des ventes<br>\r\nLAURIER SOFT & SAFE SLIM DAY est une serviette hygiénique  en coton délicat qui protège tout au long de la journée de l’humidité et des éclaboussures et des mauvaises odeurs grâce à sa formule:<br>\r\n- 2 Times Faster qui absorbent 2 x plus vite<br> \r\n- 5x time drier  ou  5 x plus secs<br> \r\nCette serviette hygiénique SOFT AND SLIM  DAY  est composée de 4 pièces plus une pièce  bonus<br>\r\nA utiliser pendant les deux derniers jours de la règle<br>                                                                                     ', 1, 40, 'SERVIETTE HYGIENIQUE', 'LAURIER', 'KAO CORPORATION', '', 'SOFT & SAFE SLIM DAY', '2013-01-01', '2021-12-31', ''),
('COR032', 'MARKET FOOT DEODORANT TAOYEABLOK CHARCOAL ', '                                                        <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Charbon actif:</b> évite l’accumulation des bactéries<br>\r\n<b>Talc:</b> protège contre la transpiration<br>                                                                                              ', '                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Lavez les pieds avec du savon sans parfum<br>\r\n<b>Etape 2:</b> Rincez abondamment et essuyez toutes les parties dans lesquelles s’accumulent les bactéries et les saletés<br>\r\n<b>Etape 3:</b> Agitez le déodorant Spray avant l’utilisation<br>\r\n<b>Etape 4:</b> Vaporisez-le entre les orteils, sur les semelles des pieds avant de porter des chaussettes bien propres<br>\r\n<b>Etape 5:</b> Il peut aussi être utilisé sur les chaussettes et dans les chaussures pour obtenir 2 fois plus d’efficacité<br>                                                                                          ', '	      <p>Ny fomba f', '                                                <b>PRÉSENTATION</b><br>\r\n<br>	\r\nFaly miarahaba anao, Ida commercial ato amin’ny One To One Marketing no mandray anao. Hafakely ny vokatra atolotro anao androany.<br>\r\nEfa renao ve fa misy ny vokatra misoroka amin’ny fofon-tongotra? Mivarotra izany  izahay ao amin’ny One To One Marketing. TAOYEABLOK FOOT DEODORANT no anarany.<br> \r\nMiaro ny tongotra amin’ny fiangona’ny bakteria ka mahatonga ny fofona manelingelina mandritran’ny tontolo andronao.<br> \r\n..........Ar monja ny vidiny. Ka hanaovana ve ianao? Manadrama dia ho hitanao fa ahazo aina ny tongotrao.<br>                                                                                                                                                                              ', '30 g', '                                                            <b>CARACTÉRISTIQUE</b><br>\r\n<br>\r\nTAOYEABLOK FOOT DEODORANT POWDER CHARCOAL FORMULA est une poudre désodorisante pour les pieds qui transpirent<br>\r\nLa poudre charcoal pour pieds neutralise les mauvaises odeurs des pieds grâce à sa formule aux éxtraits de charbon et aide à garder les pieds frais pendant 24 heures<br>\r\nIl réduit l’humidité des pieds, les rafraîchit et les garde à sec toute la journée<br>\r\nPour éviter les odeurs nauséabondes des chaussettes, ne portez que des chaussettes en coton<br>                                                                                                                            ', 1, 23, 'DEODORANT POUR PIED', 'TAOYEABLOK', 'Non mentionné', '', 'CHARCOAL FORMULA', '2013-01-01', '2021-12-31', ''),
('COR033', 'MARKET FOOT DEODORANT TAOYEABLOK ANTI-BACTERIAL ', '<b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Oxyde de Zinc:</b> protège des mauvaises odeurs et ainsi que des bactéries<br>\r\n<b>Talc:</b> protège contre la transpiration<br>                                                                            \r\n                                 ', '  <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Lavez les pieds avec du savon sans parfum<br>\r\n<b>Etape 2:</b> Rincez abondamment et essuyez toutes les parties dans lesquelles s’accumulent les bactéries et les saletés<br>\r\n<b>Etape 3:</b> Agitez le déodorant Spray avant l’utilisation<br>\r\n<b>Etape 4:</b> Vaporisez-le entre les orteils, sur les semelles des pieds avant de porter des chaussettes bien propres<br>                                              				        			            				                                                    ', '<p><em><strong>Ny fo', '<b>PRÉSENTATION</b><br>\r\n<br>\r\n<br> Faly miarahaba anao, Ida commercial ato amin’ny One To One Marketing no mandray anao. Hafakely ny vokatra atolotro anao androany.<br> \r\nEfa renao ve fa misy ny vokatra misoroka amin’ny fofon-tongotra? Mivarotra izany izahay ao amin’ny One To One Marketing. TAOYEABLOK FOOT DEODORANT no anarany. <br>  \r\nMiaro ny tongotra amin’ny fiangona’ny  bakteria ka mahatonga ny fofona manelingelina mandritran’ny tontolo andronao.<br> \r\n..........Ar monja ny vidiny . Ka hanaovana ve ianao? Manadrama dia ho hitanao fa ahazo aina ny tongotrao.<br>                                                                                                 ', '30 g', '                 <b>CARACTÉRISTIQUE</b><br>\r\n<br>\r\nTAOYEABLOK FOOT DÉODORANT POWDER ANTI-BACTERIAL FORMULA est une poudre appliquée sur les pieds pour rendre inoffensifs les organismes nuisibles ou les bactéries, repousser les premières sources des mauvaises odeurs sur les pieds<br>\r\nGrâce à la poudre antibactérienne à la formule secrète de TAOYEABLOK FOOT les pieds promettent de rester frais et secs tout au long de la journée<br>                                                                           ', 1, 23, 'DEODORANT POUR PIED', 'TAOYEABLOK', 'Non mentionné', '', 'ANTI-BACTERIAL', '2013-01-01', '2021-12-31', ''),
