('COR050', 'MISTINE FOOT DEODORANT SPRAY  ', '   <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\nButane, Ethanol, Water, Fragrance, Menthol, Chlorhexidine, Diglucanate<br>                                                                                         ', '    <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Lavez les pieds avec du savon sans parfum<br>\r\n<b>Etape 2:</b> Rincez abondamment et essuyez toutes les parties dans lesquelles s’accumulent les bactéries et les saletés<br>\r\n<b>Etape 3:</b> Agitez le déodorant Spray avant l’utilisation<br>\r\n<b>Etape 4:</b> Vaporisez-le entre les orteils, sur les semelles des pieds avant de porter des chaussettes bien propres<br>\r\n                                            				            				            				            				            					                                                    ', '<p><em><strong>Ny fo', ' <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao ny One To One Marketing. Ida no anarako, ary ny MISTINE FOOT DEODORANT SPRAY indray no vokatra vaovao ho entiko eto aminao androany.<br> \r\nNy MISTINE FOOT DEODORANT SPRAY dia déodorant natokana ho an’ny tongotra, analana ny fofona avokan’ny tongotra izay mety anelingelinao sy ny hafa.<br>\r\nNy mampiavaka ny MISTINE FOOT DEODORANT SPRAY dia noho izy tsy mamela trace blanche amin’ny tongotra sy amin’ny ba kiraro.<br>\r\n.............. ariary ny vidin’ny MISTINE FOOT DEODORANT SPRAY ary azon’ny ao an-tokatrano rehetra ampiasaina. Andramo anie dia ho hitanao fa ho maina tsara sy ho afaka ny fofona ratsy amin’ny tongotray e!<br>                                           ', '65 ml', ' <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nMISTINE FOOT DÉODORANT SPRAY est un déodorant pour pieds en poudre à pulvériser inodore et incolore<br>\r\nIl élimine les odeurs désagréables sur les pieds et leur permet de rester secs toute la journée<br>\r\nCe déodorant pour pied a un effet antiseptique qui empêche l’accumulation des callosités<br>\r\nA l’application, ce déodorant spray adhère directement sur la peau en ne laissant aucune  trace blanche sur les pieds ni sur les chaussettes<br>                                                                                           ', 1, 23, 'DEODORANT POUR PIED', 'MISTINE', 'MISTINE', '', 'FOOT DEODORANT SPRAY', '2013-01-01', '2021-12-31', ''),
