('COR053', 'MISTINE HAIR REMOVER CREAM CLEAR UP & WHITENING ', '      <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Beurre de karité:</b> régénère et répare la peau grâce aux vitamines A, D, E et F, il contient, apaise, protège, nourrit et assouplit la peau, combat les rides et le dessèchement<br>\r\n<b>Amidon de maïs: </b> renforce l\'efficacité de la crème épilatoire<br>\r\n<b>Extrait de racine de Réglisse:</b> anti-inflammatoire et adapté au soin des peaux irritées<br>\r\n<b>Huile de ricin:</b> évite les réactions allergiques ou les brûlures causées par la crème, garde l’élasticité de la peau<br>\r\n<b>Acide lactique: </b> réduit la perte d\'eau de la peau et maintient l\'équilibre hydrique de la peau<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua, Cetearyl Alcool, Calcuim Thioglycolate ; PEG-40, Castor oil, Sodium Cetearyl Sulfate, Caprylic/Capric Triglyceride, Mineral Oil, Sodium Hydroxyde, Glycerin , Hydroxyethylcellulose, Fragrance, Chlorphenesin, Hexylresorcinol, Caprylic Acid, PEG-400, Caproic Acid, Capric Acid, Butylene Glycol, Fomes Officinalis (Mushroom) Extract , Phenoxyethanol, Glycyrrhiza Glabra (Licorite) Root Extract, Zea Mays (Corn) Starch, Hydrolyzed Corn Starch, Hydrolysez Corn Strach Octenylsuccinate, Butyrospermum Parkii (Shea Butter) , Phenylethyl Resorcinol, Cocamidopropyl Dimethylamine, Lactic Acid, Palmitoyl Tripeptide-5 <br>                                                                                                                                   ', '<b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Appliquer une bonne couche de la crème sur le bras ou la jambe<br> \r\n<b>Etape 2:</b> Laisser reposer 5 à 10 minutes si les poils sont fins, 10 à 15 minutes si les poils sont plus épais<br>\r\n<b>Etape 3:</b> Essuyer en mouvement circulaire avec une serviette humide, la partie à épiler<br>\r\n<b>Etape 4:</b> Rincer abondamment à l’eau claire<br>\r\n\r\n                                                                                                                                                  ', '', '                  A Completer                                                                                                                                                                                                                                            ', '50 g', '<b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nMistine Healthy Beauty Crème est une crème épilatoire pour les jambes et les bras. Idéal pour les peaux sensibles, il contient des extraits naturels lui permettant de :<br>\r\n- Protéger la peau des irritations<br>\r\n- Hydrater la peau<br> \r\n- Rendre la peau lisse, douce, radieuse et éclaircit<br>\r\n- Grader l’élasticité de la peau<br>\r\n                                                                                                                                                                             ', 1, 25, 'CREME EPILATOIRE', 'MISTINE', 'MISTINE', '', 'HEATHY BEAUTY CLEAR ', '2013-01-01', '2021-12-31', ''),
('COR054', 'D-NEE SHOWER GEL   PURE HEAD & BODY - BLUE ', '      <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extrait de noyau d’avoine:</b> un ingrédient anti-irritantes, apaisantes pour la peau et nourrissantes<br>\r\n<b>Allantoïne (source en Vitamine E):</b> un ingrédient anti-inflammatoire, anti-irritant, apaisant,  régénérant et adoucissant pour la peau<br>\r\n<b>Eau de mer :</b> améliore l\'hydratation de la peau en favorisant la cicatrisation<br>\r\n <br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua, Sodium laureth sulfate, PEG-80 sorbitan laurate, Cocamudopropyl betaine, Sodium lauroamphoacetate, PEG 150 destearate, Fragrance, Polyquatermium-10, Avena sativa kernel ext./Sodium benzoate, Allantoin, Sea water/Phenoxyethanol/Chlorphenensin, Disodium EDTA, Citric acid, Sodium chloride, Methylchloroisothiazolinone/Methylisothizolinone<br>                                                                                   \r\n                                                                                                                                                                ', ' <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mettre quelques gouttes du D-nee Newborn sur la main ou sur un gant de toilette<br> \r\n<b>Etape 2:</b> Frotter doucement sur le cuir chevelu et le corps de bébé<br>\r\n<b>Etape 3:</b> Rincer abondamment<br>\r\n<b>Etape 4:</b> Convient aux nouveaux-nés<br>\r\n                                                                                                            ', '', ' <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly mandray anao, Rota commercial avy ao amin\'ny One To One Marketing no mandray anao.<br>\r\nAmin\'izao fotoana izao dia manolotra ho anao ny vokatra vaovao ho an\'ny zaza izahay.<br>\r\nMadama ve mananjanaka kely na akaiky amin\'olona manan-janaka kely?<br>\r\nTena mety aminao izany ity vokatra ity. D-nee kids 3en1 izay sady Shampoing, Après Shampoing ary Gel douche ihany koa dia mety amin\'ny ankizy vao teraka na mihoatra. Ny marque D-Nee izay anisan\'ny orinasa matanjaka indrindra any Thailand raha resaka produit fikolokoloina ny zaza sy ny ankizy.<br>\r\nManadio ny volo sy ny vatan\'ny zanakao ny D-Nee Kids ary manala sy mamono ny bakteria rehetra izay azon\'ny ankizy teny am-pilalaovana nandritra ny tontolo andro. Manalefaka ny volo sy ny hoditra izy ity, pH neutre ka tsy hatahorana hanaikitra ny hoditra sy ny mason\'ny zanakao. Hypoallergénique ihany koa izy ka tsy hatahorana amin\'ny fipohiran\'ny allergie na dia tena sensible be aza ny hoditry ny zanakao. Sady mitondra hanitra malefaka ny D-Nee Kids ka ho hitanao fa ho miramirana ery ny zanakao rehefa ampandroana aminy. Izy indray ary no hiantso hoe: andao amin\'izay handro Neny a!!! <br>\r\n- Raha vavy kely ny zanakao dia ny Candy Fruity no conseiller-ko anao Madama, <br>\r\n- Raha lahy kely kosa dia ny Rainbow Splash. Tsy dia tena hoe samy hafa akory izy ireo fa ny hanitra hoentiny no mahasamihafa azy.<br>\r\n………Ar monja ny vidiny.<br>                                                    ', '200 ml', '   <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nD-Nee  Newborn est un gel nettoyant, shampoing et après shampoing au ph neutre conçu spécialement pour bébé. Il convient à tous les types de peau, même les plus sensibles.\r\nD-Nee Newborn est hypoallergénique et il a été testé sous contrôle dermatologique. Il:<br>\r\n- Nettoie et nourrit le cuir chevelu et la peau de votre bébé<br>\r\n- Préserve l’humidité naturelle de la peau et adoucit les cheveux de bébé<br>\r\n- Protège et apaise la peau contre le changement climatique et les bactéries<br>\r\n- Aide à la cicatrisation de sa peau en cas d’écorchure<br>                                                                                          ', 1, 44, 'SHOWER GEL HEAD & BODY', 'D-NEE', 'NEO CORPORATION', '', 'NEWBORN PURE HEAD & ', '2013-01-01', '2021-12-31', ''),
