('FUM001', 'ESSENTIAL LESS SHAVE ', '                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 <b>  INGRÉDIENTS PRINCIPAUX</b><br>  \r\n<br>\r\n<b>- Extrait de graines de glycine soja:</b> participe à la régénération cutanée en protégeant la peau du dessèchement et en la nourrissant en profondeur<br>\r\n<b>- Oligopeptide-3protéine: </b> agent antivieillissement de la peau, agent blanchissant éclaircissant, augmente la production de collagène, diminue la profondeur des rides <br>\r\n<b>- Extrait de racine de mûrier blanc: </b> lui assure une action anti-taches sur la peau et aide à éclaircir le teint<br>\r\n<b>- Extrait de feuilles de raisin: </b> lutte contre le vieillissement cutané,nourrit une peau sèche ou hydrate une peau grasse<br>\r\n<b>- Extrait de réglisse:</b> lutte contre les taches pigmentaires de la peau<br>\r\n<b>- Extrait de feuille de busserole:</b> atténue les imperfections de la peau ou du teint<br>\r\n<br>\r\n<b> AUTRES INGRÉDIENTS</b> <br>\r\n<br>\r\nAqua, Aluminim chlorophydrate, Steareth-21, Steareth-2PPG-15,Stearyl ether, Cyclopentasiloxane, Fragrance, Magnesium aluminium silicate, Glycine soja (soybean) ,seed extract/ Butylene glycol, PEG-4/ Lactic acid/ Kojic acid/ Morus alba root extract / Arcto staphylos uva-ursi leaf extract/ Glycyrrhiza glabra root extract, Hydrogenated lecithin/ Sodium oleate / Glycine soja (soybean) oil/ Glycerin/ Disodium EDTA / Oligopeptide-3, Caprylyl methicone, Propanediol dicaprylate, Pentaerythrityl tetra-di-t-butyl/ hydroxyhydricinnamate, Tetrasodium EDTA, Benzethonium chloride, Phenoxyethanol/ lodopropynyl/ butylcarbamate<br>\r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   ', '                                                                                                                                                                                                                                                                                                                                           <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Frotter les aisselles avec un gant de toilette savonné <br>\r\n<b>Etape 2:</b> Rincer et tapoter avec une serviette <br>\r\n<b>Etape 3:</b> Appliquer le déodorant VIVITE <br>\r\n<b>Etape 4:</b> Attendre 1 ou 2 minutes avant d’enfiler un vêtement <br>\r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                ', '', '                                                                                                                                                                                                                                                                                                                                                                                              <b>PRESENTATION</b><br>\r\n<br> \r\nFaly miarahaba anao izahay ato amin’ny One To One Marketing,<br>\r\nTonga indray ny déodorant VIVITE, vita avy amin’ny zava-maniry maro karazany ka miaro sy manatsara ny hoditrao.<br>\r\nAraky ny efa nahafantarantsika azy hatramin’izay, ny deodorant VIVITE dia sady mitroka ny hatsembohana izay mety hanelingelina anao mandritry ny andro no tsara fofona ka manome fraicheur tsy manan-tsahala ho anao.. Tsy mamela trace amin’ny akanjo izy sady maharitra 48 sssora ny fiasany.<br>\r\n………. Ar monja ny vidiny. Sady maharitra 48h be izao ny déodorant VIVITE. Ka iza ary no hatao ho an’i Mme / Mr ? <br>\r\nProposition hafa.<br>\r\nNB: Karazany 4 no eto ampelatanantsika ka anjaranao no misafidy izao metimety aminao:<br>\r\n- Ny essential less shave mampihena ny fanirin’ny volon-kelika.<br>\r\n- Manarak’izany ny crystal white, izay manazava ny oditra sy manampy amin’ny fanasitranana ny oditra simban’ny fiaratana ary mampalama azy.<br>\r\n-Ny snail white manazava  sy mampalefaka ary mitondra vitamines ho an’ny oditra. Miady ihany koa izy amin’ny bactéries.<br>\r\n- Ny clear & confident izay mitazona ny hatsarana sy ny élasticité an’ny hoditra.<br>  \r\n                                                                                                                                                                                                                                                                                                      ', '25 ml', '                                                                                                                                                                                                                                                                                                       <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nVIVITE ESSENTIAL LESS SHAVE est un déodorant conçu spécialement pour les peaux sensibles (sans d’alcool). Il: <br>\r\n- Octroie de la fraîcheur tout au long de la journée au doux parfum de camomille<br>\r\n- Offre une protection efficace contre les mauvaises odeurs <br>\r\n- Adoucit, hydrate et éclaircit la peau<br>\r\n- Ralentit la repousse des poils et les affines<br>\r\n- Évite les taches blanches sur les vêtements de couleur et les taches jaunes sur les vêtements blancs<br>\r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                ', 1, 12, 'DEODORANT', 'VIVITE ', 'NEO CORPORATION', 'https://www.facebook.com/102951564698639/videos/554511991839949/', 'ESSENTIAL LESS SHAVE', '2013-01-01', '2021-12-31', ''),
('FUM002', 'VIVITE DEODORANT CRYSTAL WHITE DEO ROLL ON (VVR  CW) BLUE ', '                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>- Extrait de graines de glycine soja :</b> participe à la régénération cutanée en protégeant la peau du dessèchement et en la nourrissant en profondeur<br>\r\n<b>- Lécithine marine (issue des œufs de poisson) :</b> anti-inflammatoire et adoucit la peau<br>\r\n<b>- Allantoïne (grande source de Vitamine E) :</b> apaisante et anti-irritante, régénérante, hydratante etadoucissante<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua, Aluminim chlorophydrate, Steareth-21, Steareth-2 PPG-15, Stearyl éther, Cyclopentasiloxane, Fragrance, Magnésium aluminium silicate, Glycine soja (soybean), seed extract/ Butylene glycol, PEG-4/ Lactic acid/ Kojic acid/ Morus alba root extract / Arcto staphylo uva-ursi leaf extract/ Glycyrrhiza glabre root extract, Hydrogenated lecithin/ sodium oleate / glycine soja (soybean) oil/ Glycerin/ Disodium EDTA / Oligopeptide-3, Caprylyl methicone, Propanediol dicaprylate, Pentaerythrityl tetra-di-butyl/ hydroxyhydricinnamate, Tetrasodium EDTA, Benzethonium chloride, Phenoxyethanol/ lodopropynyl/ butylcarbamate<br>\r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                ', '                                                                                                                                                                                                                                                                                                                                                                                                <b>MODE D\'UTILISATION</b><br>        \r\n<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    - Frotter les aisselles avec un gant de toilette savonné<br>\r\n- Rincer et tapoter avec une serviette<br>\r\n- Appliquer le déodorant VIVITE<br>\r\n- Attendre 1 ou 2 minutes avant d’enfiler un vêtement</p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    ', '', '                                                                                                                                                <b>PRESENTATION</b><br>           \r\n<br>                                                                                                                                                                                                                                                                                     Faly miarahaba anao izahay ato amin’ny One To One Marketing, <br>\r\nTonga indray ny déodorant VIVITE, vita avy amin’ny zava-maniry maro karazany ka miaro sy manatsara ny hoditrao.<br>\r\nAraky ny efa nahafantarantsika azy hatramin’izay, ny deodorant VIVITE dia sady mitroka ny hatsembohana izay mety hanelingelina anao mandritry ny andro no tsara fofona ka manome fraicheur tsy manan-tsahala ho anao.. Tsy mamela trace amin’ny akanjo izy sady maharitra 48ora ny fiasany. <br>\r\n………. Ar monja ny vidiny. Sady maharitra 48h be izao ny déodorant VIVITE. Ka iza ary no hatao ho an’i Mme / Mr ? <br>\r\nProposition hafa <br>\r\nNB: Karazany 4 no eto ampelatanantsika ka anjaranao no misafidy izao metimety aminao:<br>\r\n- Ny essential less shave mampihena ny fanirin’ny volon-kelika.<br>\r\n- Manarak’izany ny crystal white, izay manazava ny oditra sy manampy amin’ny fanasitranana ny oditra simban’ny fiaratana ary mampalama azy.<br>\r\n- Ny snail white manazava  sy mampalefaka ary mitondra vitamines ho an’ny oditra. Miady ihany koa izy amin’ny bactéries.<br>\r\n- Ny clear & confident izay mitazona ny hatsarana sy ny élasticité an’ny hoditra.<br>                                                                                                                                                                                                                                                                                                                                                                                                            ', '25 ml', '                                                                                                                                                                                                <b>CARACTERISTIQUES</b><br> \r\n<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              VIVITE CRYSTAL WHITE est un déodorant conçu spécialement pour les peaux sensibles, il ne contient pas d’alcool<br>\r\n- Octroie de la fraicheur tout au long de la journée<br>\r\n- Offre une protection efficace longue durée contre les mauvaises odeurs <br>\r\n- Adoucit, hydrate et éclaircit la peau<br>\r\n- Régénère la peau abîmée par l’agression du rasoir<br>\r\n- Évite les taches blanches sur les vêtements de couleur et les taches jaunes sur les vêtements blancs<br>\r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                       ', 1, 12, 'DEODORANT ', 'VIVITE', 'NEO CORPORATION', 'https://www.facebook.com/102951564698639/videos/554511991839949/', 'CRYSTAL WHITE', '2013-01-01', '2021-12-31', ''),
('FUM003', 'VIVITE DEODORANT CLEAR & CONFIDENT ROLL ON (VVR CC) RED ', '                                                                                                                                                <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extrait de mûres:</b> anti-cancérigène, ralentit le vieillissement précoce et protège la peau des agressions externes (rasage, utilisation de la cire)<br>\r\n<b>Extrait deprunes:</b> hydrate les peaux très sèches<br>\r\n<b>Extrait de myrtilles:</b> anti-oxydant et anti-cancérigène<br>\r\n<b>Tocophérol:</b> aide à stimuler la production de collagène, protéine responsable de l\'élasticité de l\'épiderme<br>\r\n<br>\r\n<b>AUTRES INGREDIENTS</b><br>\r\n<br>\r\nAqua, Aluminim chlorophydrate, Alcohol denat, C12-15 pareth-12, Fragrance, Polyquaternium-6, Propylene glycose, Hydroxyethylcellulose, Hydroxypropylmethylose, Niacinamide , Vaccinium myrtillus fruit ext  / Fragaria vesca fruit ext/ Prunus cerasus fruit ext/Rubus fruitcosus fruit ext/ Rubus idaeus fruit ext, Disodium EDTA, Benzophenone-3, Benzyl alcohol/ Ethylhexylglycerin/ Tocopherol<br>\r\n\r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                ', '                                                                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Frotter les aisselles avec un gant de toilette savonné<br>\r\n<b>Etape 2:</b> Rincer et tapoter avec une serviette<br>\r\n<b>Etape 3:</b> Appliquer le déodorant VIVITE<br>\r\n<b>Etape 4:</b> Attendre 1 ou 2 minutes avant d’enfiler un vêtement<br>\r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                          ', '', '                                                                                                                                                <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao izahay ato amin’ny One To One Marketing,<br>\r\nTonga indray ny déodorant VIVITE, vita avy amin’ny zava-maniry maro karazany ka miaro sy manatsara ny hoditrao.<br>\r\nAraky ny efa nahafantarantsika azy hatramin’izay, ny deodorant VIVITE dia sady mitroka ny hatsembohana izay mety hanelingelina anao mandritry ny andro no tsara fofona ka manome fraicheur tsy manan-tsahala ho anao..Tsy mamela trace amin’ny akanjo izy sady maharitra 48 ora ny fiasany.<br>\r\n………. Ar monja ny vidiny. Sady maharitra 48h be izao ny déodorant VIVITE. Ka iza ary no hatao ho an’i Mme / Mr ?<br>\r\nNB: Karazany 4 no eto ampelatanantsika ka anjaranao no misafidy izao metimety aminao:<br>\r\n- Ny essential less shave mampihena ny fanirin’ny volon-kelika.<br>\r\n- Manarak’izany ny crystal white, izay manazava ny oditra sy manampy amin’ny fanasitranana ny oditra simban’ny fiaratana ary mampalama azy.<br>                                                                                                                                                                                       ', '25 ml', '                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nVIVITE CLEAR & CONFIDENT est un déodorant conçu spécialement pour les peaux sensibles. Il : <br>\r\n- Octroie de la fraîcheur tout au long de la journée<br>\r\n- Offre une protection efficace contre les mauvaises odeurs<br>\r\n- Adoucit, hydrate et éclaircit  la peau<br>\r\n- Garde l’élasticité de la peau pour la rendre lisse, douce et jeune<br>\r\n- Évite les taches blanches sur les vêtements de couleur et les taches jaunes sur les vêtements blancs<br>                                                                                                                                                                                                                                                                                                                                                                                                                                               ', 1, 12, 'DEODORANT ', 'VIVITE ', 'NEO CORPORATION', 'https://www.facebook.com/102951564698639/videos/554511991839949/', 'CLEAR & CONFIDENT', '2020-07-27', '2020-12-31', ''),
('FUM004', 'TROS EAU DE COLOGNE BLACK SERIES BLUE ', '  <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br> \r\n<b>Huile De Ricin hydrogénée:</b> protège la peau contre l’irritation ou l’allergie<br>\r\n<b>Menthol:</b> donne un effet rafraîchissant durable<br>\r\n                                      ', '<b>MODE D’UTILISATION</b><br>\r\n<br> \r\n<b>Etape 1:</b> Appliquer après la douche pour une plus longue tenue<br> \r\n<b>Etape 2:</b> Vaporiser légèrement sur une ou deux des zones que vous préférez: poignets, cou, plis des coudes, ou derrière les oreilles<br> \r\n<b>Etape 3:</b> Vaporiser à une dizaine de centimètres de votre corps<br> \r\n<b>Etape 4:</b> Ne pas utiliser sur une peau irritée ou crevassée<br> \r\n<b>Etape 5:</b> Usage externe uniquement<br>\r\n                                                                         ', '', '            <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao. Toky commercial avy ao amin’ny One to One Marketing.<br>\r\nAmin’izao fotoana izao ny agence one to one dia mampafantatra indray ny “eau de cologne TROS”.<br>\r\nNy« eau de cologneTros » dia parfum fanositra amin’ny vatana rehefa avy manao douche .Sady manome fraîcheur izy no mitondra hanitra malefaka ihany koa ary tena mitazona ela ny hanitra entiny. Afaka mampiasa azy avokoa na ny vehivavy na ny lehilahy.<br>\r\nNy orinasa BIO Consumer no namokatra azy. Mety amin’ny karazan-koditra rehetra izy satria efa nandalo test clinic. Misy azonao isafidianana ny Parfum satria misy no somary malefaka kokoa ary misy ny somary manimanitra kokoa.<br>\r\nIza no metimety amin’i Madama? Andramo anie dia ho hitanao fa hafinaritra ery ny tontolo andronao e! Na ianao izay manao azy na ny olona izay manodidina anao dia samy hahazo fahafinaretana avokoa noho ny fraîcheur izay entin’ny eau de cologne Tros.<br>\r\n……Ar monja ny vidiny nefa 50 ml be izao no fantrany.<br>\r\n                               ', '50 ml', '  <b>CARACTERISTIQUES</b><br>\r\n<br>\r\nTros Black Series Cologne est une eau 