('FUM008', 'TROS DEODORANT COOL SPORT ROLL ON ORANGE ', '                                                                                                                                                                                                                                                                                                                                                                                                  <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>- Usnea barbarta (Litchen) ext / Extrait de barbe de jupiter / Extrait de Lichen: </b>\r\n anti-microbien, réduit ou masque les odeurs corporelles désagréables, traite les imperfections de la peau<br>\r\n<b>- Equisehum arvens ext/ Extrait de Prêle:</b> protège la peau contre les démangeaisons ,les eczémas et  les ulcères variqueux<br>\r\n<b>- Salvia officinalis (sage) oil / Extrait de Sauge:</b> diminue de la transpiration et protège contre les bactéries, les champignons, idéal pour les soins de l\'acné, et la peau grasse<br> \r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br> \r\n<br> \r\nAqua, Alcohol denat, Aluminium chlorohydraten C12-15 pareth-12 , Fragrance, Propylene glycol, Hydroxyethylcellulose, Propanediol / Usnea barbarta (Litchen) ext / Trometamine / Tetrasodium glutamate diacetate / Sodium hydroxide, Equisehum arvens ext /  Salvia officinalis (sage) oil , Menthyl succinate, Triclosan, Benzophenone-3, Phénoxyethanol / Methylisothiazolinone , CI 60730 , CI 61570<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     ', '                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Frotter les aisselles avec un gant de toilette savonné<br>\r\n<b>Etape 2:</b> Rincer et tapoter avec une serviette<br>\r\n<b>Etape 3:</b> Appliquer le déodorant<br>\r\n<b>Etape 4:</b> Attendre 1 ou 2 minutes avant d’enfiler un vêtement<br>                                                                                                                                                                                                                                                   				                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                            ', '				            				', '                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                <b>PRESENTATION</b><br>\r\n<br>\r\n Faly miarahaba  anao, Aina commercial avy ao amin’ny One To One Marketing. Déodorant TROS 3D indray no vokatra vaovao entiko ho anao androany.<br> Vokatra novokarin’ny orinana BIO CONSOMER ny déodorant TROS 3D, mampihena ny hatsembohana ary mamona ireo bactéria izay mahatonga ireo fofona mety hanelingelina amin’ny vatan-tsika ireny.Ankoatra izay, misy hanitra malefaka, marfum an-dehilahy, 48 ora be izao ny faharetany. Vetivety monja ny déodorant TROS 3D dia maina raha vantany vao hahositra amin’ny helika ka tsy mamela faritra amin’ny akanjo.<br>.……… Ar monja ny vidin’ny flacon 25 ml an’ny déodorant TROS.<br>\r\n                                                                                                                                                                                                                              \r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                            ', '25 ml', '<b>CARACTERISTIQUES</b><br>\r\n<br>\r\nLe déodorant TROS ROLL ON COOL SPORT élimine les bactéries sur la peau pendant les exercices physiques et soigne la peau délicate de vos aisselles en lui permettant d’avoir une sensation de fraîcheur toute la journée. TROS COOL SPORT réduit les taches brunes et offre en plus, une bonne hydratation à la peau des aisselles<br>\r\nIl a été conçu pour assurer une formule : <br>\r\nSa formule Protect System régénère la peau abîmée par le rasage et maintient l’élasticité de la peau<br>\r\nEt sa formule Sport Perfume protége contre la transpiration et les mauvaises odeurs en diminuant l’acidité sécrétée sous les pores après une bonne séance physique<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     ', 1, 12, 'DEODORANT', 'TROS', 'NEO CORPORATION', '', 'TROS COOL SPORT', '2013-01-01', '2021-12-31', ''),
('FUM009', 'TROS DEODORANT CLEAR & COOL ROLL ON BLUE ', '                                                                                                                                                                                                                                                <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Usnea barbarta (Litchen) ext / Extrait de barbe de jupiter / Extrait de Lichen:</b> anti-microbien, réduit ou masque les odeurs corporelles désagréables, traite les imperfections de la peau<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua, Alcohol denat, Aluminium chiorohydrate, C12-15 Pareth-12, Butylene glycol, Fragrance, Hydroxyethylcellulose, triclosan, Menthylsuccinate, Methylchloroisothizolinone/ Methylisothizolinone, Benzophenone-3, CI 42090, CI 17200<br>\r\n                                                                                                                                             \r\n                                                                                                                                                                                                                                                                                                                                                                                                                               ', '                                                                                                                                                                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Frotter les aisselles avec un gant de toilette savonné<br>\r\n<b>Etape 2:</b> Rincer et tapoter avec une serviette<br>\r\n<b>Etape 3:</b> Appliquer le déodorant<br>\r\n<b>Etape 4:</b> Attendre 1 ou 2 minutes avant d’enfiler un vêtement<br>\r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                ', '				        	<p>Inon', '                                                                                                                                                                                                                                                <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba  anao, Aina commercial avy ao amin ny One To One Marketing<br>\r\nDeodorant TROS 3D indray no vokatra vaovao entiko ho anao androany. Vokatra novokarin ny orinana BIO CONSOMER ny deodorant TROS 3D, mampihena ny hatsembohana ary mamona ireo bacteria izay mahatonga ireo fofona mety hanelingelina amin  ny vatan-tsika ireny.<br>\r\nAnkoatra izay, misy hanitra malefaka, marfum an-dehilahy, 48 ora be izao ny faharetany.<br>\r\nVetivety monja ny déodorant TROS 3D dia maina raha vantany vao hahositra amin\'ny helika ka tsy mamela faritra amin\'ny akanjo.<br>\r\n…….. Ar monja ny vidin ny flacon 25 ml amin\'ny déodorant TROS.<br>\r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             ', '25 ml', '                                                                                                                                                 <b>CARACTERISTIQUES</b><br>\r\n<br>\r\nLe déodorant CLEAR ULTRA COOL & DRY est composée par une formule spéciale Clear & Cool développée pour ne laisser aucune tache<br>\r\n- Le Complexe Ultra Cool octroie une protection de longue durée contre les mauvaises odeurs<br> \r\n- Le Système Dry Advance permet un séchage rapide pour ne laisser aucune tache et contient la transpiration excessive<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                         ', 1, 12, 'DEODORANT', 'TROS', 'NEO CORPORATION', '', 'TROS  CLEAR & COOL', '2013-01-01', '2021-12-31', ''),
('FUM01', 'VIVITE DEODORANT SPEED UP ', 'Aqua,Aluminim chlorophydrate, Steareth-21, Steareth-2PPG-15,Stearyl ether ,Cyclopentasiloxane, Fragrance, Magnesium aluminium silicate, Glycine soja (soybean) ,seed extract/ Butylene glycol, PEG-4/ Lactic acid/ Kojic acid/ Morus alba root extract / Arcto staphylos uva-ursi leaf extract/ Glycyrrhiza glabra root extract, Hydrogenated lecithin/ Sodium oleate / Glycine soja (soybean) oil/ Glycerin/ Disodium EDTA / Oligopeptide-3, Caprylyl methicone, Propanediol dicaprylate, Pentaerythrityl tetra-di-t-butyl/ hydroxyhydricinnamate, Tetrasodium EDTA, Benzethonium chloride, Phenoxyethanol/ lodopropynyl/ butylcarbamate.<br>                                 ', '-Frotter les aisselles avec un gant de toilette savonné;<br>\r\n-Rincer et tapoter avec une serviette;<br>\r\n-Appliquer le déodorant VIVITE;<br>\r\n-Attendre 1 ou 2 minutes avant d’enfiler un vêtement.<br>\r\n                                                                                   ', '0', '                                                                                             Faly miarahaba anao izahay ato amin’ny One To One Marketing, <br>\r\nTonga indray ny déodorant VIVITE, vita avy amin’ny zava-maniry maro karazany ka miaro sy manatsara ny hoditrao.<br>\r\nAraky ny efa nahafantarantsika azy hatramin’izay, ny deodorant VIVITE dia sady mitroka ny hatsembohana izay mety hanelingelina anao mandritry ny andro no tsara fofona ka manome fraicheur tsy manan-tsahala ho anao.. Tsy mamela trace amin’ny akanjo izy sady maharitra 48ora ny fiasany.<br>\r\nNB: Karazany maro no eto ampelatanantsika ka anjaranao no misafidy izao metimety aminao:<br>\r\n-	Ny essential less shave mampihena ny fanirin’ny volon-kelika.<br>\r\n-	Manarak’izany ny crystal white, izay manazava ny oditra sy manampy amin’ny fanasitranana ny oditra simban’ny fiaratana ary mampalama azy.<br>\r\n-	Ny snail white manazava  sy mampalefaka ary mitondra vitamines ho an’ny oditra. Miady ihany koa izy amin’ny bactéries.<br>\r\n-	Ny clear & confident izay mitazona ny hatsarana sy ny élasticité an’ny hoditra.<br>     \r\n-	Ny speed up: mitazona ny hatsembohana sy ny fofon-kelika.<br>  \r\n ………. Ar monja ny vidiny. Sady maharitra 48h be izao ny déodorant VIVITE. Ka iza ary no hatao ho an’i Mme / Mr ? <br>\r\n ', '25 ml', '  VIVITE SPEED UP est un déodorant conçu spécialement pour les peaux sensibles (sans d’alcool).<br>\r\n Il :<br>\r\n-	Octroie de la fraicheur tout au long de la journée au doux parfum de camomille.<br>\r\n-	Offre une protection efficace contre les mauvaises odeurs.<br> \r\n-	Adoucit, hydrate et éclaircit la peau.<br>\r\n-	Ralenti la repousse des poils et les affines.<br>\r\n-	Evite les taches blanches sur les vêtements de couleur et les taches jaunes sur les vêtements blancs.<br>\r\n                                                                                                   ', 1, 12, 'DEODORANT ROLL ON ', 'VIVITE ', 'NEO CORPORATION', '', 'SPEED UP', '2013-01-01', '2021-12-31', '');
