('FUM010', 'TROS DEODORANT FRESH ROLL ON BLUE  ', '                                                    <b>INGREDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Eau de Mer :</b> améliore l\'hydratation de la peau, favorise la cicatrisation, lutte contre la bactérie responsable de l\'acné<br> \r\n<b>Usnea barbarta (Litchen) ext / Extrait de barbe de jupiter / Extrait de Lichen:</b> anti-microbien, réduit ou masque les odeurs corporelles désagréables et traite les imperfections de la peau<br>\r\n<br>\r\n<b>AUTRES INGREDIENTS</b><br>\r\n<br> \r\nAqua, Alcohol denat, Aluminium chlorohydraten C12-15 pareth-12 , Fragrance, Propylene glycol, Hydroxyethylcellulose, Propanediol/ Usnea barbata (Litchen) ext / Trometamine / Tetrasodium glutamate diacetate / Sodium hydroxide, Menthyl succinate, Triclosan, Benzophenone-3, Phénoxyethanol / Methylisothiazolinone , CI 42090 , CI 17200<br>\r\n                                                                                                                                                                                                                                                                                                                                                              ', '                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Frotter les aisselles avec un gant de toilette savonné<br>\r\n<b>Etape 2:</b> Rincer et tapoter avec une serviette<br>\r\n<b>Etape 3:</b> Appliquer le déodorant<br>\r\n<b>Etape 4:</b> Attendre 1 ou 2 minutes avant d’enfiler un vêtement<br>\r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                       ', '				            				', '                                                                                                <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba  anao, Aina commercial avy ao amin’ny One To One Marketing. Déodorant TROS 3D indray no vokatra vaovao entiko ho anao androany. <br> \r\nVokatra novokarin’ny orinana BIO CONSOMER ny déodorant TROS 3D, mampihena ny hatsembohana ary mamona ireo bactéria izay mahatonga ireo fofona mety hanelingelina amin’ny vatan-tsika ireny. \r\nAnkoatra izay, misy hanitra malefaka, marfum an-dehilahy, 48 ora be izao ny faharetany. \r\nVetivety monja ny déodorant TROS 3D dia maina raha vantany vao hahositra amin’ny helika ka tsy mamela faritra amin’ny akanjo. <br> \r\n……… Ar monja ny vidin’ny flacon 25 ml an’ny déodorant TROS.<br>\r\n                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               ', '25 ml', '                                                           TROS FRESH & PROTECT est un déodorant qui aide à faire revivre les aisselles en lui apportant l\'hydratation dont ils ont besoin. Il élimine les taches sombres et rend la peau plus lisse et plus claire. Le déodorant TROS FRESH & PROTECT permet d\'avoir une sensation de fraîcheur toute la journée<br>\r\nSa formule Power Fresh permet de  rester frais tout au long de la journée sans se soucier des mauvaises odeurs ni de la transpiration<br>\r\nEt sa formule Protect System protège la peau à chaque application grâce à sa formule protectrice à l’eau de mer et à l’extrait de Lichen<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 ', 1, 12, 'DEODORANT', 'TROS', 'NEO CORPORATION', '', 'TROS FRESH & PROTECT', '2013-01-01', '2021-12-31', ''),
