('FUM012', 'TROS DEODORANT WHITE & PROTECT ROLL ON ', 'INGREDIENTS:<br>\r\n- Niaciamide (vitamine B3): fait disparaître les signes du vieillissement, tels que les ridules et les rides , ainsi apaise la peau sensible et réduit les rougeurs et les taches<br>\r\n- Usnea Barbata (Lichen) (même famille que les algues vertes ): d’origine Vegétale, c’est un agent déodorant et aussi un agent antimicrobien\r\n                                ', '    - Bien agiter avant emploi <br>\r\n- Rouler sur la peau axillaire 4 à 6 fois<br>\r\n- Laisser le produit sécher complètement                                                                        ', '', 'Faly miarahaba  anao, Aina commercial avy ao amin’ny One To One Marketing. \r\nDéodorant TROS 3D indray no vokatra vaovao entiko ho anao androany. Vokatra novokarin’ny orinana BIO CONSOMER ny déodorant TROS 3D, mampihena ny hatsembohana ary mamona ireo bactéria izay mahatonga ireo fofona mety hanelingelina amin’ny vatan-tsika ireny. \r\nAnkoatra izay, misy hanitra malefaka, marfum an-dehilahy, 48 ora be izao ny faharetany. \r\nVetivety monja ny déodorant TROS 3D dia maina raha vantany vao hahositra amin’ny helika ka tsy mamela faritra amin’ny akanjo. \r\n…….. Ar monja ny vidin’ny flacon 25 ml an’ny déodorant TROS.\r\n                                                                            ', '25 ml', 'Déodorant TROS ROLL ON WHITENING PROTECT soigne la peau délicate de vos aisselles en lui  permettant d’avoir qui  une sensation de fraîcheur toute la journée. TROS WHITENING PROTECT réduit les taches sombre  et éclaircit la peau des aisselles .            ', 1, 12, 'DEODORANT ROLL ON ', 'TROS', 'Non mentionné', '', 'TROS ROLL ON WHITENI', '2013-01-01', '2021-12-31', ''),
