irin’ny volon-kelika.<br>\r\n- Manarak’izany ny crystal white, izay manazava ny oditra sy manampy amin’ny fanasitranana ny oditra simban’ny fiaratana ary mampalama azy.<br>\r\n- Ny snail white manazava  sy mampalefaka ary mitondra vitamines ho an’ny oditra. Miady ihany koa izy amin’ny bactéries.<br>\r\n- Ny clear & confident izay mitazona ny hatsarana sy ny élasticité an’ny hoditra.<br>\r\n- Ny speed up: mitazona ny hatsembohana sy ny fofon-kelika.<br>                                                                                        ', '25 ml', '  <b>CARACTÉRISTIQUE</b><br>\r\n<br>\r\nVIVITE SPEED UP est un déodorant conçu spécialement pour les peaux sensibles (sans d’alcool). Il:<br>\r\n- Octroie de la fraîcheur tout au long de la journée au doux parfum de camomille<br>\r\n- Offre une protection efficace contre les mauvaises odeurs<br> \r\n- Adoucit, hydrate et éclaircit la peau<br>\r\n- Ralentit la repousse des poils et les affinés<br>\r\n- Évite les taches blanches sur les vêtements de couleur et les taches jaunes sur les vêtements blancs<br>                                                                                          ', 1, 12, 'DEODORANT ROLL ON ', 'VIVITE ', 'NEO CORPORATION', '', 'SPEED UP', '2013-01-01', '2021-12-31', ''),
