('FUM020', 'VIVITE DEODORANT CLEAR & CONFIDENT ROLL ON (VVR CC) RED ', 'INGREDIENTS:<br>\r\n- Extrait de mûres : anti-cancérigène  et ralentie le vieillissement précoce et protège la peau des agressions externes (rasage, utilisation de la cire)<br>\r\n- Extrait de prunes: hydrate les peaux très sèches<br>\r\n- Extrait de myrtilles: anti-oxydant et anti-cancérigène<br>\r\n- Tocophérol : aide à stimuler la production de collagène, protéine responsable de l\'élasticité de l\'épiderme.<br>\r\nAUTRES INGREDIENTS:<br>\r\nAqua,Aluminim chlorophydrate, Alcohol denat, C12-15 pareth-12 ; Fragrance, Polyquaternium-6, Propylene glycose, Hydroxyethylcellulose, Hydroxypropylmethylose, Niacinamide , Vaccinium myrtillus fruit ext  / Fragaria vesca fruit ext/ Prunus cerasus fruit ext/Rubus fruitcosus fruit ext/ Rubus idaeus fruit ext, Disodium EDTA, Benzophenone-3, Benzyl alcohol/ Ethylhexylglycerin/ Tocopherol                                                                                         ', '    - Frotter les aisselles avec un gant de toilette savonné;<br>\r\n- Rincer et tapoter avec une serviette;<br>\r\n- Appliquer le déodorant VIVITE;<br>\r\n- Attendre 1 ou 2 minutes avant d’enfiler un vêtement.                                                                                             ', '', '                                                Faly miarahaba anao izahay ato amin’ny One To One Marketing, \r\nTonga indray ny déodorant VIVITE, ilay 100% BIO, ilay vita zato isan-jato avy amin’ny zava-maniry.\r\nAraky ny efa nahafantarantsika azy hatramin’izay, ny deodorant VIVITE dia sady mitroka ny hatsembohana izay mety hanelingelina anao mandritry ny andro no tsara fofona ka manome fraicheur tsy manan-tsahala ho anao.. Tsy mamela trace amin’ny akanjo izy sady maharitra 48ora ny fiasany.\r\n Ar monja ny vidiny. Sady maharitra 48h be izao ny déodorant VIVITE. Ka iza ary no hatao ho an’i Mme / Mr ?                                                                             ', '40 ml', 'VIVITE est un déodorant conçu spécialement pour les peaux sensibles, il ne contient pas d’alcool<br>\r\n- Octroie de la fraicheur tout au long de la journée<br>\r\n- Offre une protection efficace longue durée contre les mauvaises odeurs <br>\r\n- Adouci, hydrate et éclaircit la peau <br>\r\n- Garde l’élasticité de la peau pour la rendre lisse, douce et jeune<br>\r\n- Évite les taches blanches sur les vêtements de couleur et les taches jaunes sur les vêtements blancs<br>                                                                                   ', 1, 12, 'DEODORANT ', 'VIVITE', 'NEO CORPORATION', '', 'CLEAR & CONFIDENT', '2013-01-01', '2021-12-31', ''),
