('LES001', 'FINELINE FABRIC SOFTNER CONCENTRATED (FLE EL). PINK ', '                                                           <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extrait de fleur:</b> octroie un parfum doux et onctueux aux linges<br>\r\n                                                                                                                             ', '                                                         <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Pour les lavages à la machine versez votre adoucissant dans le compartiment qui lui est réservé<br>\r\nNB: Il s\'agit en général d\'un petit compartiment signalé par une fleur<br>\r\n<b>Etape 2:</b> Si vous lavez votre linge à la main, diluez l\'adoucissant dans la dernière eau de rinçage<br>\r\n                                                                                                                               ', '', '                                                  <b>PRÉSENTATION</b><br> \r\n<br>\r\nFaly miarahabaanao, Toky, commercial avy ao amin’ny one to one marketing. Amin’izao fotoana izao ny agence one to one dia mampafantatra ny  « adoucissant fineline »<br>\r\nNy adoucissant fineline dia vokatra iray mitazona ny lokon’ny lamba ary manome hanitra vaovao sy madio azy. Izany hoe akanjo vaovao foana no anaovanao isan’andro. Sady manalefaka ny lamba izy izany no mitazona ela ny hanitra malefaka ho entiny<br>\r\n........... Ar  monja ny vidiny ary mahavita lamba 20 ka hatramin’ny 30 isa ny iray fonosana<br>                                                                                                                                      ', '20 ml', '                                                      <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nFineline est un adoucissant et assouplissement pour linge<br> \r\nIl octroie au tissu un arôme naturel de fleurs parfumé et durable, le rend 3 fois plus doux et tendre pour un repassage facile et rapide<br>\r\nMais encore l’adoucissant Fineline aide à garder la couleur du tissu tout en lui donnant un effet lumineux<br>\r\nInspiré par l’arôme chaud et naturel des fleurs parfumées et épanouies<br>\r\nCe parfum chaleureux octroie bonne humeur et réveille vos sens<br>\r\n                                                                                                                                  ', 1, 17, 'ADOUCISSANT ', 'FINELINE', 'Non mentionné', '', 'NATURAL COLLECTION R', '2013-01-01', '2021-12-31', ''),
