('LES006', 'PAO POWDER DETERGENT PAO NANO WHITE ', '<b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\nAnionic Surfactant, Zeolite, Sodium Cabonate, Sodium Carboxymethlcellulose, Optical Brightener, etc<br>                                                                                                                                                                                                                                                                                                             ', '<b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Verser le détergent en poudre PAO dans l’eau<br>\r\n<b>Etape 2:</b> Y immerger le linge et laisser 30 minutes<br>\r\n<b>Etape 3:</b> Frotter le linge<br>\r\n<b>Etape 4:</b> Puis rincer<br>\r\n<b>Etape 5:</b> Mettre adoucissant au dernier rinçage<br>\r\n NB: 2.5 à 3 poignes pour ½ cuvette d’eau<br>\r\n                                                                                                                                                              ', '			<p>ARGUMENTAIRES<', '   <b>PRÉSENTATION</b><br>\r\n<br>\r\nMiarahaba anao ny avy aty amin’ny One To One Marketing.<br> \r\nTena olana ho antsika  amin’izao fotoana izao ny mitazona ny akanjotsika mba hivoaka toy ny vaovao rehefa avy sasana. Ity misy vovon-tsavony vaovao matsara ny lambanao , mampalefaka azy, manala ny loto sy ny tâche rehetra izay sarotra esorina ary indrindra indrindra mitazona ny lamba fotsy ho fotsy mangatsakatsaka lalandava. Ny vovon-tsavony PAO WHITE izany.<br> \r\nRehefa mampiasa ny vovon-tsavony PAO WHITE ianao dia tsy mila dilirina mafy be ny lamba vao afaka ny loto fa alona kely vetivety eo ilay lamba dia anjara asan’ny vovon-tsavony PAO WHITE no manala ny loto sy ny tache rehetra izay mipetaka amin’ny lamba. Manampy tanana kely sisa no ataonao mba hiendaka tsara teo amin’ny lamba ilay loto.<br>\r\nTsy hatahoranao hanimba ny lambanao mihintsy ny vovon-tsavony PAO WHITE satria raha mihoatra amin’ny vovon-tsavony sasany dia kelikely ny roatra avoakany. Tombony be ho an’ny lamba sasanao izany satria iny roatra avoakan’ny savony iny dia sarotra kobanina no sady mampavasoka ny lambanao no sady mampienjana azy.<br> \r\nRaha ny tee-shirt  fotsy ny zanakao zao an!  na ny lobaka fotsy ny vadinao no sasanao amin’ny vovon-tsavony PAO WHITE!!! dia mivoaka fotsy mangatsakatsaka , mangirana , mazava tsara  …. satria dia tena natokana ho an’ny lamba fotsy tokoa ity PAO ity.<br>\r\n120 g no ao anatin’ny  fonosana iray. Izay amin’ny sarany ……. ariary monja. Izany hoe raha mampiasa vovon-tsavony iray tanana isaky ny manasa lamba ianao dia mahavita anao mandritran’ny herinandro manontolo ity sachet iray ity. Eo amin’ny 500 Ar isan’andro eo zany no laninao. Sady ny mahatsara ny PAO WHITE koa dia izy ilay tsy mila  asina savony intsony. Aza misalasala intsony Mme a! mahazo tombony be ianao  raha mividy vovon-tsavony PAO WHITE. Andramo anie  e!!! <br>                                                                                                                                                                                     ', '120 g', '          <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nPAO Nano Tech est un détergent spécialement conçu pour nettoyer les tâches tenaces, tout en protégeant la qualité de vos linges<br>\r\nAvec sa formule innovante de sa particule à échelle nanométrique, le détergent PAO pénètre directement les fibres des tissus en profondeur et enlève les tâches rapidement et efficacement<br>\r\nIl garde le vêtement propre, frais et élimine les mauvaises odeurs sur les vêtements<br>\r\nAvec sa formule standard, elle convient aussi bien à un lavage à la main qu’en machine<br>\r\nIl convient aux vêtements blancs<br>\r\nIl contient des perles blanches et possède des vertus de blanchiment pour augmenter la blancheur de vos linges à chaque lessive<br>                                                                                                                                                                                 ', 1, 34, 'DETERGENT EN POUDRE', 'PAO', 'Non mentionné', '', 'WHITE NANO TECH', '2013-01-01', '2021-12-31', ''),
('LES007', 'PAO POWDER DETERGENT PAO NANO COLOR ', '<b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\nAnionic Surfactant, Zeolite, Sodium Cabonate, Sodium Carboxymethlcellulose, Optical Brightener, etc<br>\r\n                                                                                    ', ' <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Verser le détergent en poudre PAO dans l’eau<br>\r\n<b>Etape 2:</b> Y immerger le linge et laisser 30 minutes<br>\r\n<b>Etape 3:</b> Frotter le linge<br>\r\n<b>Etape 4:</b> Puis rincer<br>\r\n<b>Etape 5:</b> Mettre adoucissant au dernier rinçage<br>\r\n NB : 2.5 à 3 poignes pour ½ cuvette d’eau<br>                                                                                                                                                      ', '				            	\n\n<', ' <b>PRÉSENTATION</b><br>\r\n<br> \r\nMiarahaba anao ny avy aty amin’ny One To One Marketing. <br>  \r\nTena olana ho antsika  amin’izao fotoana izao ny mitazona ny akanjotsika mba hivoaka toy ny vaovao rehefa avy sasana. Ity misy vovon-tsavony vaovao matsara ny lambanao, mampalefaka azy, manala ny loto sy ny tâche rehetra izay sarotra esorina ary indrindra indrindra mitazona ny lamba fotsy ho fotsy mangatsakatsaka lalandava. Ny vovon-tsavony PAO COLOR izany.<br>  \r\nRehafa mampiasa ny vovon-tsavony PAO COLOR ianao dia tsy mila dilirina mafy be ny lamba vao afaka ny loto fa alona kely vetivety eo ilay lamba dia asan’ny vovon-tsavony PAO COLOR no manala ny loto sy ny tache rehetra izay mipetaka amin’ny lamba. Manampy tanana kely sisa no ataonao mba hiendaka tsara teo amin’ny lamba ilay loto. <br> \r\nTsy hatahoranao hanimba ny lambanao mihintsy ny vovon-tsavony PAO COLOR satria raha mihoatra amin’ny vovon-tsavony sasany dia kelikely ny roatra avoakany. Tombony be ho an’ny lamba sasanao izany satria iny roatra avoakan’ny savony iny dia sarotra kobanina no sady mampavasoka ny lambanao no sady mampienjana azy.<br>  \r\nRaha ny tee-shirt miloko ny zanakao zao an!  na ny lobaka miloko ny vadinao no sasanao amin’ny vovon-tsavony PAO COLOR!!! dia mivoaka tsar any lokony, mangirana, mazava tsara  …. satria dia tena natokana ho an’ny lamba miloko tokoa ity PAO ity. <br> \r\n120 g no ao anatin’ny  fonosana iray. Izay amin’ny sarany ……. ariary monja. Izany hoe raha mampiasa vovon-tsavony iray tanana isaky ny manasa lamba ianao dia mahavita anao mandritran’ny herinandro manontolo ity sachet iray ity. Eo amin’ny 500 Ar isan’andro eo zany no laninao. Sady ny mahatsara ny PAO COLOR koa dia izy ilay tsy mila  asina savony intsony. Aza misalasala intsony Mme a! mahazo tombony be ianao  raha mividy vovon-tsavony PAO COLOR. Andramo anie  e!!!<br>                                                                                        ', '120 g', '<b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nPAO Nano Tech est un détergent spécialement conçu pour nettoyer les tâches tenaces, tout en protégeant la qualité de vos linges<br> \r\nAvec sa formule innovante de sa particule à échelle nanométrique, le détergent PAO pénètre directement les fibres des tissus en profondeur et enlève les tâches rapidement et efficacement<br> \r\nIl garde le vêtement propre, frais et élimine les mauvaises odeurs sur les vêtements<br> \r\nAvec sa formule standard, elle convient aussi bien à un lavage à la main qu’en machine<br> \r\nElle a été formulée pour les vêtements colorés<br> \r\nProtège et renouvelle la luminosité des couleurs de vos vêtements peu importe combien de fois vous le lavez<br>                                                                                         ', 1, 34, 'DETERGENT EN POUDRE ', 'PAO', 'Non mentionné', '', 'COLOR NANO TECH', '2013-01-01', '2021-12-31', ''),
('LES008', 'HI-CLASS LIQUID DETERGENT BLACK - ACTIVE BLACK 900.ML', '', '', '', '', '900 ML', '', 1, 2, '', 'HI-CLASS', '', '', 'BLACK - ACTIVE BLACK', '2020-07-30', '0000-00-00', ''),
('LES009', 'HI-CLASS LIQUID DETERGENT WHITE - ACTIVE WHITE', '                                                     <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>	\r\n<b>Extraits d’huiles essentielles aromatiques françaises:</b> qui permet à vos vêtements de durer plus longtemps, adoucit le tissu et retient la couleur<br>\r\nNB: Le parfum s\'attarde sur chaque fibre pour une sensation confortable et confiante tout au long de la journée<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nEther de laurylsulfate de sodium 14,0%, laurylsulfate de sodium 6,0%, arôme (moins de 5%), agent de blanchiment à l\'oxygène, 5-chloro-2-méthyl-4-isothiazoline-3-1, polyacrylate de sodium (moins de 5%), eau purifiée<br>                                                                                                                                   ', '                                                      <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Bien agiter avant l’utilisation<br>\r\n<b>Etape 2:</b> Mélanger  1/2 bouchon (20 ml) avec 4 litres d\'eau<br>\r\n<b>Etape 3:</b> Faire tremper le linge (3 kg de linge) pendant 5 minutes ou plus pour améliorer l’effet<br>\r\n<b>Etape 4:</b> Devrait tremper pendant environ 30 minutes pour des vêtements aromatiques plus longtemps<br>\r\n<b>Etape 5:</b> Laver et rincer soigneusement à l\'eau claire<br>\r\nNB: Ne pas appliquer directement sur les vêtements. En cas de contact avec les yeux, rincer à l\'eau<br>\r\n<b>Etape 6:</b> Consulter un spécialiste si nécessaire<br>\r\n<b>Etape 7:</b> Stocker dans un endroit sec inaccessible aux enfants<br>                                                                                                                                  ', '', '                                                      <b>PRÉSENTATION</b><br>\r\n<br>\r\n<br>Faly miarahaba anao, Tahina comercial avy ao amin’ny One to One marketing.<br>\r\nAmin’izao fotoana izao ny agence One To One dia tonga aty an-tokatranon-tsika, mitondra ny détergent Hi – class Activ White.<br> \r\nRanon-tsavony natao hanala ny loto sy ny tasy rehetra eny amin’ny akanjo izy ity. Indrindra ny akanjo fotsy.<br> \r\nMitondra ny fahaiza-manao avy any Japon ny détergent Hi-class Activ White ka sady mitazona ny lokon’ny lambanao ho toy ny vaovao hatrany no manalefaka azy ihany koa. \r\nMisy extraits d’huiles essentielles aromatiques françaises ihany koa ao anatin’ny détergent Hi-class Activ White ka mitondra hanitra malefaka sy mihaja ho anao mandritran’ny tontolo andronao. \r\nTsotra ny fomba fampiasana azy.<br> \r\n- Ahontsana ny tavoangy misy ny Hi-class detergent alohan’ny hampiasa azy.<br> \r\n- Afangaroy anaty rano 4 litatra ny atsasan’ny sarony na 20 ml<br> \r\n- Arotsaka ao anatin’ilay rano ny akanjo ho sasana (3kg eo ho eo) ary halona 5 mn na mihoatra kely raha tena misy tasy sy maloto be ny lamba. <br> \r\n- Kosehina moramora ny lamba mba hiala ny loto.<br>\r\n- Avy eo  kobanina amin’ny rano ny akanjo ary atapy masoandro.<br> \r\nMisy karazany roa (2) ny détergent Hi-class Activ White: <br>\r\n- Hi-Class Liquide detergent BLANC: izay natokana ho an’ny lamba fotsy ary mitondra hanitra malefaka sy maivana tsara<br>\r\n- Hi-class Liquide detergent VERT: izay natokana ho an’ny lamba fotsy sy lamba manana loko matsantso. Idéaly amin’ny fanasana ny lamba fihentina mianjaika.<br>\r\n......... Ar ny vidin’ny detergent Liquide Hi-class 900 ml be izao. Izany hoe raha in-3 isa-kerinandro ianao no manasa lamba dia maharitra anao 4 bolana ity vokatra ity.<br>                                                                                                                                  ', '900 ml', '                                                           <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nHI-CLASS ACTIVE WHITE est un détergent de premier choix<br>\r\nIl a été créé à l’aide de la dernière technique Japonaise qui lui permet de retirer les tâches les plus tenaces sur les vêtements  de couleur blanche<br>\r\nIl permet au tissu de garder sa couleur d’origine et son aspect neuf tout en lui octroyant un parfum charmant de longue durée<br>                                                                                                                             ', 1, 27, 'DETERGENT LIQUIDE', 'HI-CLASS', 'Non mentionné', '', 'ACTIVE WHITE', '2013-01-01', '2021-12-31', ''),
