('LES02', 'D-NEE LIQUID DETERGENT BABY - PINK ', '       <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extrait de miel:</b> adoucit le linge pour éviter d’irriter la peau de bébé<br>\r\n<br> \r\n<b>AUTRES INGRÉDIENTS</b><br> \r\n<br>\r\nSodium lauryl sulfate, Sodium lauryl ether sulfate<br>\r\n                                                                                                                                                                                                                                                                                                                                                                 ', '  <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Pour le lavage à la main:</b><br>\r\n<b>Etape 1:</b> Mélangez 1/2 tasses (15 ml) du produit avec 2 litres d\'eau (pour 10 vêtements)<br> \r\n<b>Etape 2:</b> Laissez tremper pendant 5 à 10 minutes<br>\r\n<b>Etape 3:</b> Se laver à fond<br>\r\n<br>\r\n<b>Pour le lavage à la machine:</b><br>\r\n<b>Etape 1:</b> Mélangez 2 tasses (60 ml) de produit avec 8 litres d\'eau au lave-linge<br>\r\n<b>Etape 2:</b> Introduisez-le dans le back à détergent<br> \r\n<b>Etape 3:</b> Introduisez un adoucissant dans le back à adoucissant si il y en a<br>\r\n<b>Etape 4:</b> Activez la machine<br>\r\n                                                                                                                                    ', '0', '   <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Tahina comercial avy ao amin’ny One to One marketing.<br>\r\nAmin’izao fotoana izao ny agence One To One dia tonga aty an-tokatranon-tsika, mitondra ny detergent liquid D-NEE. <br> \r\nRanon-tsavony natao hanala ny loto sy ny tasy rehetra eny amin’ny akanjon-jaza vao teraka ka hatramin’ny 3 taona. <br> \r\nMitazona ny lokon’ny lamba ho toy ny vaovao hatrany no manalefaka azy ihany koa ary mitondra hanitra malefaka sy mihaja ho an’ny lamban-janakao mandritran’ny tontolo andronao ny detergent liquid D-nee newborn. <br> \r\nTsy hatahoranao hi-irriter ny hoditry ny zaza menavava kely izy ity satria ahitanao ny extrait de miel izay manalefaka ny lamba mba tsy hisian’ny fikasohana mahery amin’ny hoditry ny zaza. <br>\r\n ......... Ar ny vidin’ny Liquid Detregent D-NEE Newborn izay 560 ml be izao. Izany hoe raha in-3 isa-kerinandro ianao no manasa lamba dia maharitra anao 3 volana ity vokatra ity. <br>                                                                                                                                                                                                                ', '200 ml', '   <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nD-nee LIQUID DETERGENT BABY est un liquide détergé spécialement conçu pour nettoyer le linge de bébé tout en respectant l’hygiène de nos tout petits. Il:<br>\r\n- Détache la saleté sur le tissu<br>\r\n- Désinfecte le linge pour éviter l’accumulation des bactéries<br>\r\n- Adoucit le tissu grâce à sa formule au miel<br>\r\n- Octroie un léger parfum très naturel qui convient même aux plus sensibles<br>\r\n                                                                                                                                                                                                    ', 1, 27, 'LIQUIDE DETERGENTE', 'D-NEE', 'NEO CORPORATION', '', 'BABY POUNCH PINK', '2013-01-01', '2021-12-31', ''),
