('PRO00', 'OFFRE PROMO COLOR AND PERM 70.ml', '', '', '0', '', '70 ml', '<p>Le Pack PANTENE COLOR & PERM LASTING CARE 70 ml est composÃ© de:</p>\n<p>01shampoing 70ml + 01aprÃ¨s shampoing 70ml. </p>\n<p>ConseillÃ© Ã  tout type de cheveux colorÃ©s, ce pack nettoie, rÃ©pare, protÃ¨ge et nourrit les cheveux colorÃ©s de la racine aux pointes. Sa formule Pro-vitaminÃ©e dÃ©cuple ses facultÃ©s dans ses missions respectives. </p>\n<p>Câ€™ est un soin capillaire spÃ©cialement conÃ§u pour hydrater, protÃ©ger et amÃ©liorer votre couleur et confÃ©rer un lustre Ã©clatant Ã  vos cheveux colorÃ©s ou permanentÃ©s. Sa formule permet de rÃ©parer et protÃ©ger les cheveux chimiquement endommagÃ©s.</p>\n', 1, 38, '', '', '', '', '', '0000-00-00', '0000-00-00', ''),
('PRO001', 'OFFRE PROMO TOTAL DAMAGE CARE 3MN MIRACLE ', '      <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Mélange de nutriments Pro-V:</b> renforce l\'intérieur des cheveux au niveau structurel et octroie une force durable pour réduire la chute des cheveux due à la casse<br>\r\n<b>Panthenol (dérivé de la Vitamine B5):</b> réduit les chutes de cheveux dues à la casse, favorise le démêlage des cheveux, donne un aspect épais aux cheveux fins, absorbe l’humidité détenue dans l’air afin de les protéger de la sècheresse.<br>\r\n<b>Extrait de protéine de soie:</b> améliore et maintient l\'hydratation des cheveux et les rend doux, soyeux et brillants.<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\n<b>Shampoing :</b> Water,Sodium Lauryl Sulfate, Sodium Laureth Sulfate, Sodium Chloride,Cocamidopropyl Betaine,Dimethicone,Glycol Distearate, Fragrance, Sodium citrate,Cocamide MEA, Sodium Xylenesulfonate,Citric Acid,Guar Hydroxypropyltrimonium Chloride, Sodium Benzoate, Tetrasodium EDTA, Trisodium Ethylenediamine Disuccinate, Panthenol, Pantheryl Ethyl Ether,Methylchloroisothiazolinone, Methylisothiazolinone<br>\r\n<b>Après shampoing:</b> Water,Bis-Aminopropyl Dimethicone,Stearyl Alcohol,Behentrimonium Methosulfate, Cetyl Alcohol, Fragrance, Benzyl Alcohol, Disodium EDTA,Panthenol, Panthenyl Ethyl Ether, Silk Extract,Methylchloroisothiazolinone,Methylisothiazolinone CI19140, CI17200, CI42090 <br>                                                                                                                                                                                                    ', '<b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mouiller les cheveux à l’eau chaude<br>\r\n<b>Etape 2:</b> Appliquer et frotter le shampoing sur toute la surface des cheveux<br>\r\n<b>Etape 3:</b> Rincer et remettre du shampoing jusqu’à ce que les cheveux soient propre<br>\r\n<b>Etape 4:</b> Appliquer l’après shampoing après le lavage au shampoing <br>\r\n<b>Etape 5:</b> Masser le cuir chevelu  pendant 1 ou 2 minutes <br>\r\n<b>Etape 6:</b> Laisser reposer  pendant 3 mn <br>\r\n<b>Etape 7:</b> Rincer abondamment à l’eau froide <br>                                                                                                                                          ', '<p><em><strong>Efa f', '   <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Toky avy ao amin’ny One To One Marketing .<br>\r\nAmin’izao fotoana izao ny agence One To One Marketing dia manao promotion amin’ny Pack PANTENE «shampooing» sy après-shampooing «Pantene pro-V 3minutes Miracle». Ao anatin’ny 3 minitra monja dia ho hitanao ny fiasany. Sady mampangirana ny volo izy no mampalama sy manalefaka azy noho izy «pro-vitaminé». Karazana pack 3 no atolotray: <br>\r\nNy TOTAL DAMAGE CARE (violet) dia miaro sy mitsabo ny volo vakivaky sy tapatapaka, <br>\r\nNy HAIR FALL CONTROL (rose) indray dia miaro ny volo amin’ny fihintsanana <br>\r\nAry ny COLOR & PERM dia natokana mba hiaro ny volo miloko sy natao Permanente. <br>Raha zatra nividy shampoing fotsiny amin’ny vidiny .......... Ar ianao teo aloha dia efa lasa ……..Ar monja ny pack iza ahitanao 01 shampoing 120 ml + 01 après shampoing 70 ml miaraka.<br>\r\nAnaovana madama? Tsy mifidy karazam-bolo ny PANTENE fa na gras na sec, na tsotra na oliholy dia afaka ampiasàna azy avokoa.<br>\r\nKoa iza no atao anao? Andramo anie dia ho hitanao ny hatsarany ee!<br>                                                                                                                                    ', '70 ml + 120 ml', '       <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nPANTENE est une marque de cosmétiques de soin capillaire conçu pour adoucir et embellir tous types de cheveux. La gamme PANTENE TOTAL DAMAGE CARE: <br>\r\n- Répare et scelle chaque mèche de cheveux <br>\r\n- Réduit la perte de protéines pour arrêter la progression des dommages <br>\r\n- Aide à prévenir les futures pointes fourchues sur 3 mois <br>\r\n- Lisse et adoucit les cheveux<br>                                                                                                           ', 1, 38, 'SHAMPOING ET APRES SHAMPOING ', 'PANTENE', 'PROCTER & GAMBLE', '', 'TOTAL DAMAGE CARE', '2013-01-01', '2021-12-31', ''),
('PRO002', 'OFFRE PROMO HAIR FALL CONTROL 3MN MIRACLE 7', '     <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Mélange de nutriments Pro-V:</b> renforce l\'intérieur des cheveux au niveau structurel et octroie une force durable pour réduire la chute des cheveux due à la casse<br> \r\n<b>Panthenol (dérivé de la Vitamine B5):</b> réduit les chutes de cheveux dues à la casse, favorise le démêlage des cheveux, donne un aspect épais aux cheveux fins, absorbe l’humidité détenue dans\r\nl’air afin de les protéger de la sécheresse<br>\r\n<b>Extrait de protéine de soie:</b> améliore et maintient l\'hydratation des cheveux et les rend doux, soyeux et brillants<br>  \r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\n<b>Shampoing:</b> Water,Sodium Lauryl Sulfate, Cimethcone, Cocamdopropyl betaine, Sodium citrate, Sodium xylenesulfonate, Glycol Distearate, Sodium Chloride, Fragrance, Strearyl Alcool, Cetyl alcohol,Guar Hydroxypropryltrimonium Chloride, Citric acid,  Sodium Benzoate,Tetrasodium EDTA, Polyquaternium-6, Panthenol, Panthenyl, Ethyl, Ether, Histidine, Methylchloroisothiazolinone, Methylisothiazolinone<br>\r\n<b>Après shampoing 3 mn miracle:</b> Water, Bis-Aminopropyl Dimethicone, Stearyl Alcohol, Fragrance, Isopropyl, Alcohol,Benzyl Alcohol, Disodium EDTA, Butylene Glycol,Histidine, Ciltric Acid, Panthenol, Panthenyl Ethyl Ether, Silik Extract, Methylchloroisothiazolinone, Methylisothiazolinone, CI 19140,CI 17200, CI42090<br>                                                          ', ' <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mouiller les cheveux à l’eau chaude<br>\r\n<b>Etape 2:</b> Appliquer et frotter le shampoing sur toute la surface des cheveux<br>\r\n<b>Etape 3:</b> Rincer et remettre du shampoing jusqu’à ce que les cheveux soient propres<br>\r\n<b>Etape 4:</b> Appliquer l’après shampoing après le lavage au shampoing<br>\r\n<b>Etape 5:</b> Masser le cuir chevelu  pendant 1 ou 2 minutes<br>\r\n<b>Etape 6:</b> Laisser reposer  pendant 3 mn<br>