('PRO004', 'OFFRE PRO - FB HAIR FALL CONTROL 3MN MIRACLE COND + SHAMPOO  ', '', '			\n			            				        				        ', '<p><em><strong>Efa f', '<p>Faly miarahaba anao Caroline mpanentana ara-barotra ao amin&rsquo;ny One To One Marketing. Amin&rsquo;izao fotoana izao ny agence OnetoOne dia mitondra ny Shampoing, apr&egrave;s Shampoing sy mask PANTENE HAIR FALL CONTROL. Manena ny fihintsanan&rsquo;ny volo hatramin&rsquo;ny 97 % ny produit PANTENE HAIR FALL CONTROL. Maro ny mpanjifa efa nampiasa ny vokatra PANTENE MIRACLE ary afa-po amin&rsquo;ny fomba fiasany avokoa ny rehetra.</p>\n\n<p>Ny vokatra PANTENE 3 MINUTE MIRACLE mantsy dia sady mampalama sy manalefaka ny volo no mampangirana sy manamora ny fibangona azy. Izany hoe tahaka ireny avy natao lissage ireny izany ny volonao raha mampiasa ny PANTENE 3 MINUTE MIRACLE ianao. 148 000 Ar ny vidin&rsquo;ny pack HAIR FALL CONTROL izay ahitanao 01 shampoing 450 ml + 01 apr&egrave;s shampooing 300 ml + 01 mask 250g. Ilay pack lehibe io an!!! &emsp;</p>\n', '180 ml + 120 ml', '', 1, 36, 'SHAMPOING ET APRES SHAMPOING ', '', 'PROCTER & GANBLE', '', '', '2013-01-01', '2021-12-31', '');
