('PRO019', 'OFFRE PRO - FB SYSTEMA TOOTHPASTE CHARCOAL ', '  <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br> \r\n<b>Charbon actif:</b> élimine les bactéries, empêche la formation des caries, préviennent la gingivite et la parodontite (pyorrhée)<br>\r\n<b>Extrait d’huile de feuille de Cannelle:</b> empêche la mauvaise haleine<br>\r\n<b>Extrait de girofle et de réglisse:</b> aide à calmer et apaiser les douleurs dentaires, effet anti-inflammatoire<br>\r\n<b>Cement Fluoride:</b> protège les dents et la gencive des agressions<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nWater, Sorbitol, Hydrated, Silica, PEG-400,Sodium lauryl sulfate, Cellulose gum, Flavor, Sodium silicate, CI 77891, Sodium fluoride, Zinc lactate, Sodium saccharin, Carbon, Methylparaben, Dipotassium glycyrrhizate, o-cymen-5-ol, Cinnamomum zeylanicum leaf oil, Engenia caryphyllus(clove)floweroil, Butylparaben<br>\r\n                                                                                            ', '<b>MODE D’UTILISATION</b><br>\r\n<br> \r\n<b>Etape 1:</b> Appliquer une petite noisette du dentifrice SYSTEMA ADVANCED CHARCOAL sur la brosse à dents<br>\r\n<b>Etape 1:</b> Mouiller la brosse à dents à l’eau froide ou tiède<br>\r\n<b>Etape 1:</b> Brosser les dents pendant environ 3 minutes, déplacer votre brosse à dents de haut en bas en allant du rose des gencives vers le blanc des dents<br>\r\n<b>Etape 1:</b> Rincer abondamment<br>                                                                            ', '<p><em><strong>Tena ', ' <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao madama a, Caroline mpanentana ara-barotra avy ao amin’ny OnetoOne Marketing.<br>\r\nTonga eto Madagasikara ilay efa niandrasantsika hatry ny ela, ilay dentifrice vita amin’ny charbon, ilay dentifrice mamono ny bacterie rehetra ao amin’ny aty vava ary manala ihany koa ny fofona rehetra mety hanelingelina anao. Etsy anie jereo izatsy izy e !<br>\r\nDentifrice (Advaincd) ADVANCED (Tcharcolle) CHARCOAL no anarany, ny mampiavaka ny dentifrice CHARCOAL dia noho izy sady misy :<br>\r\n- Charbon Actif: izay mampihena ny plaques bactériennes na antsoina ihany koa hoe caries.<br>\r\n- Cement Fluoride: izay manamafy sy mampatanjaka ny nify ary manentsina ny lavaka madinika mety hankarary ny nifinao.<br>\r\n- Huille essentielle miaraka amin’ny Girofle sy Cannelle ka sady mampihena ny areti-nify no manome hanitra ny aty vava.<br>\r\nRaha toa ka mampiasa ity dentifrice ADVANCED CHARCOAL ity ianao dia tsy mila mandany vola manao detartrage intsony afaka 2 volana dia ho afaka avokoa ny bacteries rehetra ao amin’ny aty vavanao.<br>\r\n…….. Ariary monja ny vidiny amin’ny fatrany 90g ary …….. Ariary raha amin’ny ilay 160g  ka anaovana firy madama ?<br>                                                                                ', '90 g', '  <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nSYSTEMA ADVENCED CHARCOAL est une marque de dentifrice très réputée de Thaïlande. Sa formule à base de charbon lui permet de:<br>\r\n- Eliminer les mauvaises haleines<br>\r\n- Freiner la croissance des bactéries<br>\r\n- Réduire considérablement les plaques<br>\r\n- Prévenir les caries et protéger les dents saines<br>                                                                                                                                                              ', 1, 36, 'BROSSE A DENTS', 'SYSTEMA', 'LION', '', 'ADVENCED CHARCOAL', '2013-01-01', '2021-12-31', ''),
('PRO02', 'OFFRE PRO - FB HAIR FALL CONTROL 3MN MIRACLE ', '                                                          INGRÉDIENTS PRINCIPAUX<br>\r\n	- Mélanges de nutriments Pro-V <br>\r\nRenforce l\'intérieur des cheveux au niveau structurel <br>\r\nOctroi une force durable pour réduire la chute des cheveux due à la casse <br>\r\n	- Panthenol (dérivé de la Vitamine B5)<br>\r\nRéduit les chutes de cheveux dues à la casse;<br>\r\nFavorise le démêlage des cheveux;<br>\r\nDonne un aspect épais aux cheveux fins;<br>\r\nAbsorbe l’humidité détenue dans l’air afin de les protéger de la sècheresse. <br>\r\n	- Extrait de protéine de soie : améliore et maintient l\'hydratation des cheveux et les rend doux, soyeux et brillants. <br>\r\n\r\nAUTRES INGRÉDIENTS<br>\r\nShampoing : <br>Water, Sodium Lauryl Sulfate, Cimethcone, Cocamdopropyl betaine, Sodium citrate, Sodium xylenesulfonate, Glycol Distearate, Sodium Chloride, Fragrance, Strearyl Alcool, Cetyl alcohol, Guar Hydroxypropryltrimonium Chloride, Citric acid,  Sodium Benzoate,\r\nTetrasodium EDTA, Polyquaternium-6, Panthenol, Panthenyl, Ethyl, Ether, Histidine, Methylchloroisothiazolinone, Methylisothiazolinone<br>\r\n\r\nAprès shampoing 3 mn miracle : <br>Water, Bis-Aminopropyl Dimethicone, Stearyl Alcohol, Fragrance, Isopropyl, Alcohol, Benzyl Alcohol, Disodium EDTA, Butylene Glycol, Histidine, Ciltric Acid, Panthenol, Panthenyl Ethyl Ether, Silik Extract, Methylchloroisothiazolinone, Methylisothiazolinone, CI 19140,CI 17200, CI42090<br>                                         ', '- Mouiller les cheveux à l’eau chaude ;<br>\r\n- Appliquer et frotter le shampooing sur toute la surface des cheveux;<br>\r\n- Rincer et remettre du shampoing jusqu’à ce que les cheveux soient propre ;<br>\r\n- Appliquer l’après shampooing après le lavage au shampoing;<br>\r\n- Masser le cuir chevelu  pendant 1 ou 2 minutes;<br>\r\n- Laisser reposer  pendant 3 mn;<br>\r\n- Rincer abondamment à l’eau froide.<br>                                                                ', '0', 'Faly miarahaba anao , Toky avy ao amin’ny One To One Marketing .<br>\r\nAmin’izao fotoana izao ny agence One To One Marketing dia manao promotion amin’ny Pack PANTENE «shampooing» sy après-shampooing «Pantene pro-V 3minutes Miracle». Ao anatin’ny 3 minitra monja dia ho hitanao ny fiasany. Sady mampangirana ny volo izy no mampalama sy manalefaka azy noho izy «pro-vitaminé». Karazana pack 3 no atolotray: <br>\r\nNy TOTAL DAMAGE CARE (violet) dia miaro sy mitsabo ny volo vakivaky sy tapatapaka, <br>\r\nNy HAIR FALL CONTROL (rose) indray dia miaro ny volo amin’ny fihintsanana <br>ary COLOR & PERM dia natokana mba hiaro ny volo miloko sy natao Permanente. <br>Raha zatra nividy shampoing fotsiny amin’ny vidiny .......... Ar ianao teo aloha dia efa lasa ……..Ar monja ny pack iza ahitanao 01 shampoing 70 ml + 01 après shampoing 70 ml miaraka. <br>\r\nAnaovana madama? Tsy mifidy karazam-bolo ny PANTENE fa na gras na sec, na tsotra na oliholy dia afaka ampiasàna azy avokoa. <br>\r\nKoa iza no atao anao? Andramo anie dia ho hitanao ny hatsarany ee! <br>                          ', '70 ml + 120 ml', ' PANTENE est une marque de cosmétiques de soin capillaire conçu pour adoucir et embellir tous types de cheveux : <br>\r\n- Fortifie la racine des cheveux  pour les protéger des chutes <br>\r\n- Lisse et adoucit les cheveux<br>\r\n- Protège de cuir chevelu contre les agressions extérieures <br>                                                    ', 1, 36, 'SHAMPOING ET APRES SHAMPOING ', 'PANTENE', 'PROCTER & GAMBLE', '', 'HAIR FALL CONTROL 3M', '2013-01-01', '2021-12-31', ''),
('PRO020', 'OFFRE PRO - FB VIVITE DEODORANT ESSENTIAL LESS SHAVE ROLL ON  VIOLET 25.ML', '  <b>  INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>  \r\n<b>- Extrait de graines de glycine soja :</b> participe à la régénération cutanée en protégeant la peau du dessèchement et en la nourrissant en profondeur<br>\r\n<b>- Oligopeptide-3protéine: </b> agent antivieillissement de la peau, agent blanchissant éclaircissant, augmente la production de collagène, diminue la profondeur des rides <br>\r\n<b>- Extrait de racine de mûrier blanc: </b> lui assure une action anti-taches sur la peau et aide à éclaircir le teint<br>\r\n<b>- Extrait de feuilles de raisin: </b> lutte contre le vieillissement cutané,nourrit une peau sèche ou hydrate une peau grasse<br>\r\n<b>- Extrait de réglisse:</b> lutte contre les taches pigmentaires de la peau<br>\r\n<b>- Extrait de feuille de busserole:</b> atténue les imperfections de la peau ou du teint<br>\r\n<br>\r\n<b> AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua,Aluminim chlorophydrate, Steareth-21, Steareth-2PPG-15,Stearyl ether ,Cyclopentasiloxane, Fragrance, Magnesium aluminium silicate, Glycine soja (soybean) ,seed extract/ Butylene glycol, PEG-4/ Lactic acid/ Kojic acid/ Morus alba root extract / Arcto staphylos uva-ursi leaf extract/ Glycyrrhiza glabra root extract, Hydrogenated lecithin/ Sodium oleate / Glycine soja (soybean) oil/ Glycerin/ Disodium EDTA / Oligopeptide-3, Caprylyl methicone, Propanediol dicaprylate, Pentaerythrityl tetra-di-t-butyl/ hydroxyhydricinnamate, Tetrasodium EDTA, Benzethonium chloride, Phenoxyethanol/ lodopropynyl/ butylcarbamate<br>                                                                                                                                                                                                                                                                                                  ', '   <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Frotter les aisselles avec un gant de toilette savonné <br>\r\n<b>Etape 2:</b> Rincer et tapoter avec une serviette <br>\r\n<b>Etape 3:</b> Appliquer le déodorant VIVITE <br>\r\n<b>Etape 4:</b> Attendre 1 ou 2 minutes avant d’enfiler un vêtement <br>                                                                                                                                                                                                                                                                         ', '				<p>Tsy izany ny ', '     <b>PRÉSENTATION</b><br>\r\n<br> \r\nFaly miarahaba anao izahay ato amin’ny One To One Marketing,<br>\r\nTonga indray ny déodorant VIVITE, vita avy amin’ny zava-maniry maro karazany ka miaro sy manatsara ny hoditrao.<br>\r\nAraky ny efa nahafantarantsika azy hatramin’izay, ny deodorant VIVITE dia sady mitroka ny hatsembohana izay mety hanelingelina anao mandritry ny andro no tsara fofona ka manome fraicheur tsy manan-tsahala ho anao.. Tsy mamela trace amin’ny akanjo izy sady maharitra 48 sssora ny fiasany.<br>\r\n………. Ar monja ny vidiny. Sady maharitra 48h be izao ny déodorant VIVITE. Ka iza ary no hatao ho an’i Mme / Mr ? <br>\r\nProposition hafa.<br>\r\nNB: Karazany 4 no eto ampelatanantsika ka anjaranao no misafidy izao metimety aminao:<br>\r\n- Ny essential less shave mampihena ny fanirin’ny volon-kelika.<br>\r\n- Manarak’izany ny crystal white, izay manazava ny oditra sy manampy amin’ny fanasitranana ny oditra simban’ny fiaratana ary mampalama azy.<br>\r\n-Ny snail white manazava  sy mampalefaka ary mitondra vitamines ho an’ny oditra. Miady ihany koa izy amin’ny bactéries.<br>\r\n- Ny clear & confident izay mitazona ny hatsarana sy ny élasticité an’ny hoditra.<br>                                       ', '25 ml', '<b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nVIVITE ESSENTIAL LESS SHAVE est un déodorant conçu spécialement pour les peaux sensibles (sans d’alcool). Il: <br>\r\n- Octroie de la fraîcheur tout au long de la journée au doux parfum de camomille<br>\r\n- Offre une protection efficace contre les mauvaises odeurs <br>\r\n- Adoucit, hydrate et éclaircit la peau<br>\r\n- Ralentit la repousse des poils et les affines<br>\r\n- Évite les taches blanches sur les vêtements de couleur et les taches jaunes sur les vêtements blancs<br>                                                                                                                                                                                                                                                           ', 1, 2, 'DEODORANT', 'VIVITE', 'NEO CORPORATION', '', 'ESSENTIAL LESS SHAVE', '2013-01-01', '2021-12-31', ''),
('PRO021', 'OFFRE PRO - FB VIVITE DEODORANT CRYSTAL WHITE DEO ROLL ON (VVR  CW) BLUE 25.ML', '      <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extrait de graines de Glycine soja:</b> participe à la régénération cutanée en protégeant la peau du dessèchement et en la nourrissant en profondeur<br>\r\n<b>Lécithine marine (issue des œufs de poisson):</b>  anti-inflammatoire et adoucit la peau\r\n<b>Allantoïne</b> (grande source de Vitamine E):</b>  apaisante et anti-irritante, régénérante, hydratante, adoucissante<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua,Aluminim,chlorophydrate,Steareth-21,Steareth-2PPG-15,Stearylether,\r\nCyclopentasiloxane,Fragrance, Magnesium aluminium silicate, Glycine soja (soybean) ,seed extract/ Butylene glycol, PEG-4/ Lactic acid/ Kojic acid/ Morus alba root extract / Arcto staphylos uva-ursi leaf extract/ Glycyrrhiza glabra root extract, Hydrogenated lecithin/ Sodium oleate / Glycine soja (soybean) oil/ Glycerin/ Disodium EDTA / Oligopeptide-3, Caprylyl methicone, Propanediol dicaprylate, Pentaerythrityl tetra-di-t-butyl/ hydroxyhydricinnamate, Tetrasodium EDTA, Benzethonium chloride, Phenoxyethanol/lodopropynyl/butylcarbamate<br>\r\n                                                                                      ', '<b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Frotter les aisselles avec un gant de toilette savonné<br>\r\n<b>Etape 2: </b> Rincer et tapoter avec une serviette<br>\r\n<b>Etape 3:</b> Appliquer le déodorant VIVITE<br>\r\n<b>Etape 4:</b> Attendre 1 ou 2 minutes avant d’enfiler un vêtement<br>\r\n                                                                                                                                       ', '<p><em><strong>Tsy i', '<b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao izahay ato amin’ny One To One Marketing,<br>\r\nTonga indray ny déodorant VIVITE, vita avy amin’ny zava-maniry maro karazany ka miaro sy manatsara ny hoditrao.<br>\r\nAraky ny efa nahafantarantsika azy hatramin’izay, ny deodorant VIVITE dia sady mitroka ny hatsembohana izay mety hanelingelina anao mandritry ny andro no tsara fofona ka manome fraicheur tsy manan-tsahala ho anao.. Tsy mamela trace amin’ny akanjo izy sady maharitra 48ora ny fiasany. <br>\r\n………. Ar monja ny vidiny. Sady maharitra 48h be izao ny déodorant VIVITE. Ka iza ary no hatao ho an’i Mme / Mr ? <br>\r\nNB: Karazany 4 no eto ampelatanantsika ka anjaranao no misafidy izao metimety aminao:<br>\r\nNy essential less shave mampihena ny fanirin’ny volon-kelika.<br>\r\nManarak’izany ny crystal white, izay manazava ny oditra sy manampy amin’ny fanasitranana ny oditra simban’ny fiaratana ary mampalama azy.<br>\r\nNy snail white manazava  sy mampalefaka ary mitondra vitamines ho an’ny oditra. Miady ihany koa izy amin’ny bactéries.<br>\r\nNy clear & confident izay mitazona ny hatsarana sy ny élasticité an’ny hoditra.<br>                                                                     ', '25 ml', '<b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nVIVITE CRYSTAL WHITE est un déodorant conçu spécialement pour les peaux sensibles (sans alcool).Il :<br>\r\n- Octroie de la fraîcheur tout au long de la journée<br>\r\n- Offre une protection efficace contre les mauvaises odeurs<br>\r\n- Adoucit, hydrate et éclaircit  la peau<br>\r\n- Régénère la peau abîmée par l’agression du rasoir<br>\r\n- Évite les taches blanches sur les vêtements de couleur et les taches jaunes sur les vêtements blancs<br>\r\n                                                                                              \r\n                                                                                                                                    ', 1, 36, 'DEODORANT ROLL ON ', 'VIVITE', 'NEO CORPORATION', '', 'CRYSTAL WHITE', '2013-01-01', '2021-12-31', ''),
('PRO022', 'OFFRE PRO - FB VIVITE DEODORANT CLEAR & CONFIDENT ROLL ON (VVR CC) RED 25.ML', '   <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extrait de mûres:</b> anti-cancérigène, ralentit le vieillissement précoce et protège la peau des agressions externes (rasage, utilisation de la cire)<br>\r\n<b>Extrait deprunes:</b> hydrate les peaux très sèches<br>\r\n<b>Extrait de myrtilles:</b> anti-oxydant et anti-cancérigène<br>\r\n<b>Tocophérol:</b> aide à stimuler la production de collagène, protéine responsable de l\'élasticité de l\'épiderme<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\nAqua,Aluminim chlorophydrate, Alcohol denat, C12-15 pareth-12 ; Fragrance, Polyquaternium-6, Propylene glycose, Hydroxyethylcellulose, Hydroxypropylmethylose, Niacinamide , Vaccinium myrtillus fruit ext  / Fragaria vesca fruit ext/ Prunus cerasus fruit ext/Rubus fruitcosus fruit ext/ Rubus idaeus fruit ext, Disodium EDTA, Benzophenone-3, Benzyl alcohol/ Ethylhexylglycerin/ Tocopherol<br>                                           ', '   <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Frotter les aisselles avec un gant de toilette savonné <br>\r\n<b>Etape 2:</b> Rincer et tapoter avec une serviette <br>\r\n<b>Etape 3:</b> Appliquer le déodorant VIVITE <br>\r\n<b>Etape 4:</b> Attendre 1 ou 2 minutes avant d’enfiler un vêtement <br>                                                                                                                                                                                                                                                              ', '<p><em><strong>Tsy i', ' <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao izahay ato amin’ny One To One Marketing,<br>\r\nTonga indray ny déodorant VIVITE, vita avy amin’ny zava-maniry maro karazany ka miaro sy manatsara ny hoditrao.<br>\r\nAraky ny efa nahafantarantsika azy hatramin’izay, ny deodorant VIVITE dia sady mitroka ny hatsembohana izay mety hanelingelina anao mandritry ny andro no tsara fofona ka manome fraicheur tsy manan-tsahala ho anao..Tsy mamela trace amin’ny akanjo izy sady maharitra 48 ora ny fiasany.<br>\r\n………. Ar monja ny vidiny. Sady maharitra 48h be izao ny déodorant VIVITE. Ka iza ary no hatao ho an’i Mme / Mr ?<br>\r\nNB: Karazany 4 no eto ampelatanantsika ka anjaranao no misafidy izao metimety aminao:<br>\r\n- Ny essential less shave mampihena ny fanirin’ny volon-kelika.<br>\r\n- Manarak’izany ny crystal white, izay manazava ny oditra sy manampy amin’ny fanasitranana ny oditra simban’ny fiaratana ary mampalama azy.<br>                                                                                                          ', '25 ml', '  <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nVIVITE CLEAR & CONFIDENT est un déodorant conçu spécialement pour les peaux sensibles. Il : <br>\r\n- Octroie de la fraîcheur tout au long de la journée<br>\r\n- Offre une protection efficace contre les mauvaises odeurs<br>\r\n- Adoucit, hydrate et éclaircit  la peau<br>\r\n- Garde l’élasticité de la peau pour la rendre lisse, douce et jeune<br>\r\n- Evite les taches blanches sur les vêtements de couleur et les taches jaunes sur les vêtements blancs<br>                                                                                                                                                                                                                                                           ', 1, 36, 'DEODORANT ', 'VIVITE', 'NEO CORPORATION', '', 'CLEAR & CONFIDENT', '2013-01-01', '2021-12-31', '');
