tape 4:</b> Appliquer l’après shampoing après le lavage au shampoing<br>\r\n<b>Etape 5:</b> Masser le cuir chevelu  pendant 1 ou 2 minutes<br>\r\n<b>Etape 6:</b> Laisser reposer  pendant 3 mn<br>\r\n<b>Etape 7:</b> Rincer abondamment à l’eau froide<br>                                                                                                                                              ', '<p><em><strong>Efa f', ' <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Toky avy ao amin’ny One To One Marketing .<br>\r\nAmin’izao fotoana izao ny agence One To One Marketing dia manao promotion amin’ny Pack PANTENE «shampooing» sy après-shampooing «Pantene pro-V 3minutes Miracle». Ao anatin’ny 3 minitra monja dia ho hitanao ny fiasany. Sady mampangirana ny volo izy no mampalama sy manalefaka azy noho izy «pro-vitaminé». Karazana pack 3 no atolotray:<br>\r\nNy TOTAL DAMAGE CARE (violet) dia miaro sy mitsabo ny volo vakivaky sy tapatapaka, <br>\r\nNy HAIR FALL CONTROL (rose) indray dia miaro ny volo amin’ny fihintsanana <br>\r\nAry ny COLOR & PERM dia natokana mba hiaro ny volo miloko sy natao Permanente. <br>\r\nRaha zatra nividy shampoing fotsiny amin’ny vidiny .......... Ar ianao teo aloha dia efa lasa ……..Ar monja ny pack iza ahitanao 01 shampoing 120 ml + 01 après shampoing 70 ml miaraka.<br> Anaovana madama? Tsy mifidy karazam-bolo ny PANTENE fa na gras na sec, na tsotra na oliholy dia afaka ampiasàna azy avokoa. <br>\r\nKoa iza no atao anao? Andramo anie dia ho hitanao ny hatsarany ee! <br>                                                                                                                                     ', '70 ml + 120 ml', '   <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nPANTENE est une marque de cosmétiques de soin capillaire conçu pour adoucir et embellir tous types de cheveux. La gamme PANTENE HAIR FALL CONTROL :<br>\r\n- Fortifie la racine des cheveux  pour les protéger des chutes<br>\r\n- Lisse et adoucit les cheveux<br>\r\n- Protège de cuir chevelu contre les agressions extérieures<br>                                                                                                                                                                             ', 1, 36, 'SHAMPOING ET APRES SHAMPOING ', 'PANTENE', 'PROCTER & GAMBLE', '', 'HAIR FALL CONTROL', '2013-01-01', '2021-12-31', ''),
('PRO03', 'OFFRE PRO - FB VIVITE LESS SHAVE + FEMININE CLEANSING ', ' <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Ingrédients principaux de FEMININE CLEANSING EXTRA SENSITIVE SKIN </b><br>\r\n<br>\r\n<b>Acide lactique: </b> réduit la perte d\'eau de la peau et maintient l\'équilibre hydrique de la peau \r\n<b>Extrait de Fleur de Mallow:</b> protège des irritations et protège les peaux hypoallergéniques<br>\r\n<br>\r\n<b> Ingrédients principaux de VIVITE ESSENTIAL LESS SHAVE</b><br>\r\n<br>\r\n<b>Extrait de graines de glycine soja:</b> participe à la régénération cutanée en protégeant la peau du dessèchement et en la nourrissant en profondeur<br>\r\n<b>Oligopeptide-3protéine:</b> agent antivieillissement de la peau, agent blanchissant éclaircissant, augmente la production de collagène, diminue la profondeur des rides <br>\r\n<b>Extrait de racine de mûrier blanc:</b> assure une action anti-taches sur la peau et aide à éclaircir le teint<br>\r\n<b>Extrait de feuilles de raisin:</b> lutte contre le vieillissement cutané, nourrit une peau sèche ou hydrate une peau grasse<br>\r\n<b>Extrait de réglisse:</b> lutte contre les taches pigmentaires de la peau, anti-inflammatoire et adapté au soin des peaux irritées<br>\r\n<b>Extrait de fleur de camomille:</b> octroie un parfum apaisant à la camomille<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS </b><br>\r\n<br>\r\n<b>Autres ingrédients de TROS CLEAR COOL & DRY </b><br>\r\n<br>\r\nAqua, Alcohol denat, Aluminium chiorohydrate, C12-15 Pareth-12, Butylene glycol, Fragrance, Hydroxyethylcellulose, triclosan, Menthylsuccinate, Methylchloroisothizolinone/ Methylisothizolinone, Benzophenone-3, CI 42090, CI 17200<br>\r\n<br>\r\n<b>Autres ingrédients de VIVITE ESSENTIAL LESS SHAVE</b><br>\r\n<br>\r\nAqua,Aluminim chlorophydrate, Steareth-21, Steareth-2PPG-15,Stearyl ether ,Cyclopentasiloxane, Fragrance, Magnesium aluminium silicate, Glycine soja (soybean) ,seed extract/ Butylene glycol, PEG-4/ Lactic acid/ Kojic acid/ Morus alba root extract / Arcto staphylos uva-ursi leaf extract/ Glycyrrhiza glabra root extract, Hydrogenated lecithin/ Sodium oleate / Glycine soja (soybean) oil/ Glycerin/ Disodium EDTA / Oligopeptide-3, Caprylyl methicone, Propanediol dicaprylate, Pentaerythrityl tetra-di-t-butyl/ hydroxyhydricinnamate, Tetrasodium EDTA, Benzethonium chloride, Phenoxyethanol/ lodopropynyl/ butylcarbamate<br>\r\n                                                                                                                                                                                                                                                                  ', '      <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>DEODORANT VIVITE</b><br>\r\n<b>Etape 1:</b> Frotter les aisselles avec un gant de toilette savonné<br>\r\n<b>Etape 2:</b> Rincer et tapoter avec une serviette<br>\r\n<b>Etape 3:</b> Appliquer le déodorant VIVITE<br>\r\n<b>Etape 4:</b> Attendre 1 ou 2 minutes avant d’enfiler un vêtement<br>\r\n<br>\r\n<b>FEMININE CLEANING</b><br>\r\n<b>Etape 1:</b> Mettre 2 ou 3 gouttes sur la main<br>\r\n<b>Etape 2:</b> Appliquer sur la partie externe de la partie intime et sur l’articulation de la cuisse<br>\r\n<b>Etape 3:</b> Rincer soigneusement et abondamment  avec de l\'eau propre légèrement chaude<br>                                                                                                                                                                                                                                                 ', '0', '    <b>PRÉSENTATION</b><br>\r\n<br>\r\n Faly miarahaba anao.Tsinjo commercial avy ao amin’ny one to one marketing. Amin’izao fotoana izao ny agence One To One dia manolotra PROMOTION pack « Nettoyant Intime BeNice rose sy déodorant VIVITE  essential less shave » <br>  \r\nNy « Nettoyant Intime BeNice » dia vokatra iray natokana ho an’ny vehivavy, entina hanadiovana ny faritra intime. <br>  \r\nNy mampiavaka azy ity dia noho izy vita avy amin’ny zava-maniry ary mety ho an’ny hoditra tena sensible noho izy manana PH neutre. Malefaka sy manitra ery ny fofony ary efa vita test Clinique izy ity.<br>  \r\nIndraindray negligen’ ny olona ny fanadiovana ny faritra intime izay tena sensible nefa tena ilaina satria soin quotidien tsy tokony hamaivanina ary tokony hampiasana vokatrana tokana manokana ho amin’izany mba hitazomana ny equilibre naturel. Tsy ny savony rehetra noho izany no afaka hanasana ny faritra intime.<br>  \r\nNy déodorant VIVITE indray dia sady mitroka ny hatsembohana izay mety hanelingelina anao mandritry ny andro no tsara fofona ka manome fraicheur tsy manan-tsahala ho anao. Tsy mamela trace amin’ny akanjo izy sady maharitra 48ora ny fiasany. <br>\r\nMora dia mora ny vidin\'ity pack ity.  …….Ar monja no ahazoanao ireo vokatra 2 ireo raha toa ka ......... Ar ny fitambarany raha mividy azy tsirairay ianao.  Araraoty ary o !<br>                                                                                                                                                                                                                                                                                                                ', '25 ml + 60 ml', '  <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\n<b>Caractéristiques de BENICE FEMININE CLEANSING EXTRA SENSITIVE SKIN</b><br>\r\n<br>\r\nBENICE FEMININE CLEANSING EXTRA SENSITIVE SKIN est un gel lavant spécialement conçu pour l’hygiène intime féminine et convient pour peau sensible. Combinant les bienfaits d’ingrédients naturels rigoureusement sélectionnés. Il: <br>\r\n- Evite l\'accumulation des bactéries<br>\r\n- Lutte contre les odeurs vaginales <br>\r\n- Maintien l’équilibre du pH dans la partie intime<br>\r\n- Cliniquement prouvé pour être non irritant<br>\r\n<br>\r\n<b>Caractéristiques de VIVITE ESSENTIAL LESS SHAVE</b><br>\r\n<br>\r\nVIVITE ESSENTIAL LESS SHAVE est un déodorant conçu spécialement pour les peaux sensibles, il ne contient pas d’alcool. Il: <br>\r\n- Octroie de la fraîcheur tout au long de la journée<br>\r\n- Offre une protection efficace longue durée contre les mauvaises odeurs<br>\r\n- Adoucit, hydrate et éclaircit la peau<br>\r\n- Ralentit la repousse des poils et les affines<br>\r\n- Evite les taches blanches sur les vêtements de couleur et les taches jaunes sur les vêtements blancs<br>\r\n                                                                                                                                                                                                                                                                                                             ', 1, 36, 'COMBO INTIMA', 'BENICE & VIVITE', 'NEO CORPORATION', '', 'FEMININE CLEANSING E', '2013-01-01', '2021-12-31', ''),
('PRO030', 'OFFRE PROMO REJOICE COND + SHAMPOO ANTI-DANDRUFF ', '                                                                                                                                                        <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Zinc pyrithione:</b> aide à empêcher la multiplication des bactéries et microbe responsable de la formation des pellicules<br> \r\n<b>Menthe:</b> aide à  améliorer les conditions du cuir chevelu, octroie un lavage rajeunissant et donne une expérience parfumée à la menthe fraîche<br>\r\n<b>Citron:</b> retire les flocons des pellicules et redonne de l’éclat au cuir chevelu<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\n<b>Shampoing:</b> Water, Sodium Laureth Sulfate, Sodium Lauryl Sulfate, Sodium Chloride, Dimethicone, Glycol Distearate, Cocamidopropyl Betaine, Sodium Citrate, Cocamide MEA, Sodium Xylenesulfonate, Sodium Benzoate, Zinc Pyrithione, Fragrance, Menthol, Citric Acid, Benzyl Alcohol, Guar Hydroxypropyltrimonium Chloride, Methylchloroisothiazolinone, Methylisothiazolinone<br>\r\n<br>\r\n<b>Après shampoing:</b> Water, Stearyl Alcohol, Cetyl Alcohol, Stearamidopropyl Dimethylamine, Glutamic Acid, Dimethicone, Zinc Pyrithione, Benzyl Alcohol, Fragance, Menthol, Phenoxyethanol, Citric Acid, Sodium Chloride, Methylchloroisothiazolinone, Methylisothiazolinone<br>                                                                                                                                                                                                                    ', '                                                                                                 <b>MODE D’UTILISATION</b><br> \r\n<br>\r\n<b>Etape 1:</b> Bien laver les cheveux avec le shampoing<br>\r\n<b>Etape 2:</b> Rincer abondamment le shampoing<br> \r\n<b>Etape 3:</b> Puis, appliquer l’après shampoing après le lavage au shampoing<br>\r\n<b>Etape 4:</b> Masser le cuir chevelu pendant 1 ou 2 minutes<br>\r\n<b>Etape 5:</b> Laisser reposer 5 à 10 minutes<br>\r\n<b>Etape 6:</b> Rincer abondamment<br>                                                                                                                                                                                                                                                                     ', '', '                                                                                                                <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Caroline mpanentana ara-barotra avy ao amin’ny One To One Marketing.<br>\r\nAmin’izao fotoana izao ny agence One to One dia tonga mamangy antsika aty an-tokantrano, tonga mitondra ny Shampoing sy ny après Shampoing REJOICE.<br>\r\nNy Shampoing sy après-shampoing REJOICE 3 EN 1 dia sady mampitsotra sy manalefaka ny volo no manala ihany koa ny anga-drano ary mitondra fraicheur ho an’ny volo sy ny loha ka ho maivamaivana ery ny tontolo andronao rehefa avy mampiasa azy ianao.<br> \r\nMisy abeny azo nao hisafidianana an !!!!  Ireto avy ny fatran’ny vokatra misy:<br>\r\n- Pack REJOICE 01 shampoing 70 ml + 01 Après shampoing 60 ml amin’ny vidiny ……. Ar<br>\r\n- Pack REJOICE 01 shampoing 120 ml + 01 Après shampoing 60 ml amin’ny vidiny ……. Ar<br>\r\n- Pack REJOICE 01 shampoing 140 ml + 01 Après shampoing 60 ml amin’ny vidiny ……. Ar<br>\r\nIza no anao ho anao ? <br>\r\nEn PROMOTION izy amin’izao fotoana izao satria ………Ar monja ny shampoing 70 ml sy après shampoing 60 ml ka mahaiza manararaotra.<br>                               \r\n                                                                                                                                                                                                               ', '60 ml + 70 ml', '                                                                                                  <b>CARACTÉRISTIQUES</b><br>\r\n<br> \r\nLe pack REJOICE 3 IN 1 FRESH SMOOTH ANTI-DANDRUFF est composé d’un shampoing et d’un après shampoing  conçu pour nourrir et protéger les cheveux afin de les rendre plus frais, plus lisses et les protéger des pellicules<br> \r\nIl contient des ingrédients naturels qui aident à nourrir et à restaurer la kératine des cheveux abîmés, à protéger et à rendre les cheveux plus beaux et hydratés<br> \r\nLe pack REJOICE 3 IN 1 FRESH SMOOTH ANTI-DANDRUFF est adapté à tout type de cheveux<br>                                                                                                                                                      ', 1, 38, 'PACK SHAMPOING & APRES SHAMPOING ', 'REJOICE', 'PROCTER & GAMBLE', '', 'PACK ANTI-PELICULLAI', '2013-01-01', '2021-12-31', ''),
('PRO031', 'OFFRE PROMO REJOICE COND  + SHAMPOO ANTI-DANDRUFF ', '                                                <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Zinc pyrithione:</b> aide à empêcher la multiplication des bactéries et microbe responsable de la formation des pellicules<br> \r\n<b>Menthe:</b> aide à  améliorer les conditions du cuir chevelu, octroie un lavage rajeunissant et donne une expérience parfumée à la menthe fraîche<br>\r\n<b>Citron:</b> retire les flocons des pellicules et redonne de l’éclat au cuir chevelu<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\n<b>Shampoing:</b> Water, Sodium Laureth Sulfate, Sodium Lauryl Sulfate, Sodium Chloride, Dimethicone, Glycol Distearate, Cocamidopropyl Betaine, Sodium Citrate, Cocamide MEA, Sodium Xylenesulfonate, Sodium Benzoate, Zinc Pyrithione, Fragrance, Menthol, Citric Acid, Benzyl Alcohol, Guar Hydroxypropyltrimonium Chloride, Methylchloroisothiazolinone, Methylisothiazolinone<br>\r\n<br>\r\n<b>Après shampoing:</b> Water, Stearyl Alcohol, Cetyl Alcohol, Stearamidopropyl Dimethylamine, Glutamic Acid, Dimethicone, Zinc Pyrithione, Benzyl Alcohol, Fragance, Menthol, Phenoxyethanol, Citric Acid, Sodium Chloride, Methylchloroisothiazolinone, Methylisothiazolinone<br>                                                                                                                                                                                                                            ', '                                                  <b>MODE D’UTILISATION</b><br> \r\n<br>\r\n<b>Etape 1:</b> Bien laver les cheveux avec le shampoing<br>\r\n<b>Etape 2:</b> Rincer abondamment le shampoing<br> \r\n<b>Etape 3:</b> Puis, appliquer l’après shampoing après le lavage au shampoing<br>\r\n<b>Etape 4:</b> Masser le cuir chevelu pendant 1 ou 2 minutes<br>\r\n<b>Etape 5:</b> Laisser reposer 5 à 10 minutes<br>\r\n<b>Etape 6:</b> Rincer abondamment<br>\r\n                                                                                                                                                                                                                                       ', '', '                                                 <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Caroline mpanentana ara-barotra avy ao amin’ny One To One Marketing.<br>\r\nAmin’izao fotoana izao ny agence OnetoOne dia tonga mamangy antsika aty an-tokantrano, tonga mitondra ny Shampoing sy ny après Shampoing REJOICE.<br>\r\nNy Shampoing sy après-shampoing REJOICE 3 EN 1 dia sady mampitsotra sy manalefaka ny volo no manala ihany koa ny anga-drano ary mitondra fraicheur ho an’ny volo sy ny loha ka ho maivamaivana ery ny tontolo andronao rehefa avy mampiasa azy ianao.<br> \r\nMisy abeny azo nao hisafidianana an !!!!  Ireto avy ny fatran’ny vokatra misy:<br>\r\n- Pack REJOICE 01 shampoing 70 ml + 01 Après shampoing 60 ml amin’ny vidiny ……. Ar<br>\r\n- Pack REJOICE 01 shampoing 120 ml + 01 Après shampoing 60 ml amin’ny vidiny ……. Ar<br>\r\n- Pack REJOICE 01 shampoing 140 ml + 01 Après shampoing 60 ml amin’ny vidiny ……. Ar<br>\r\nIza no anao ho anao ? <br>\r\nEn PROMOTION izy amin’izao fotoana izao satria ………Ar monja ny shampoing 70 ml sy après shampoing 60 ml ka mahaiza manararaotra.<br>                                                                                                                                                                   ', '60 ml + 140 ml', '                                                    <b>CARACTÉRISTIQUES</b><br>\r\n<br> \r\nLe pack REJOICE 3 IN 1 FRESH SMOOTH ANTI-DANDRUFF est composé d’un shampoing et d’un après shampoing  conçu pour nourrir et protéger les cheveux afin de les rendre plus frais, plus lisses et les protéger des pellicules<br> \r\nIl contient des ingrédients naturels qui aident à nourrir et à restaurer la kératine des cheveux abîmés, à protéger et à rendre les cheveux plus beaux et hydratés<br> \r\nLe pack REJOICE 3 IN 1 FRESH SMOOTH ANT