('PRO032', 'OFFRE PROMO COLOR & PERM 3MN MIRACLE ', '                                                <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>	\r\n<b> Provitamine B5 (Panthénol):</b> nourrit et fortifie  le cuir chevelu, favorise le démêlage des cheveux, donne un aspect épais aux cheveux fins et absorbe l’humidité détenue dans l’air afin de les protéger de la sècheresse<br>\r\n<b> Mélange de nutriments Pro-V:</b> renforce l\'intérieur des cheveux au niveau structurel et octroie une force durable pour réduire la chute des cheveux due à la casse<br>\r\n<b> Extrait de protéine de soie:</b> améliore et maintient l\'hydratation des cheveux et les rend doux, soyeux et brillants<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\n<b>Shampoing:</b> Water,Sodium Lauryl Sulfate, Sodium Laureth Sulfate, Sodium Chloride,Cocamidopropyl Betaine,Dimethicone,Glycol Distearate, Fragrance, Sodium citrate,Cocamide MEA, Sodium Xylenesulfonate,Citric Acid,Dimethicone,Polyquaternium-6,Trisodium Ethylenediamine,Disuccinate,Panthenol,Panthenyl Ethyl Ether,Hydrochloric,Acid, Methylchloroisothiazolinone,Methylisothiazolinone <br>\r\n<br>\r\n<b>Après shampoing:</b> Water,Bis-Aminopropyl Dimethicone,Stearyl Alcohol,Behentrimonium Methosulfate, Cetyl Alcohol, Fragrance,Isopropyl Alcool , Benzyl Alcohol, Disodium EDTA,Histidine, Citric Acid, Panthenol, Panthenyl Ethyl Ether, Methylchloroisothiazolinone, Methylisothiazolinone,CI19140, CI17200, CI42090 <br>                                                                                                                                                                                                                                                                                           ', '                                                          <b>MODE D’UTILISATION </b><br>\r\n<br>\r\n<b>Etape 1:</b> Mouiller les cheveux à l’eau chaude<br>\r\n<b>Etape 2:</b> Appliquer et frotter le shampoing sur toute la surface des cheveux<br>\r\n<b>Etape 3:</b> Rincer et remettre du shampoing jusqu’à ce que les cheveux soient propre<br>\r\n<b>Etape 4:</b> Appliquer l’après shampoing après le lavage au shampoing<br>\r\n<b>Etape 5:</b> Masser le cuir chevelu  pendant 1 ou 2 minutes<br>\r\n<b>Etape 6:</b> Laisser reposer  pendant 3 mn<br>\r\n<b>Etape 7:</b> Rincer abondamment à l’eau froide<br>                                                                                                                                                                                                                                                                                                                                                                                                                              ', '				            				', '                                                        <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Toky avy ao amin’ny One To One Marketing .<br>\r\nAmin’izao fotoana izao ny agence One To One Marketing dia manao promotion amin’ny Pack PANTENE «shampoing» sy après-shampoing «Pantene pro-V 3minutes Miracle». Ao anatin’ny 3 minitra monja dia ho hitanao ny fiasany. Sady mampangirana ny volo izy no mampalama sy manalefaka azy noho izy «pro-vitaminé». Karazana pack 3 no atolotray: <br>\r\nNy TOTAL DAMAGE CARE (violet) dia miaro sy mitsabo ny volo vakivaky sy tapatapaka, <br>\r\nNy HAIR FALL CONTROL (rose) indray dia miaro ny volo amin’ny fihintsanana <br>\r\nAry ny COLOR & PERM dia natokana mba hiaro ny volo miloko sy natao Permanente. <br>Raha zatra nividy shampoing fotsiny amin’ny vidiny .......... Ar ianao teo aloha dia efa lasa ……..Ar monja ny pack iza ahitanao 01 shampoing 120 ml + 01 après shampoing 70 ml miaraka.<br>\r\nAnaovana madama? Tsy mifidy karazam-bolo ny PANTENE fa na gras na sec, na tsotra na oliholy dia afaka ampiasàna azy avokoa.<br>\r\nKoa iza no atao anao? Andramo anie dia ho hitanao ny hatsarany ee!<br>                                                                                                                                                                                                                                                                                          ', '70 ml + 120 ml', '                                                 <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nPANTENE est une marque de cosmétiques de soin capillaire conçu pour adoucir et embellir tous types de cheveux . La gamme PANTENE COLOR & PERM:<br>\r\n- Nourrit et hydrate les cheveux colorés de la racine aux pointes <br>\r\n- Fait ressortir l’éclat de la couleur des cheveux <br>\r\n- Répare les cheveux chimiquement endommagés<br>\r\n- Lisse et adoucit les cheveux <br>\r\n- Protège de cuir chevelu contre les agressions extérieures<br>                                                                                                                                                                          ', 1, 38, 'SHAMPOING ET APRES SHAMPOING ', 'PANTENE', 'PROCTER & GAMBLE', '', 'COLOR & PERM', '2013-01-01', '2021-12-31', '');
