('PRO036', 'OFFRE PRO - FB VIVITE CRYSTAL WHITE + TROS CLEAR ', '<b>INGREDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Ingrédients principaux de VIVITE CRYSTAL WHITE</b><br>\r\n<b>Extrait de graines de Glycine soja :</b> agent d\'entretien de la peau, elle  participe à la régénération cutanée en protégeant la peau du dessèchement et en la nourrissant en profondeur\r\n<b>Lécithine marine (issue des œufs de poisson) : </b> anti-inflammatoire et adoucit la peau\r\n<b>Allantoïne (grande source de Vitamine E) :</b> apaisante et anti-irritante, régénérante, hydratante, adoucissante<br>\r\n<br>\r\n<b>Ingrédients principaux de TROS CLEAR ULTRA COOL  & DRY</b><br>\r\n<b>Eau de Mer :</b> elle améliore l\'hydratation de la peau, favorise la cicatrisation, elle lutte contre la bactérie responsable de l\'acné<br> \r\n<b>Usnea barbarta (Litchen) ext / Extrait de barbe de jupiter / Extrait de Lichen :</b> anti-microbien, réduit ou masque les odeurs corporelles désagréables, raite les imperfections de la peau<br>\r\n\r\n<b>AUTRES INGREDIENTS </b><br>\r\n<br>\r\n<b>Autres ingrédients de VIVITE CRYSTAL WHITE</b><br>\r\nAqua, Aluminim, chlorophydrate, Steareth-21, Steareth-2PPG-15, Stearylether,\r\nCyclopentasiloxane, Fragrance, Magnesium aluminium silicate, Glycine soja (soybean) ,seed extract/ Butylene glycol, PEG-4/ Lactic acid/ Kojic acid/ Morus alba root extract / Arcto staphylos uva-ursi leaf extract/ Glycyrrhiza glabra root extract, Hydrogenated lecithin/ Sodium oleate / Glycine soja (soybean) oil/ Glycerin/ Disodium EDTA / Oligopeptide-3, Caprylyl methicone, Propanediol dicaprylate, Pentaerythrityl tetra-di-t-butyl/ hydroxyhydricinnamate, Tetrasodium EDTA, Benzethonium chloride, Phenoxyethanol/lodopropynyl/butylcarbamate<br>\r\n<br>\r\n<b>Autres ingrédients de TROS CLEAR ULTRA & COOL</b><br>\r\nAqua, Alcohol denat, Aluminium chiorohydrate, C12-15 Pareth-12, Butylene glycol, Fragrance, Hydroxyethylcellulose, triclosan, Menthylsuccinate, Methylchloroisothizolinone/ Methylisothizolinone, Benzophenone-3, CI 42090, CI 17200<br>                                                                                                                                                                           ', '                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Frotter les aisselles avec un gant de toilette savonné<br>\r\n<b>Etape 2:</b> Rincer et tapoter avec une serviette<br>\r\n<b>Etape 3:</b> Appliquer le déodorant<br>\r\n<b>Etape 4:</b> Attendre 1 ou 2 minutes avant d’enfiler un vêtement<br>\r\n\r\n                                                                                                                  ', '        <p>Inona no ', ' <b>PRESENTATION</b><br>\r\n<br>\r\nNy déodorant TROS 3D sy VIVITE indray no vokatra vaovao entiko ho anao androany. Vokatra novokarin ny orinana NEO CORPORATIO ny déodorant TROS 3D, mampihena ny hatsembohana ary mamona ireo bacteria izay mahatonga ireo fofona mety hanelingelina amin ny vatan-tsika ireny.<br>\r\nAnkoatra izay, misy hanitra malefaka, marfum an-dehilahy, 48 ora be izao ny faharetany.<br> \r\nVetivety monja ny déodorant TROS 3D dia maina raha vantany vao hahositra amin\'ny helika ka tsy mamela faritra amin ny akanjo.<br>\r\nNy déodorant VIVITE indray dia sady mitroka ny hatsembohana izay mety hanelingelina anao mandritry ny andro no tsara fofona ka manome fraicheur tsy manan-tsahala ho anao. Tsy mamela trace amin’ny akanjo izy sady maharitra 48 ora ny fiasany. <br>\r\nMora dia mora ny vidin\'ity pack ity.  …….Ar monja no ahazoanao ireo vokatra 2 ireo raha toa ka ......... Ar ny fitambarany raha mividy azy tsirairay ianao.  Araraoty ary o !<br>', '25 ml', '<b>CARACTERISTIQUES</b><br>\r\n<br>\r\n<b>Caractéristiques de VIVITE CRYSTAL WHITE </b><br>\r\nVIVITE CRYSTAL WHITE est un déodorant conçu spécialement pour les peaux sensibles, il ne contient pas d’alcool<br>\r\n- Octroie de la fraîcheur tout au long de la journée<br>\r\n- Offre une protection efficace longue duréecontre les mauvaises odeurs<br> \r\n- Adoucit, hydrate et éclaircit  la peau<br>\r\n- Régénère la peau abîmée par l’agression du rasoir<br>\r\n- Evite les taches blanches sur les vêtements de couleur et les taches jaunes sur les vêtements blancs<br>\r\n<br>\r\n<b>Caractéristiques de TROS CLEAR ULTRA COOL  & DRY</b><br>\r\nLe déodorant CLEAR ULTRA COOL & DRY est composée par une formule spéciale Clear & Cool développée pour ne laisser aucune tache<br>\r\n- Le Complexe Ultra Cool octroie une protection de longue durée contre les mauvaises odeurs<br> \r\n- Le Système Dry Advance permet un séchage rapide pour ne laisser aucune tache et contient la transpiration excessive<br>\r\n<br>                                                                                                                                                                                                           ', 1, 36, 'COMBO DEO', 'TROS & VIVITE', 'NEO CORPORATION ', '', 'COMBO DEO CRYSTAL', '2013-01-01', '2021-12-31', ''),
('PRO037', 'OFFRE PRO - FB VIVITE LESS SHAVE + TROS CLEAR ', '<b>INGREDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Ingrédients principaux de VIVITE ESSENTIAL LESS SHAVE </b><br>\r\n<b> Extrait de graines de glycine soja :</b> participe à la régénération cutanée en protégeant la peau du dessèchement et en la nourrissant en profondeur<br>\r\n<b> Oligopeptide-3protéine :</b> agent antivieillissement de la peau, agent blanchissant éclaircissant, augmente la production de collagène, diminue la profondeur des rides <br>\r\n<b> Extrait de racine de mûrier blanc :</b> lui assure une action anti-taches sur la peau et aide à éclaircir le teint<br>\r\n<b>Extrait de feuilles de raisin : </b> lutte contre le vieillissement cutané,nourrit une peau sèche ou hydrate une peau grasse<br>\r\n<b>Extrait de réglisse :</b> lutte contre les taches pigmentaires de la peau<br>\r\n<b>Extrait de feuille de busserole :</b> atténue les imperfections de la peau ou du teint<br>\r\n<br>\r\n<b>Ingrédients principaux de TROS CLEAR ULTRA COOL  & DRY</b><br>\r\n<b>Eau de Mer :</b> améliore l\'hydratation de la peau, favorise la cicatrisation, elle lutte contre la bactérie responsable de l\'acné<br> \r\n<b>Usnea barbarta (Litchen) ext / Extrait de barbe de jupiter / Extrait de Lichen:</b> anti-microbien, réduit ou masque les odeurs corporelles désagréables, raite les imperfections de la peau<br>\r\n<br>\r\n\r\n<b>AUTRES INGREDIENTS</b><br>\r\n<br>\r\n<b>Autres ingrédients de VIVITE ESSENTIAL LESS SHAVE </b><br>\r\nAqua,Aluminim chlorophydrate, Steareth-21, Steareth-2PPG-15,Stearyl ether ,Cyclopentasiloxane, Fragrance, Magnesium aluminium silicate, Glycine soja (soybean) ,seed extract/ Butylene glycol, PEG-4/ Lactic acid/ Kojic acid/ Morus alba root extract / Arcto staphylos uva-ursi leaf extract/ Glycyrrhiza glabra root extract, Hydrogenated lecithin/ Sodium oleate / Glycine soja (soybean) oil/ Glycerin/ Disodium EDTA / Oligopeptide-3, Caprylyl methicone, Propanediol dicaprylate, Pentaerythrityl tetra-di-t-butyl/ hydroxyhydricinnamate, Tetrasodium EDTA, Benzethonium chloride, Phenoxyethanol/ lodopropynyl/ butylcarbamate<br>\r\n<br>\r\n<b>Autres ingrédients de TROS CLEAR ULTRA COOL  & DRY </b><br>\r\nAqua, Alcohol denat, Aluminium chiorohydrate, C12-15 Pareth-12, Butylene glycol, Fragrance, Hydroxyethylcellulose, triclosan, Menthylsuccinate, Methylchloroisothizolinone/ Methylisothizolinone, Benzophenone-3, CI 42090, CI 17200<br>                  ', '                                                                                                                                                                                                                                                      <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Frotter les aisselles avec un gant de toilette savonné<br>\r\n<b>Etape 2:</b> Rincer et tapoter avec une serviette<br>\r\n<b>Etape 3:</b> Appliquer le déodorant<br>\r\n<b>Etape 4:</b> Attendre 1 ou 2 minutes avant d’enfiler un vêtement<br>                                                                                                                                                                                                                                                                                                                                                                                           ', '<p><em><strong>Inona', '<b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba  anao, Aina commercial avy ao amin ny One To One Marketing.<br>\r\nNy déodorant TROS 3D sy VIVITE indray no vokatra vaovao entiko ho anao androany. Vokatra novokarin ny orinana NEO CORPORATIO ny déodorant TROS 3D, mampihena ny hatsembohana ary mamona ireo bacteria izay mahatonga ireo fofona mety hanelingelina amin ny vatan-tsika ireny.<br>\r\nAnkoatra izay, misy hanitra malefaka, marfum an-dehilahy, 48 ora be izao ny faharetany.<br> \r\nVetivety monja ny déodorant TROS 3D dia maina raha vantany vao hahositra amin\'ny helika ka tsy mamela faritra amin ny akanjo.<br>\r\nNy déodorant VIVITE indray dia sady mitroka ny hatsembohana izay mety hanelingelina anao mandritry ny andro no tsara fofona ka manome fraicheur tsy manan-tsahala ho anao. Tsy mamela trace amin’ny akanjo izy sady maharitra 48 ora ny fiasany. <br>\r\nMora dia mora ny vidin\'ity pack ity.  …….Ar monja no ahazoanao ireo vokatra 2 ireo raha toa ka ......... Ar ny fitambarany raha mividy azy tsirairay ianao.  Araraoty ary o !<br>\r\n', '2', '<b>CARACTERISTIQUES</b><br>\r\n<br>\r\n<b>Caractéristiques de VIVITE ESSENTIAL LESS SHAVE </b><br>\r\nVIVITE ESSENTIAL LESS SHAVE est un déodorant conçu spécialement pour les peaux sensibles, il ne contient pas d’alcool<br>\r\n- Octroie de la fraicheur tout au long de la journée<br>\r\n- Offre une protection efficace longue duréecontre les mauvaises odeurs<br> \r\n- Adoucit, hydrate et éclaircit la peau<br>\r\n- Ralentit la repousse des poils et les affinés<br>\r\n- Evite les taches blanches sur les vêtements de couleur et les taches jaunes sur les vêtements blancs<br>\r\n<br>\r\n<b>Caractéristiques de TROS CLEAR ULTRA COOL & DRY </b><br>\r\nLe déodorant TROS CLEAR ULTRA COOL & DRY est composé par une formule spéciale Clear & Cool développée pour ne laisser aucune tache<br> \r\nLe Complexe Ultra Cool octroie une protection de longue durée contre les mauvaises odeurs<br>  \r\nTandis que le Système Dry Advance assure un séchage rapide pour ne laisser aucune tache et contient la transpiration excessive<br>\r\n<br>                                                                                                                                                                                                          ', 1, 36, 'COMBO DEO', 'VIVITE & TROS', 'NEO CORPORATION', '', 'COMBO DEO ESSENTIAL', '2013-01-01', '2021-12-31', ''),
('PRO038', 'OFFRE PRO - FB VIVITE LESS SHAVE + FEMININE CLEANSING ', '                                                                                                <b>INGREDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b> Ingrédients principaux de VIVITE ESSENTIAL LESS SHAVE</b><br>\r\n<b>Extrait de graines de glycine soja:</b> participe à la régénération cutanée en protégeant la peau du dessèchement et en la nourrissant en profondeur<br>\r\n<b>Oligopeptide-3protéine:</b> agent anti-vieillissement de la peau, agent blanchissant éclaircissant, augmente la production de collagène, diminue la profondeur des rides <br>\r\n<b>Extrait de racine de mûrier blanc:</b> assure une action anti-taches sur la peau et aide à éclaircir le teint<br>\r\n<b>Extrait de feuilles de raisin:</b> lutte contre le vieillissement cutané, nourrit une peau sèche ou hydrate une peau grasse<br>\r\n<b>Extrait de réglisse:</b> lutte contre les taches pigmentaires de la peau, anti-inflammatoire et adapté au soin des peaux irritées<br>\r\n<b>Extrait de fleur de camomille:</b> octroie un parfum apaisant à la camomille<br>\r\n<br>\r\n<b>Ingrédients principaux de FEMININE CLEANSING EXTRA SENSITIVE SKIN </b><br>\r\n<b>Acide lactique: </b> réduit la perte d\'eau de la peau et maintient l\'équilibre hydrique de la peau \r\n<b>Extrait de Fleur de Mallow:</b> protège des irritations et protège les peaux hypoallergéniques<br>\r\n\r\n<b>AUTRES INGREDIENTS </b><br>\r\n<br>\r\n<b>Autres ingrédients de VIVITE ESSENTIAL LESS SHAVE</b><br>\r\nAqua,Aluminim chlorophydrate, Steareth-21, Steareth-2PPG-15,Stearyl ether ,Cyclopentasiloxane, Fragrance, Magnesium aluminium silicate, Glycine soja (soybean) ,seed extract/ Butylene glycol, PEG-4/ Lactic acid/ Kojic acid/ Morus alba root extract / Arcto staphylos uva-ursi leaf extract/ Glycyrrhiza glabra root extract, Hydrogenated lecithin/ Sodium oleate / Glycine soja (soybean) oil/ Glycerin/ Disodium EDTA / Oligopeptide-3, Caprylyl methicone, Propanediol dicaprylate, Pentaerythrityl tetra-di-t-butyl/ hydroxyhydricinnamate, Tetrasodium EDTA, Benzethonium chloride, Phenoxyethanol/ lodopropynyl/ butylcarbamate<br>\r\n<br>\r\n<b>Autres ingrédients de FEMININE CLEANSING EXTRA SENSITIVE SKIN </b><br>\r\nAqua, Sodium laureth sulfate, Cocamidopropyl betaine, Acrylates crosspolymer-4, Fragrance, Cocamide DEA, Potassium hydroxide, Lactic acid, Mallox (Malva sylvestris) ext/ Glycerin/ Butylene glycol, O-Cymen-5-ol, Methylchloroisothiazolinone/ Methylisothiazolinone<br>\r\n<br                                                                                                                                     ', '                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Mode d’utilisation de VIVITE ESSENTIAL LESS SHAVE</b><br>\r\n<b>Etape 1:</b> Frotter les aisselles avec un gant de toilette savonné<br>\r\n<b>Etape 2:</b> Rincer et tapoter avec une serviette<br>\r\n<b>Etape 3:</b> Appliquer le déodorant VIVITE<br>\r\n<b>Etape 4:</b> Attendre 1 ou 2 minutes avant d’enfiler un vêtement<br>\r\n<br>\r\n<b>Mode d’utilisation de FEMININE CLEANSING EXTRA SENSITIVE SKIN </b><br>\r\n<b>Etape 1:</b> Durant la douche, mouiller la partie externe intime avec de l\'eau tiède <br>   \r\n<b>Etape 2:</b> Mettre 2 ou 3 gouttes de nettoyant intime sur la paume de la main puis frotter légèrement <br>\r\n<b>Etape 3:</b> Appliquer sur la partie externe de la partie intime et sur l’articulation de la cuisse<br>       \r\n<b>Etape 4:</b> Rincer immédiatement et soigneusement  avec de l\'eau propre légèrement chaude<br>  \r\n<br>                                                                                                      ', '<h4><strong>1- Tsy i', '                                                                                                                                                                                                                                                                                                                                                                                                 <b>PRESENTATION</b><br>\r\n<br>\r\n Faly miarahaba anao.Tsinjo commercial avy ao amin’ny one to one marketing. Amin’izao fotoana izao ny agence One To One dia manolotra PROMOTION pack « Nettoyant Intime BeNice rose sy déodorant VIVITE  essential less shave »<br>  \r\nNy « Nettoyant Intime BeNice » dia vokatra iray natokana ho an’ny vehivavy, entina hanadiovana ny faritra intime. <br>  \r\nNy mampiavaka azy ity dia noho izy vita avy amin’ny zava-maniry ary mety ho an’ny hoditra tena sensible noho izy manana PH neutre. Malefaka sy manitra ery ny fofony ary efa vita test Clinique izy ity.<br>  \r\nIndraindray negligen’ ny olona ny fanadiovana ny faritra intime izay tena sensible nefa tena ilaina satria soin quotidien tsy tokony hamaivanina ary tokony hampiasana vokatrana tokana manokana ho amin’izany mba hitazomana ny equilibre naturel. Tsy ny savony rehetra noho izany no afaka hanasana ny faritra intime.<br>  \r\nNy déodorant VIVITE indray dia sady mitroka ny hatsembohana izay mety hanelingelina anao mandritry ny andro no tsara fofona ka manome fraicheur tsy manan-tsahala ho anao. Tsy mamela trace amin’ny akanjo izy sady maharitra 48ora ny fiasany. <br>\r\nMora dia mora ny vidin\'ity pack ity.  …….Ar monja no ahazoanao ireo vokatra 2 ireo raha toa ka ......... Ar ny fitambarany raha mividy azy tsirairay ianao.  Araraoty ary o !<br>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                          ', '2', '                                                                                                 <b>CARACTERISTIQUES</b><br>\r\n<br>\r\n<b>Caractéristiques de VIVITE ESSENTIAL LESS SHAVE</b><br>\r\nVIVITE ESSENTIAL LESS SHAVE est un déodorant conçu spécialement pour les peaux sensibles, il ne contient pas d’alcool. Il: <br>\r\n- Octroie de la fraicheur tout au long de la journée<br>\r\n- Offre une protection efficace longue durée contre les mauvaises odeurs<br>\r\n- Adoucit, hydrate et éclaircit la peau<br>\r\n- Ralentit la repousse des poils et les affines<br>\r\n- Evite les taches blanches sur les vêtements de couleur et les taches jaunes sur les vêtements blancs<br>\r\n<br>\r\n<b>Caractéristiques de BENICE FEMININE CLEANSING EXTRA SENSITIVE SKIN</b><br>\r\nBENICE FEMININE CLEANSING EXTRA SENSITIVE SKIN est un gel lavant spécialement conçu pour l’hygiène intime féminine et convient pour peau sensible. Combinant les bienfaits d’ingrédients naturels rigoureusement sélectionnés. Il: <br>\r\n- Evite l\'accumulation des bactéries<br>\r\n- Lutte contre les odeurs vaginales <br>\r\n- Maintient l’équilibre du pH dans la partie intime<br>\r\n- Cliniquement prouvé pour être non irritant<br>\r\n<br>                                                                                                                                                                                                                                                                                              ', 1, 36, 'COMBO INTIMA', 'VIVITE & BENICE', 'NEO CORPORATION', '', 'COMBO INTIMA', '2013-01-01', '2021-12-31', ''),
