('PRO04', 'OFFRE PROMO TOTAL DAMAGE CARE 3MN MIRACLE ', '     <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Mélange de nutriments Pro-V:</b> renforce l\'intérieur des cheveux au niveau structurel et octroie une force durable pour réduire la chute des cheveux due à la casse<br>\r\n<b>Panthenol (dérivé de la Vitamine B5):</b> réduit les chutes de cheveux dues à la casse, favorise le démêlage des cheveux, donne un aspect épais aux cheveux fins, absorbe l’humidité détenue dans l’air afin de les protéger de la sécheresse.<br>\r\n<b>Extrait de protéine de soie:</b> améliore et maintient l\'hydratation des cheveux et les rend doux, soyeux et brillants.<br>\r\n<br>\r\n<b>AUTRES INGRÉDIENTS</b><br>\r\n<br>\r\n<b>Shampoing:</b> Water,Sodium Lauryl Sulfate, Sodium Laureth Sulfate, Sodium Chloride,Cocamidopropyl Betaine,Dimethicone,Glycol Distearate, Fragrance, Sodium citrate,Cocamide MEA, Sodium Xylenesulfonate,Citric Acid,Guar Hydroxypropyltrimonium Chloride, Sodium Benzoate, Tetrasodium EDTA, Trisodium Ethylenediamine Disuccinate, Panthenol, Pantheryl Ethyl Ether,Methylchloroisothiazolinone, Methylisothiazolinone<br>\r\n<br>\r\n<b>Après shampoing:</b> Water, Bis-Aminopropyl Dimethicone, Stearyl Alcohol, Behentrimonium Methosulfate, Cetyl Alcohol, Fragrance, Benzyl Alcohol, Disodium EDTA,Panthenol, Panthenyl Ethyl Ether, Silk Extract,Methylchloroisothiazolinone,Methylisothiazolinone CI19140, CI17200, CI42090 <br>                                                                                                                                               ', '  <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mouiller les cheveux à l’eau chaude<br>\r\n<b>Etape 2:</b> Appliquer et frotter le shampoing sur toute la surface des cheveux<br>\r\n<b>Etape 3:</b> Rincer et remettre du shampoing jusqu’à ce que les cheveux soient propre<br>\r\n<b>Etape 4:</b> Appliquer l’après shampoing après le lavage au shampoing <br>\r\n<b>Etape 5:</b> Masser le cuir chevelu  pendant 1 ou 2 minutes <br>\r\n<b>Etape 6:</b> Laisser reposer  pendant 3 mn <br>\r\n<b>Etape 7:</b> Rincer abondamment à l’eau froide <br>                                                                                                                                                ', '0', '   <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Toky avy ao amin’ny One To One Marketing .<br>\r\nAmin’izao fotoana izao ny agence One To One Marketing dia manao promotion amin’ny Pack PANTENE «shampoing» sy après-shampoing «Pantene pro-V 3minutes Miracle». Ao anatin’ny 3 minitra monja dia ho hitanao ny fiasany. Sady mampangirana ny volo izy no mampalama sy manalefaka azy noho izy «pro-vitaminé». Karazana pack 3 no atolotray: <br>\r\nNy TOTAL DAMAGE CARE (violet) dia miaro sy mitsabo ny volo vakivaky sy tapatapaka, <br>\r\nNy HAIR FALL CONTROL (rose) indray dia miaro ny volo amin’ny fihintsanana <br>\r\nAry ny COLOR & PERM dia natokana mba hiaro ny volo miloko sy natao Permanente. <br>Raha zatra nividy shampoing fotsiny amin’ny vidiny .......... Ar ianao teo aloha dia efa lasa ……..Ar monja ny pack iza ahitanao 01 shampoing 120 ml + 01 après shampoing 70 ml miaraka.<br>\r\nAnaovana madama? Tsy mifidy karazam-bolo ny PANTENE fa na gras na sec, na tsotra na oliholy dia afaka ampiasàna azy avokoa.<br>\r\nKoa iza no atao anao? Andramo anie dia ho hitanao ny hatsarany ee!<br>                                                                                                            ', '70 ml + 120 ml', '<b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nPANTENE est une marque de cosmétiques de soin capillaire conçu pour adoucir et embellir tous types de cheveux. La gamme PANTENE TOTAL DAMAGE CARE: <br>\r\n- Répare et scelle chaque mèche de cheveux <br>\r\n- Réduit la perte de protéines pour arrêter la progression des dommages <br>\r\n- Aide à prévenir les futures pointes fourchues sur 3 mois <br>\r\n- Lisse et adoucit les cheveux<br>                                                                                                                                                    ', 1, 37, 'SHAMPOING ET APRES SHAMPOING ', 'PANTENE', 'PROCTER & GAMBLE', '', 'TOTAL DAMAGE CARE 3M', '2013-01-01', '2021-12-31', ''),
('PRO040', 'OFFRE PRO - FB EGG WHITE ', '     <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Albumine:</b> nourrit et hydrate les peaux sèches, atténue les petites taches et unifie le teint<br>\r\n<b>Elastine hydrolysée:</b> anti-âge, ralentit efficacement le vieillissement cutané, protège et lisse avec souplesse la peau du visage<br>\r\n<b>Collagène:</b>  hydrate la peau, lui donne de la résistance, de l’élasticité et de la souplesse à la peau<br>\r\n<b>Jaune d’œuf:</b> nourrit et hydrate la peau, diminue les imperfections et les signes de fatigue<br>\r\n\r\n                                                                                   ', '   <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Ouvrir les pores du visage à l’aide de vapeur d’eau<br>\r\n<b>Etape 2:</b> Essuyer le visage délicatement avec une serviette sèche<br>\r\n<b>Etape 3:</b> Appliquer une couche plus au moins épaisse du masque EGG WHITE PEEL OFF MASK sur tout le visage sauf sur les yeux, les sourcils,  les lèvres et dans les narines<br>\r\n<b>Etape 4:</b> Laisser reposer pendant 20 à 30 mn<br> \r\n<b>Etape 5:</b> Arracher délicatement le masque du visage<br>\r\n<b>Etape 6:</b> Rincer le visage abondamment à l’eau claire et tiède<br>\r\n<b>Etape 7:</b> Le masque EGG WHITE PEEL OFF est recommandé pour une utilisation de 1 à 3 fois par semaine<br>\r\n                                                                                    ', '<p><em><strong>ARGUM', '    <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Rondro commercial ao amin\'ny One To One Marketing.<br>\r\nVokatra vaovao no hoentiko ho anao androany. Ny MISTINE EGG WHITE PEEL izay vokatra iray natao indrindra hikolokoloana ny tarehy.<br>\r\nNy atody no ankora fototra mandrafitra azy ity  ka: <br>\r\n- Manamandina ny tarehy maina sy miofakofaka<br>\r\n- Manala ireo tasy amin’ny tarehy ary manadio ny hodi-tava<br>\r\n- Ary manatsara ny hodi-tava sy miaro anao amin\'ny fahanteran\'ny hoditra<br> \r\n….. Ar ny vidin\'ny EGG WHITE PEEL. Marque MISTINE izy ity izay fanta-daza no marque tsara indrindra any Thailand ka azonao atokisana fa de première qualité<br>                                                      ', '80 g', '  <b>CARACTÉRISTIQUES</b><br>\r\n<br>	\r\nEGG WHITE PEEL OFF MASK est un masque facial de MISTINE aux jaunes d’œufs, une marque de pharmacie réputée en Thaïlande. Ce masque:<br> \r\n- Nettoie la peau en profondeur et éclaircit la peau du visage<br> \r\n- Raffermit la peau en resserrant les pores<br>\r\n- Donne une texture douce et lisse à votre visage<br>\r\n- Nourrit, atténue les petites taches et unifie le teint<br>\r\n- Hydrate la peau avec un bon équilibrage d’huile et de sébum<br>\r\n\r\n                                                                                                     ', 1, 36, 'MASQUE FACIAL', 'MISTINE', ' MISTINE', '', 'ALOE VERA', '2013-01-01', '2021-12-31', ''),
