otège de cuir chevelu contre les agressions extérieures<br>\r\n                                                                                                                                                                 ', 1, 36, 'SHAMPOING ET APRES SHAMPOING ', 'PANTENE', 'PROCTER & GANBLE', '', 'HAIR FALL CONTROL', '2013-01-01', '2021-12-31', ''),
