('VIS005', 'TROS FACIAL FOAM AGE POWER & WHITE ', '                                                                                                            <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extraits d\'algues Wakame:</b> riche en nutriments et en minéraux, ces végétaux jouent un rôle important dans le renouvellement des cellules de la peau, ce qui en fait un soin anti-âge particulièrement apprécié<br>\r\n<b>Extraits de vitamine C:</b><br>\r\n<b>- Un actif talentueux (l\'organisme comme la peau a besoin de la vitamine C:</b> cette molécule est un allié antivieillissement qui agit sur tous les paramètres de la beauté de l\'épiderme) <br>\r\n<b>- Une action antiride(Intensément antioxydant, l\'acide ascorbique  (VITAMINE C):</b> protège des agressions et, donc, du vieillissement) <br>\r\n<b>Extraits de bave d’escargot:</b> possède de nombreuses vertus, très bénéfiques pour la peau: réparation, cicatrisation, souplesse, antivieillissement, hydratation, luminosité, protection<br>\r\n<br>                                                                                                                                                                        ', '                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mettre une petite quantité sur la main humide et faire mousser<br>\r\n<b>Etape 2:</b> Appliquer sur le visage après l’avoir humidifier<br>\r\n<b>Etape 3:</b> Masser le visage pour retirer la saleté et l’excès d’huile du visage sans dépasser 15 secondes<br>\r\n<b>Etape 4:</b> Rincer abondamment avec de l’eau tiède<br>\r\nNB: Convient à tous les types de peau<br>\r\n\r\n                                                                                                                                                                             ', '', '                                                                                                     <b>PRÉSE