('VIS014', 'MISTINE MASK EGG WHITE ', '                                                                                                 <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Albumine:</b> nourrit et hydrate les peaux sèches, atténue les petites taches et unifie le teint<br>\r\n<b>Elastine hydrolysée:</b> anti-âge, ralentit efficacement le vieillissement cutané, protège et lisse avec souplesse la peau du visage<br>\r\n<b>Collagène:</b>  hydrate la peau, lui donne de la résistance, de l’élasticité et de la souplesse à la peau<br>\r\n<b>Jaune d’œuf:</b> nourrit et hydrate la peau, diminue les imperfections et les signes de fatigue<br>                                                                                                                                                                                                                               ', '                                                                                                    <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Ouvrir les pores du visage à l’aide de vapeur d’eau<br>\r\n<b>Etape 2:</b> Essuyer le visage délicatement avec une serviette sèche<br>\r\n<b>Etape 3:</b> Appliquer une couche plus au moins épaisse du masque EGG WHITE PEEL OFF MASK sur tout le visage sauf sur les yeux, les sourcils,  les lèvres et dans les narines<br>\r\n<b>Etape 4:</b> Laisser reposer pendant 15 à 20 mn que ça sèche<br> \r\n<b>Etape 5:</b> Arracher délicatement le masque du visage<br>\r\n<b>Etape 6:</b> Rincer le visage abondamment à l’eau claire et tiède<br>\r\n<b>Etape 7:</b> Le masque EGG WHITE PEEL OFF est recommandé pour une utilisation de 1 à 3 fois par semaine<br>                                                                                                                                                                                                                                       ', '<p><strong>ARGUMENTA', '                                                                                                                                                                                                                                  \r\n<b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Rondro commercial ao amin\'ny One To One Marketing.<br>\r\nVokatra vaovao no hoentiko ho anao androany. Ny MISTINE EGG WHITE PEEL izay vokatra iray natao indrindra hikolokoloana ny tarehy.<br>\r\nNy atody no ankora fototra mandrafitra azy ity  ka: <br>\r\n- Manamandina ny tarehy maina sy miofakofaka<br>\r\n- Manala ireo tasy aminâ€™ny tarehy ary manadio ny hodi-tava<br>\r\n- Ary manatsara ny hodi-tava sy miaro anao amin\'ny fahanteran\'ny hoditra<br> \r\n….. Ar ny vidin\'ny EGG WHITE PEEL. Marque MISTINE izy ity izay fanta-daza no marque tsara indrindra any Thailand ka azonao atokisana fa de première qualité<br>\r\n                                                                                                                                                                                                                                                                        ', '80 g', '                                                                                                      <b>CARACTÉRISTIQUES</b><br>\r\n<br>	\r\nEGG WHITE PEEL OFF MASK est un masque facial de MISTINE aux jaunes d’œufs, une marque de pharmacie réputée en Thaïlande. Ce masque:<br> \r\n- Nettoie la peau en profondeur et éclaircit la peau du visage<br> \r\n- Raffermit la peau en resserrant les pores<br>\r\n- Donne une texture douce et lisse à votre visage<br>\r\n- Nourrit, atténue les petites taches et unifie le teint<br>\r\n- Hydrate la peau avec un bon équilibrage d’huile et de sébum<br>                                                                                                                                                                                                                                 ', 1, 29, 'MASQUE FACIAL', 'MISTINE', 'MISTINE', '', 'EGG WHITE', '2013-01-01', '2021-12-31', ''),
('VIS015', 'MISTINE FACIAL FOAM  FUK KAO ', '                                                                                                                                                <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Extrait de fruit du Dragon / Gac fruit (riche en vitamine C et E):</b> hydrate et nourrit la peau pour un aspect plus doux et  lisse<br>\r\n<b>Vitamine E:</b> ralentit  le vieillissement  de la peau<br>\r\n\r\n                                                                                                                                                                                                                                                                                                                                      ', '                                                                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Laver votre visage tous les jours<br>\r\n<b>Etape 2:</b> Presser la mousse dans la paume de votre main<br>\r\n<b>Etape 3:</b> Humidifier légèrement la mousse Fuk Kao Facial Foam<br>\r\n<b>Etape 4:</b> Appliquer sur tout le visage jusqu\'à pénétration dans la peau<br> \r\n<b>Etape 5:</b> Rincer abondamment à l\'eau claire<br>                                                                                                                                                                                                                                               ', '<p>ARGUMENTAIRE I</p', '                                                                                                                                                <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Rondro commercial avy ao amin\'ny One To One Marketing. Ny Facial Foam MISTINE FUK KAO  indray no vokatra vaovao ampahafantariko ho anao androany. Araka izany anarany izany dia mousse natao hanadiovana ny tarehy ity vokatra ity.<br>\r\nVoafantina amin\'ny alalan\'ny Gac fruit na fruit du Dragon izay malaza any Thailand any ho ankora anti-ride, manalama sy manamandina ny hoditra, manazava ary manena ny fipoitran\'ny mony ny Facial Foam MISTINE FUK KAO.<br>\r\nMahasolo savony ny FACIAL FOAM MISTINE FUK KAO ka rehefa manasa tarehy izany dia ny facial foam MISTINE FUK KAO foana no ampiasao; dia ho hitanao fa hadio sy halama tsy misy pentina ery ny tarehinao.<br>     \r\n……. Ariary monja ny vidin\'ny 80 gr ka anaovana madama a!!!?<br>                                                                                                                                  \r\n                                                                                                                                                                                                                                                                                                                   ', '80 g', '                                                                                                                                                <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nMistine Fuk Kao Facial Foam est une  mousse nettoyante pour le visage enrichie en vitamine C et E. Sa mousse:<br>\r\n- Nettoie la peau du visage  pour un teint bien clair et net<br>\r\n- Nourrit la peau du visage grâce à la libération continue de nutriments octroyés par les extraits de Gac Fruit<br> \r\n- Octroie un résultat lisse, adoucit et un effet plus jeune de la peau au toucher<br>\r\n- Hydrate la peau<br>                                                                                                                                                                                                                                                                                      ', 1, 19, 'MOUSSE NETTOYANTE', 'MISTINE', 'MISTINE', '', 'FUK KAO', '2013-01-01', '2021-12-31', ''),
('VIS016', ' FACIAL GEL ALOE VERA 100.ML', '                                                  <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br> \r\n<b>Aloe Vera:</b> aide à reconstituer l\'humidité tout en nettoyant votre visage<br>  \r\n<b>Eau de fleur de Rosa Damascena:</b> rend la peau éclatante<br> \r\n<b>Vinaigre de cidre:</b> nettoie en profondeur Enlever la saleté et l\'excès d\'huile sur la peau<br> \r\n                                                                                                                                ', '                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mouiller le visage avec de l’eau chaude<br>\r\n<b>Etape 2:</b> Appliquer une noisette du gel nettoyant Aloe Vera sur la paume de la main et frotter<br> \r\n<b>Etape 3:</b> Appliquer sur le visage en massant toutes les parties du visage en 15 secondes<br>\r\n<b>Etape 4:</b> Rincer abondamment avec de l’eau tiède, sans laisser de temps de pause<br>\r\n\r\n                                                                                                                                                   ', '', '                                                <b>PRÉSENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Elina  commercial avy ao amin\'ny one to one marketing no miresaka aminao.  Amin\'izao fotoana izao ny agence one to one dia manao lancement an\'ity vokatra vita avy amin\'ny Aloe vera.<br>\r\nMety amin\'ny karazan-koditra rehetra na dia somary sensible aza ary tena mety ihany koa amin\'ny olona izay manana fahasahiranana amin\'ny fanadiovana tarehy mitera menaka na gras.<br>                                                                                                                                                                                                                                                                              ', '100 ml', '                                                <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nLe Gel Nettoyant MISTINE ALOE nettoie le visage pour obtenir un teint clair, lisse, doux et bien hydraté. Il est idéal pour les peaux grasses car il élimine la saleté et l\'excès d\'huile sur la peau tout en donnant à la peau un effet  radieux et  naturel<br>\r\n                                                                                                                                                                                                           ', 1, 2, 'GEL NETTOYANT FACIAL', 'MISTINE', 'MISTINE', '', 'ALOE VERA', '2013-01-01', '2021-12-31', ''),
('VIS017', 'Aloe vera', '                                                                                                                                                <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n <b>Jus de feuille d\'aloe vera:</b> aide à reconstituer l\'humidité tout en nettoyant votre visage<br>\r\n<b>Extrait d\'écorce de saule:</b> lutte contre le mécanisme de surproduction de sébum et soigne les peaux grasses ou à imperfections<br> \r\n<b>Extrait de graines de Moringa:</b> protège la peau de la pollution par un effet barrière et chasse les impuretés qui auraient pu s\'incruster<br>\r\n<b>Extrait de racine de paille de Diss ou Paillote:</b> aide à la synthèse du collagène de la peau qui procurera une hydratation naturelle à la peau<br>\r\n<b>Extrait de fleur de reine des prés:</b> répare l’épiderme et aide à diminuer les traces d’imperfections, calme les peaux sensibilisées par les agressions extérieures, ressert les pores et aide à obtenir un teint plus lisse et plus uniforme<br>\r\n<b>Extrait de graine de lentille:</b> améliore la régénération de la peau pour prévenir le vieillissement prématuré et pour mieux guérir la peau en cas de plaies<br>\r\n<b>Extrait de fruit de plaquebière:</b>  conserve l’hydratation de la peau et augmente son éclat grâce à des niveaux élevés de vitamine C et de polyphénols<br>                                                                                                                                                                                                                        ', '                                                                                                                                                <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mouiller le visage avec de l’eau chaude<br> \r\n<b>Etape 2:</b> Appliquer une noisette du gel nettoyant Aloe Vera sur la paume de la main et frotter<br>\r\n<b>Etape 3:</b> Appliquer sur le visage en massant toutes les parties du visage en 15 secondes<br>\r\n<b>Etape 4:</b> Rincer abondamment avec de l’eau tiède, sans laisser de temps de pause<br>\r\n<b>Etape 5:</b> Essuyer le visage avec une serviette sèche puis appliquer le Masque Aloe Vera en évitant les sourcils, les paupières et les lèvres<br> \r\n<b>Etape 6:</b> Attendre 15 à 20 mn que ça sèche<br> \r\n<b>Etape 7:</b> Arracher délicatement le masque<br> \r\n<b>Etape 8:</b> Rincer abondamment avec de l’eau froide<br>                                                                                                                                                                                                                                ', '				            				', '                                                                                                                                                         <b>PRESENTATION</b><br>\r\n<br>\r\nFaly miarahaba anao, Elina  commercial avy ao amin\'ny one to one marketing no miresaka aminao.Amin\'izao fotoana izao ny agence one to one dia manao lancement an\'ity vokatra vita avy amin\'ny Aloe vera.<br>\r\nMety amin\'ny karazan-koditra rehetra na dia somary sensible aza ary tena mety ihany koa amin\'ny olona izay manana fahasahiranana amin\'ny fanadiovana tarehy mitera menaka na gras.<br>\r\n                                                                                                                                                                                               ', '50 g', '                                                                                                                                                <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nLe Masque MISTINE ALOE nettoie le visage et sous la peau pour obtenir un teint clair, lisse, doux et bien hydraté. Il est idéal pour les peaux grasses car il élimine la saleté et l\'excès d\'huile tout en donnant à la peau un effet  radieux et  naturel<br>\r\n                                                                                                                                                                                                                                ', 1, 19, 'MASQUE FACIAL', 'MISTINE', 'MISTINE', '', 'ALOE VERA', '2013-01-01', '2021-12-31', ''),
('VIS018', 'GOAT MILK', '          <b>INGRÉDIENTS PRINCIPAUX</b><br>\r\n<br>\r\n<b>Lait de chèvre: </b> nourrit la peau pour un aspect plus jeune, lisse et un teint unifié<br>\r\n<b>Extrait de gelée royale et extrait de feuille de ginkgo:</b> aident à maintenir l\'équilibre et la souplesse de la peau<br>                                    ', '       <b>MODE D’UTILISATION</b><br>\r\n<br>\r\n<b>Etape 1:</b> Mouiller le visage avec de l’eau chaude<br>\r\n<b>Etape 2:</b> Appliquer une noisette du gel nettoyant Aloe Vera sur la paume de la main et frotter<br>\r\n<b>Etape 3:</b> Appliquer sur le visage en massant toutes les parties du visage en 15 secondes <br> \r\n<b>Etape 4:</b> Rincer abondamment avec de l’eau tiède, sans laisser de temps de pause<br>                                   ', 'A complÃ©ter', '                                     A Compléter                                                        ', '85 g', '  <b>CARACTÉRISTIQUES</b><br>\r\n<br>\r\nMISTINE GOAT MILK est une mousse nettoyante pour le visage à base de lait de chèvre<br>\r\nElle est riche en vitamines et minéraux, ce qui lui permet de maintenir l\'équilibre et la souplesse de la peau<br>\r\nEn plus de nettoyer profondément la peau du visage, après son application, vous sentirez votre peau plus adoucir, plus jeune avec un teint unifié<br>                                             \r\n                                            ', 1, 18, 'MOUSSE NETTOYANTE FACIALE', 'MISTINE', 'MISTINE', '', 'GOAL MILK', '2013-01-01', '2021-12-31', ''),
